INSERT INTO `noticias` (`id`, `titulo`, `imagen_completa`, `alt_imagen_completa`, `descripcion_completa`, `imagen_resumida`, `alt_imagen_resumida`, `descripcion_resumida`, `hotel`, `fecha_noticia`) VALUES
(1, 'Nuevo raro disponible! El Césped', 'catalogo_cesped', 'Catalogo el cesped', '<p>Con el <strong>boom</strong> que ha provocado <em>Habbo Hotel: Orígenes</em>, llegó también el primer raro mítico que te hacíamos conocer y que iba a salir a la venta en esta noticia. Pasada la primera semana desde que la gente comenzó a jugar en dicho Hotel, se pone a la venta el segundo raro tan mítico como el primero. </p><p>El segundo raro, <strong>RARO El Césped</strong>, ya se encuentra disponible en el catálogo de <em>Habbo Hotel: Orígenes</em> por tiempo limitado. Podrás adquirirlo por un precio de 35 créditos. Los raros en este hotel serán lanzados los días martes de cada semana, salvo que haya excepciones.', 'rares_martes', 'nuevo raro martes 25 de junio del 2024', '<p class=\"noticia_descripcion\"><strong>Llega el segundo raro mítico a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el segundo raro, <strong>RARO El Césped</strong>, disponible por tiempo limitado. No te lo pierdas!</p>', 'es', '2024-06-25 06:04:06'),
(2, 'El Funky Friday ha vuelto!', 'funky_friday_21_06_2024', 'La vuelta del Funky Friday imagen oficial', '<p><strong>El regreso de FUNKY FRIDAY a Habbo Hotel: Orígenes!</strong></p><p>El día de hoy, llega una nueva categoría en el catálogo llamada Funky Friday, que contiene los furnis Plasto en cinco nuevos colores, sumando un total de 30 nuevos furnis Plasto. Estos estarán disponibles por solo 24 horas durante este viernes y sus precios varían entre 6 créditos y 10 créditos.</p><p><em>Nota: la decisión de volver a poner a la venta estos objetos en el Catálogo después de las 24 horas sera una decision que se tomara por votación mediante una encuesta en el Infobús.</em></p>', 'funky_friday', 'La vuelta del Funky Friday', '<p class=\"noticia_descripcion\"><strong>El regreso de FUNKY FRIDAY a Habbo Hotel: Orígenes!</strong> Mas de 30 artículos de Plasto te están esperando</p>', 'es', '2024-06-21 06:04:20'),
(3, 'Nuevos furnis Funky!', 'funky_friday_28_06_2024', 'Nuevos furnis Funky Friday imagen oficial', '<p><strong>Funky Friday regresa a Habbo Hotel: Orígenes!</strong></p><p>El día de hoy, llega nuevamente la categoría Funky Friday en el catálogo y, en esta ocasión, recibe las Alfombras Falso Oso en cuatro nuevos colores. Estas estarán disponibles por solo 24 horas durante este viernes y su precio es de 10 créditos cada una.</p><p><em>Nota: la decisión de volver a poner a la venta estos objetos en el Catálogo después de las 24 horas sera una decision que se tomara por votación mediante una encuesta en el Infobús.</em></p>', 'funky_friday', 'Nuevos furnis Funky Friday', '<p class=\"noticia_descripcion\">Descubre las nuevas Alfombras Falso Oso en cuatro colores diferentes. Disponibles solo por 24 horas!</p>', 'es', '2024-06-28 06:04:27'),
(4, 'Nuevo raro disponible! La Habbocola', 'catalogo_habbocola', 'Catalogo habbocola', '<p><strong>El primer rare de Habbo Hotel: Orígenes: La Habbocola!</strong></p><p>La Habbocola fue el primer rare en salir en el hotel. Se lanzó a un precio de 50 créditos y estuvo disponible durante una semana en el catálogo.</p><p><em>Nota: la disponibilidad de La Habbocola en el Catálogo fue limitada y está garantizado que no volvera a estar disponible en el futuro.</em></p>', 'rares_martes', 'nuevo raro martes 18 de junio del 2024', '<p class=\"noticia_descripcion\"><strong>Llega el primer raro mítico a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el primer raro, <strong>RARO La Habbocola</strong>, disponible por tiempo limitado. No te lo pierdas!</p>', 'es', '2024-06-18 06:04:33'),
(5, 'Nuevo raro disponible! Almohadon Purpura', 'catalogo_almohadon_purpura', 'Catalogo Almohadon Purpura', '<p><strong>El terce rare de Habbo Hotel: Orígenes: El almohadon Purpura!</strong></p><p>Es martes de rares!! Llego el Almohando Purpura a 50 créditos y estara disponible durante una semana en el catálogo.</p><p><em>Nota: la disponibilidad de La Habbocola en el Catálogo es limitada y está garantizado que no volvera a estar disponible en el futuro.</em></p>', 'rares_martes', 'nuevo raro martes 02 de julio del 2024', '<p class=\"noticia_descripcion\"><strong>Llega el tercer raro mítico a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el tercer raro, <strong>RARO Almohadon Purpura</strong>, disponible por tiempo limitado. No te lo pierdas!</p>', 'es', '2024-07-02 06:04:39'),
(6, 'La primera STAFF de habbo origins ES!', 'dalmia_staff', 'Dalmia staff habbo origins', '<p><strong>Habbo origins ES tiene su primer STAFF</strong></p><p>Dalmia se convierte oficialmente en el primer STAFF de habbo origins ES, envio algunos mensajes generales, hablo un rato de ella y cual sera su rol.</p><p><em>Nota: Dalmia aclaro que solo es un STAFF que se dedica a las redes sociales, sin embargo no nos quita la emocion de que por lo menos ya tenemos un STAFF</em></p>', 'staff', 'dalmia nuevo staff habbo origins', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel Origins ES tiene un nuevo STAFF</strong> Descubre la visita del nuevo <strong>STAFF DALMIA</strong>!!</p>', 'es', '2024-07-02 06:04:46'),
(7, 'Nuevo Viernes Nuevo Funky!', 'funky_friday_05_07_2024', 'Viernes Funky 05 de julio de 2024', '<p><strong>Funky Friday regresa a Habbo Hotel: Orígenes!</strong></p><p>El día de hoy, llega nuevamente la categoría Funky Friday en el catálogo y, en esta ocasión, recibe las Guinarnalda (Acebos) en dos nuevos colores. Estas estarán disponibles por solo 24 horas durante este viernes y su precio es de 5 créditos cada una.</p><p><em>Nota: la decisión de volver a poner a la venta estos objetos en el Catálogo después de las 24 horas sera una decision que se tomara por votación mediante una encuesta en el Infobús.</em></p>', 'funky_friday', 'Nuevos furnis Nuevo Funky', '<p class=\"noticia_descripcion\">Descubre las nuevas Guirnaldas en dos colores diferentes. Disponibles solo por 24 horas!</p>', 'es', '2024-07-05 06:04:52'),
(8, 'Nuevo raro disponible! Huevo de Dragón', 'catalogo_huevo_dragon', 'Catalogo Huevo de Dragón', '<p><strong>El nuevo raro de Habbo Hotel: Orígenes: Huevo de Dragón!</strong></p><p>El Huevo de Dragón ya se encuentra disponible en el catálogo de Habbo Hotel: Orígenes por tiempo limitado. Podrás adquirirlo por un precio de 50 créditos. No te lo pierdas! Disponible hasta el 16 de julio.</p>', 'rares_martes', 'nuevo raro martes 09 de julio del 2024', '<p class=\"noticia_descripcion\"><strong>Llega el nuevo raro a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el nuevo raro, <strong>RARO Huevo de Dragón</strong>, disponible por tiempo limitado. No te lo pierdas!</p>', 'es', '2024-07-09 06:05:13'),
(9, 'Nuevo artículo disponible! Teleport Británico Funky', 'funky_friday_12_07_2024', 'Catalogo Teleport Británico Funky', '<p><strong>Nuevo artículo en el catálogo: Teleport Británico Funky!</strong></p><p>El Teleport Británico Funky estuvo disponible en el catálogo por solo 24 horas. Podrás adquirirlo por un precio de 10 créditos. Esperamos que hayas podido conseguirlo!</p>', 'funky_friday', 'nuevo artículo Teleport Británico Funky', '<p class=\"noticia_descripcion\"><strong>Llega el nuevo artículo a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el nuevo <strong>Teleport Británico Funky</strong>, disponible por tiempo limitado. No te lo pierdas!</p>', 'es', '2024-07-12 06:05:19'),
(10, 'Nuevo raro disponible! Heladera Dorada', 'catalogo_heladera_dorada', 'Catalogo Heladera Dorada', '<p><strong>El nuevo raro de Habbo Hotel: Orígenes: Heladera Dorada!</strong></p><p>Hoy, 16 de julio de 2024, se lanza un nuevo raro mítico en el catálogo de Habbo Hotel: Orígenes. La <strong>Heladera Dorada</strong> ya está disponible por tiempo limitado a un precio inicial de 50 créditos. No pierdas la oportunidad de agregar esta pieza única a tu colección. Date prisa, estará disponible solo por una semana!</p>', 'rares_martes', 'nuevo raro martes 16 de julio del 2024', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el nuevo raro, <strong>RARO Heladera Dorada</strong>, disponible por tiempo limitado. No te lo pierdas!</p>', 'es', '2024-07-16 06:05:25'),
(11, 'Nuevo Viernes Funky! Colección de Felpudos', 'funky_friday_19_07_2024', 'Funky Friday 19 de julio de 2024', '<p><strong>Funky Friday regresa a Habbo Hotel: Orígenes!</strong></p><p>Hoy, en el catálogo de Funky Friday, llega una colección especial de 47 felpudos, disponibles en una variedad de diseños y colores. Cada felpudo está disponible por un precio de 2 créditos y estarán en el catálogo solo por 24 horas. No te pierdas la oportunidad de coleccionarlos todos!</p><p><em>Nota: La disponibilidad de estos felpudos es limitada y estarán disponibles solo durante el día de hoy.</em></p>', 'funky_friday', 'Funky Friday colección de felpudos', '<p class=\"noticia_descripcion\"><strong>Llega una nueva colección a Habbo Hotel: Orígenes!</strong> Descubre y adquiere los nuevos felpudos disponibles solo por 24 horas. No te lo pierdas!</p>', 'es', '2024-07-19 06:05:29'),
(12, 'Nuevo Viernes Funky! Plasto Aqua', 'funky_friday_26_07_2024', 'Funky Friday 26 de julio de 2024', '<p><strong>Funky Friday regresa a Habbo Hotel: Orígenes!</strong></p><p>Esta semana, la categoría Funky Friday en el catálogo presenta una nueva colección de furnis Plasto en color aqua. La colección incluye un pod, una silla y cuatro tipos de mesas. El pod está disponible por 10 créditos, mientras que la silla y las mesas están disponibles por 6 créditos cada una. No te pierdas estos exclusivos artículos disponibles solo por 24 horas!</p><p><em>Nota: La disponibilidad de estos furnis es limitada y estarán en el catálogo solo durante el día de hoy.</em></p>', 'funky_friday', 'Funky Friday Plasto Aqua', '<p class=\"noticia_descripcion\"><strong>Llega una nueva colección a Habbo Hotel: Orígenes!</strong> Descubre y adquiere los nuevos furnis Plasto en color aqua, disponibles solo por 24 horas. No te lo pierdas!</p>', 'es', '2024-07-26 06:05:34'),
(13, 'Nuevo raro disponible! Humareda Roja', 'catalogo_humareda_roja', 'Catalogo Humareda Roja', '<p><strong>Nuevo raro en Habbo Hotel: Orígenes: Humareda Roja!</strong></p><p>El 23 de julio de 2024, se lanzó el sexto raro del hotel, <strong>Humareda Roja</strong>, que se ofrece a un precio de 35 créditos, igual que el segundo raro lanzado anteriormente. Este raro estará disponible en el catálogo por un tiempo limitado de 7 días. Aprovecha la oportunidad de agregar este exclusivo ítem a tu colección!</p><p><em>Nota: La disponibilidad de Humareda Roja es limitada y no volverá a estar disponible en el futuro.</em></p>', 'rares_martes', 'nuevo raro martes 23 de julio del 2024', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el nuevo raro, <strong>RARO Humareda Roja</strong>, disponible por tiempo limitado. No te lo pierdas!</p>', 'es', '2024-07-23 06:05:43'),
(14, 'Nuevo raro disponible! Fontana Mágica Azul', 'catalogo_fontana_azul', 'Catalogo Fontana Mágica Azul', '<p><strong>Nuevo raro en Habbo Hotel: Orígenes: Fontana Mágica Azul!</strong></p><p>El 30 de julio de 2024, se lanzó el raro <strong>Fontana Mágica Azul</strong>, disponible por un precio de 75 créditos. Este raro estará en el catálogo por tiempo limitado de solo 72 horas, siendo el primer raro en tener una disponibilidad tan corta. No pierdas la oportunidad de agregar esta exclusiva pieza a tu colección!</p><p><em>Nota: La disponibilidad de la Fontana Mágica Azul es limitada y no volverá a estar disponible en el futuro.</em></p>', 'rares_martes', 'nuevo raro martes 30 de julio del 2024', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el nuevo raro, <strong>RARO Fontana Mágica Azul</strong>, disponible solo por 72 horas. ¡No te lo pierdas!</p>', 'es', '2024-07-30 06:05:48'),
(15, '¡Las candidaturas para ser Hobba están abiertas!', 'hobba_noticia', 'Promoción Hobba en Habbo Hotel: Orígenes', '<p><strong>¡Las candidaturas para ser Hobba están abiertas en Habbo Hotel: Orígenes!</strong></p><p>Ahora mismo estamos aceptando candidaturas para el programa de Hobbas de Habbo Hotel: Orígenes. Lxs Hobbas son jugadores que tienen ciertos poderes específicos y limitados dentro del juego. Su labor es hacer que la experiencia en el juego sea más agradable tanto para novatxs como para veteranxs de la plataforma.</p><p>Hemos redactado una página que recoge las preguntas y respuestas frecuentes sobre lxs Hobbas. Puedes encontrarla <a href=\"https://origins.habbo.es/community/article/108/108\">aquí</a>.</p><p><strong>📨 Preséntate a Hobba</strong></p><p>Buscamos jugadores madurxs, amables y que conozcan el juego; que quieran contribuir a hacer de Habbo Hotel Orígenes un lugar mejor tanto para novatxs como para veteranxs. Si te quieres presentar, rellena este <a href=\"https://origins.habbo.es/community/article/108/108\">formulario de Google</a>. Necesitarás una cuenta de Gmail para poder hacerlo.</p><p><strong>🙋 El proceso de selección</strong></p><p>Para garantizar la selección de lxs Habbos más adecuadxs para el programa Hobba, elegiremos \"a mano\" entre lxs candidatxs. La implementación de los poderes Hobba que se decidieron tras la votación de la comunidad sigue estando en construcción. Esperamos poder aportar noticias sobre el tema cuando lancemos el programa en agosto o septiembre.</p>', 'staff', 'Promoción Hobba', '<p class=\"noticia_descripcion\"><strong>¡Las candidaturas para ser Hobba están abiertas!</strong> Conviértete en parte del programa de Hobbas y ayuda a mejorar la experiencia de Habbo Hotel: Orígenes. <a href=\"https://origins.habbo.es/community/article/108/108\">¡Aplica ahora!</a></p>', 'es', '2024-07-30 06:05:54'),
(16, 'Nuevo Viernes Funky! Bonsáis Funky', 'funky_friday_02_08_2024', 'Viernes Funky 02 de agosto de 2024', '<p><strong>Funky Friday regresa a Habbo Hotel: Orígenes!</strong></p><p>Hoy, en el catálogo de Funky Friday, llega una nueva colección de Bonsáis Funky. Hay tres tipos de Bonsáis disponibles, cada uno a un precio de 5 créditos. Estos estarán en el catálogo solo por 24 horas. No te pierdas la oportunidad de coleccionarlos todos!</p><p><em>Nota: La disponibilidad de estos Bonsáis es limitada y estarán disponibles solo durante el día de hoy.</em></p>', 'funky_friday', 'Funky Friday Bonsáis Funky', '<p class=\"noticia_descripcion\"><strong>Llega una nueva colección a Habbo Hotel: Orígenes!</strong> Descubre y adquiere los nuevos Bonsáis Funky disponibles solo por 24 horas. No te lo pierdas!</p>', 'es', '2024-08-02 06:06:01'),
(17, 'Nueva mecánica de PLACAS en el Discord de THO!', 'discord_placas_THO', 'Nueva mecánica de PLACAS en el Discord de Tho', '<p><strong>Nueva mecánica de PLACAS en el Discord de Tho!</strong></p><p>Estamos emocionados de anunciar que se ha implementado una nueva mecánica de PLACAS en nuestro Discord. Actualmente, existen 3 placas que se otorgan por diferentes motivos:</p><ul><li>A cualquiera que reaccione al mensaje <a href=\"https://discord.com/channels/1257448055050080297/1258417994543927338/1269819982678589561\">aquí</a>, se le dará la placa <strong>Pionero</strong>. Esta placa solo estará disponible durante 7 días.</li><li>A los ganadores de sorteos, concursos y competiciones se les otorgará la placa <strong>Ganador/a</strong>.</li><li>A los que debaten activamente sobre precios y votan en las encuestas se les dará la placa <strong>Discutidores de mercado</strong>.</li></ul><p>No pierdas la oportunidad de participar y ganar estas exclusivas placas en nuestro Discord!</p>', 'THO', 'Nueva mecánica de PLACAS en el Discord de Tho', '<p class=\"noticia_descripcion\"><strong>Nueva mecánica de PLACAS en el Discord de Tho!</strong> Participa y gana las nuevas placas <strong>Pionero</strong>, <strong>Ganador/a</strong> y <strong>Discutidores de mercado</strong>. ¡No te lo pierdas!</p>', 'es', '2024-08-04 06:06:06'),
(18, '¡Battle Ball Rebound llega a Habbo Hotel: Orígenes!', 'battle_ball_rebound', 'Battle Ball Rebound en Habbo Hotel: Orígenes', '<p><strong>¡Prepárate para la emoción de Battle Ball Rebound en Habbo Hotel: Orígenes!</strong></p><p>El 15 de agosto, lanzaremos Battle Ball Rebound en Habbo Hotel: Orígenes. ¡El Diablo Rojo no puede esperar a ver cómo se desempeñan los mejores de los mejores!</p><p>Antes de que llegue, aquí tienes información adicional que te ayudará a escalar en las filas:</p><ul><li>Ahora, la forma en que juegas es increíblemente importante para cómo puntúas. En el pasado, ganabas puntos simplemente saltando en una baldosa, pero eso ya no es el caso. Los jugadores (excluyendo al que bloquea) que salten en una baldosa para colorearla, obtendrán un punto de asistencia.</li><li>Quien complete el bloqueo obtendrá un punto extra, pero los puntos no se otorgarán al equipo hasta que la baldosa esté bloqueada.</li><li>Robar la baldosa de un oponente otorgará puntos extra. ¡Debes atacar y defender cuidadosamente para obtener el máximo de puntos!</li><li>Los potenciadores jugarán un papel significativo. El potenciador de arlequín hará que tus oponentes coloreen las baldosas por ti, ¡ellos perderán puntos y tú los ganarás! Ser aturdido restará puntos de tu puntuación, ¡evita los alfileres en el campo de juego!</li></ul><p>Verás más material promocional acercándose al lanzamiento. ¡Estamos emocionados de presentar esto y estamos dando los toques finales!</p>', 'staff', 'Battle Ball Rebound imagen oficial', '<p class=\"noticia_descripcion\"><strong>¡Battle Ball Rebound llega a Habbo Hotel: Orígenes!</strong> Prepárate para el lanzamiento el 15 de agosto y conoce la información adicional que te ayudará a escalar en las filas.</p>', 'es', '2024-08-05 06:06:12'),
(19, 'Saltos de trampolín – Habbo Deportes', 'saltarin', 'Saltos de trampolín en Habbo Deportes', '<p><strong>¡Demuestra tu capacidad para saltar del trampolín en el Lido y llévate un premio!</strong></p><p>Saltar de un trampolín es la máxima sensación de libertad. Como parte de nuestra agenda deportiva, ¡queremos ver lo libre que ERES! Tendremos tres sesiones distintas con jurado. Estaremos puntuando qué tal se te da saltar del trampolín en la sala pública Habbo Lido.</p><p><strong>¿Cuándo puedo participar?</strong></p><p>El martes 6 de agosto a las horas siguientes:</p><ul><li>8:30 a. m. UTC (1:30 a. m. PDT / 10:30 a. m. CEST)</li><li>10:30 a. m. UTC (3:30 a. m. PDT / 12:30 p. m. CEST)</li><li>12:30 p. m. UTC (5:30 a. m. PDT / 2:30 p. m. CEST)</li></ul><p><strong>Premios</strong></p><ul><li>🥇 Primer puesto: Trofeo de Oro, Placa Pato de Oro</li><li>🥈 Segundo puesto: Trofeo de Plata, Placa Pato de Plata</li><li>🥉 Tercer puesto: Trofeo de Bronce, Placa Pato de Bronce</li></ul><p>Estas placas se dieron en Habbo a principios de los 2000, como parte del evento Juegos Habbowealth 2005.</p><p>Cada una de las tres sesiones con jurado tendrán sus propios ganadores. En total, habrá nueve vencedores.</p><p><strong>❗ Recuerda que tienes que ser parte de un equipo de Habbo Deportes para poder participar en la competición.</strong></p><p>Para más detalles, visita la <a href=\"https://origins.habbo.es/community/article/119/saltos-de-trampolin-habbo-deportes\">noticia oficial</a>.</p>', 'staff', 'Saltos de trampolín en Habbo Deportes', '<p class=\"noticia_descripcion\"><strong>¡Demuestra tu capacidad para saltar del trampolín en el Lido y llévate un premio!</strong> Participa en una de las tres sesiones el martes 6 de agosto y gana trofeos y placas exclusivas. Para más detalles, visita la <a href=\"https://origins.habbo.es/community/article/119/saltos-de-trampolin-habbo-deportes\">noticia oficial</a>.</p>', 'es', '2024-08-05 06:06:17'),
(20, 'Nuevo raro disponible! El Holoboy', 'catalogo_holoboy', 'Catalogo Holoboy', '<p><strong>El nuevo raro de Habbo Hotel: Orígenes: Holoboy!</strong></p><p>El Holoboy ya se encuentra disponible en el catálogo de Habbo Hotel: Orígenes por tiempo limitado. Podrás adquirirlo por un precio de 50 créditos. Este es el primer raro en tener una disponibilidad de solo 48 horas en el catálogo, así que no te lo pierdas!</p>', 'rares_martes', 'nuevo raro martes 06 de agosto del 2024', '<p class=\"noticia_descripcion\"><strong>Llega el nuevo raro a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el nuevo raro, <strong>RARO Holoboy</strong>, disponible por tiempo limitado. No te lo pierdas!</p>', 'es', '2024-08-06 06:06:23'),
(21, 'Nuevo raro disponible! La Hologirl', 'catalogo_hologirl', 'Catalogo Hologirl', '<p><strong>El nuevo raro de Habbo Hotel: Orígenes: Hologirl!</strong></p><p>El 8 de agosto de 2024, se lanza un nuevo raro mítico en el catálogo de Habbo Hotel: Orígenes. La <strong>Hologirl</strong> ya está disponible por tiempo limitado a un precio especial de 50 créditos. Este es el primer raro que sale un jueves y estará disponible solo por 48 horas en el catálogo. ¡No pierdas la oportunidad de agregar esta pieza única a tu colección!</p>', 'rares_martes', 'nuevo raro jueves 08 de agosto del 2024', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el nuevo raro, <strong>RARO Hologirl</strong>, disponible solo por 48 horas. ¡No te lo pierdas!</p>', 'es', '2024-08-08 06:06:28'),
(30, 'Concurso de Campos de Fútbol en Habbo Deportes', 'campos_futbol_habbo_deportes', 'Campos de fútbol - Habbo Deportes', '<p><strong>¡Construye el mejor campo de fútbol en Habbo Deportes!</strong></p><p>Participa en el concurso diseñando un terreno de juego llamado Fútbol 2024 y asegúrate de incluir el nombre de tu equipo de Habbo Deportes en la sala. El plazo para participar es hasta el 12 de agosto. Los ganadores se anunciarán el 14 de agosto. ¡Demuestra tu creatividad y gana fantásticos premios!</p>', 'staff', 'Staff Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Participa en el concurso de campos de fútbol de Habbo Deportes!</strong> Demuestra tu talento en el diseño de salas y gana increíbles premios. ¡No te lo pierdas!</p>', 'es', '2024-08-09 17:00:28'),
(31, 'Nuevo raro disponible! Puerta Láser Roja', 'catalogo_puerta_laser_roja', 'Puerta Láser Roja', '<p><strong>¡Nuevo raro disponible en Habbo Origins!</strong></p><p>Nos complace anunciar la llegada de la Puerta Láser Roja al catálogo de Habbo Origins. Este exclusivo raro estará disponible solo por 1 semana y tiene un precio de 50 créditos. ¡No pierdas la oportunidad de obtener este increíble ítem para decorar tus espacios y mostrar tu estilo único!</p><p>Recuerda, esta Puerta Láser Roja es un artículo limitado, así que asegúrate de adquirirla antes de que desaparezca del catálogo. ¡Corre a comprarla ahora y destaca en Habbo Origins!</p><p><strong>🔴 Disponible por tiempo limitado: 1 semana</strong></p><p><strong>💰 Precio: 50 créditos</strong></p><p>¡Nos vemos en Habbo Origins! 🏰</p>', 'rares_martes', 'nuevo raro disponible', '<p class=\"noticia_descripcion\"><strong>Tenemos un nuevo raro en Habbo Origins!</strong> Descubre la <strong>Puerta Láser Roja</strong>, disponible por tiempo limitado y a un precio especial. ¡No te lo pierdas!</p>', 'es', '2024-08-17 18:46:44'),
(32, '¡Ganadores del Campos de fútbol!', 'campos_futbol_habbo_deportes', 'Ganadores del Campos de fútbol', '<p>¡Felicidades a los ganadores del concurso de Campos de fútbol en Habbo Hotel!</p><p>🥇 Primer puesto: Karlos Supreme de Suecia</p><p>🥈 Segundo puesto: Jd Supreme de Suecia</p><p>🥉 Tercer puesto: Roni Las Sapphire de Grecia</p><p>¡Estos talentosos equipos demostraron su habilidad y pasión por el fútbol en un emocionante torneo! ¡Que sigan los éxitos en sus futuras competencias!</p>', 'staff', 'staff', '<p class=\'noticia_descripcion\'>¡Felicidades a los ganadores del concurso de Campos de fútbol en Habbo Hotel! Descubre quiénes se llevaron los primeros puestos en esta emocionante competencia.</p>', 'es', '2024-08-17 18:47:05'),
(53, '¡Nuevo juego Battle Ball: Rebound disponible en Habbo Hotel: Orígenes!', 'battle_ball_rebound', 'Battle Ball: Rebound en Habbo Hotel: Orígenes', '<p><strong>¡Descubre el nuevo Battle Ball: Rebound en Habbo Hotel: Orígenes!</strong></p><p>Disfruta de dos lobbies gratuitos y prepárate para el torneo de una semana donde podrás ganar Lámparas de Dragón de Bronce, Plata y Oro. Mañana se añadirán lobbies especiales \'clasificados\' que requerirán tickets del juego para jugar. ¡Accede desde el Navegador y sigue las instrucciones para unirte a la diversión!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/148/juega-a-battle-ball-rebound\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Nuevo juego Battle Ball: Rebound en Habbo Hotel: Orígenes', '<p class=\'noticia_descripcion\'><strong>¡Descubre Battle Ball: Rebound en Habbo Hotel: Orígenes!</strong> Participa en los lobbies gratuitos y prepárate para el torneo exclusivo donde podrás ganar fabulosas recompensas. No te lo pierdas.</p>', 'es', '2024-09-03 15:00:00'),
(54, 'Lobbies clasificatorios de Battle Ball retrasados', 'battle_ball_lobbies', 'Battle Ball Lobbies', '<p><strong>Habbo Hotel informa:</strong> Los lobbies clasificatorios de Battle Ball han sido retrasados una vez más para solucionar problemas persistentes antes del lanzamiento. Se espera que estén listos para el próximo lunes, aunque no hay garantías. Pedimos disculpas por las molestias y agradecemos su comprensión. ¡Pronto podrás competir por un Dragón de Metal! 🤩</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/167/167\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Battle Ball Lobbies', '<p class=\'noticia_descripcion\'><strong>¡Retrasados los lobbies clasificatorios de Battle Ball en Habbo Hotel!</strong> El lanzamiento se pospone para resolver problemas técnicos. ¡Mantente atento para ganar un Dragón de Metal!</p>', 'es', '2024-08-16 18:40:08'),
(55, '¡Funky Friday en Habbo Hotel!', 'funky_friday_16_08_2024', 'Catálogo Funky Friday', '<p><strong>Hoy es Funky Friday en Habbo Hotel!</strong></p><p>¡Celebra el Funky Friday con fabulosos regalos que estamos ofreciendo desde nuestra cuenta de X/Twitter! Además, durante las próximas 24 horas, estos regalos estarán disponibles en el Catálogo. ¡No te lo pierdas!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/161/es-funky-friday-8\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'funky_friday', 'imagen_staff_funky_friday', '<p class=\'noticia_descripcion\'><strong>¡Celebramos el Funky Friday en Habbo Hotel!</strong> Consigue increíbles regalos a través de nuestra cuenta de X/Twitter y en el Catálogo por tiempo limitado. ¡Aprovecha esta oportunidad única!</p>', 'es', '2024-08-28 04:07:07'),
(58, 'Nueva competencia de Battle Ball en Habbo Hotel: Orígenes', 'battle_ball', 'Juego Battle Ball', '<p><strong>Habbo Hotel: Orígenes lanza una competencia épica de Battle Ball</strong></p><p>Desde ahora hasta el 26/08 a las 11 am UTC, los jugadores podrán participar en una competencia de Battle Ball donde subirán puntos al ganar partidas y perderán al estar en el equipo perdedor. Los premios van desde Drágon de Fuego Oro hasta Bronce para los primeros 40 jugadores de cada hotel.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/153/juega-partidas-clasificadas-de-battle-ball-para-ganar-dragones-de-metal\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Staff Habbo', '<p class=\"noticia_descripcion\"><strong>Nueva competencia de Battle Ball en Habbo Hotel: Orígenes</strong> Participa y gana premios exclusivos siendo uno de los mejores jugadores en este desafío de habilidad y estrategia.</p>', 'es', '2024-08-20 16:08:22'),
(59, 'Raro añadido al Catálogo: Luciérnaga Amarilla', 'catalogo_luciernaga_amarilla', 'Catálogo Luciérnaga Amarilla', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: Luciérnaga Amarilla!</strong></p><p>Por tiempo limitado, los usuarios podrán adquirir esta apreciada pieza por 75 créditos. Disponible en la sección de raros hasta el 23/08 a las 5am CST / 1pm CEST. ¡No te pierdas la oportunidad de agregar esta rareza a tu colección!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/175/raro-anadido-al-catalogo-puerta-laser-roja\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'rares_martes', 'nuevo raro Luciérnaga Amarilla', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel: Orígenes añade a su catálogo el raro Luciérnaga Amarilla!</strong> Disponible por tiempo limitado a un precio especial. ¡Consíguelo antes de que se agote!</p>', 'es', '2024-08-28 04:02:14'),
(60, 'Encuesta de InfoBus: ¡títulos de jugador!', 'encuesta_titulos_jugador', 'Imagen de la encuesta sobre títulos de jugador en Habbo', '<p><strong>¡Habbo Hotel: Origins considera introducir títulos de jugador en el juego!</strong></p><p>Una encuesta realizada por Habbo pregunta a los jugadores si les gustaría tener la opción de personalizar sus avatares con títulos, que podrían ser adquiridos en la tienda, completando recompensas o como premios de eventos especiales. Estos títulos serían exclusivos y vinculados al avatar de cada jugador, similar a las placas actuales. ¡Participa en la encuesta y haz oír tu voz!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/189/encuesta-de-infobus-titulos-de-jugador\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen sobre la encuesta de títulos de jugador en Habbo', '<p class=\"noticia_descripcion\"><strong>¡Habbo Hotel: Origins quiere conocer tu opinión sobre la posible introducción de títulos de jugador en el juego!</strong></p><p class=\"noticia_descripcion\">Una encuesta está disponible para que los jugadores decidan si les gustaría personalizar sus avatares con títulos exclusivos. Participa y comparte tus ideas sobre esta posible nueva característica en Habbo.</p>', 'es', '2024-08-28 18:39:32'),
(61, '¡Es Funky Friday en Habbo!', 'funky_friday_23_08_2024', 'Catálogo de Funky Friday en Habbo', '<p><strong>Habbo Hotel celebra Funky Friday.</strong></p><p>En esta ocasión, Habbo regala una gran cantidad de artículos desde su cuenta de X/Twitter y también los pone disponibles en el Catálogo durante 24 horas. ¡No te pierdas la oportunidad de conseguir estos increíbles regalos!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/180/es-funky-friday-9\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'funky_friday', 'imagen_staff', '<p class=\"noticia_descripcion\"><strong>Funky Friday en Habbo!</strong> Consigue increíbles regalos en el Catálogo durante 24 horas. ¡No te lo pierdas!</p>', 'es', '2024-08-28 04:04:54'),
(62, '¡Retiro de los furnis de deportes del catálogo!', 'deportes_retirados', 'Furnis de deportes retirados del catálogo', '<p><strong>Habbo Hotel anuncia el retiro de los furnis de deportes del catálogo.</strong></p><p>El 26 de agosto se llevará a cabo la eliminación de los artículos de deportes del catálogo. Aunque existe la posibilidad de que regresen en el futuro, por el momento no estarán disponibles para su compra. Habbo ofrece disculpas por cualquier inconveniente que esto pueda causar a los usuarios.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/186/los-furnis-de-deportes-se-van\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Retiro de furnis de deportes', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel retirará los furnis de deportes del catálogo el 26 de agosto.</strong> Los usuarios deben estar atentos a futuras actualizaciones sobre la posible reincorporación de estos artículos.</p>', 'es', '2024-08-28 04:08:18'),
(63, 'Battle Ball - El primer torneo', 'battle_ball_torneo', 'Battle Ball Torneo', '<p><strong>Habbo Hotel presenta el primer torneo de Battle Ball!</strong></p><p>El equipo de Habbo Hotel ha organizado el esperado torneo de Battle Ball, donde los mejores jugadores de cada hotel compitieron. Tras revisar las puntuaciones, se publicarán las clasificaciones finales esta semana. Además, se están implementando mejoras en el sistema para asegurar una competición justa y equitativa.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/193/battle-ball-el-primer-torneo\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Nuevo torneo Battle Ball', '<p class=\"noticia_descripcion\"><strong>Se anuncia el primer torneo de Battle Ball en Habbo Hotel!</strong> El equipo de Habbo está revisando las puntuaciones de los participantes y se preparan mejoras en el sistema para futuras competiciones. ¡Mantente atento para más novedades!</p>', 'es', '2024-08-28 04:08:15'),
(64, 'Nuevo raro disponible! Hamaca zZz', 'catalogo_hamaca_zzz', 'Catálogo Hamaca zZz', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: Hamaca zZz!</strong></p><p>A partir de hoy, 15 de agosto de 2024, podrás adquirir la Hamaca zZz en el Catálogo por tan solo 50 créditos. Esta exclusiva pieza estará disponible por tiempo limitado hasta el 30 de agosto a las 5am CST / 1pm CEST. ¡No dejes pasar la oportunidad de tener este raro en tu colección antes de que desaparezca!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/202/raro-anadido-al-catalogo-luciernaga-amarilla\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'rares_martes', 'nuevo raro jueves 15 de agosto del 2024', '<p class=\'noticia_descripcion\'><strong>¡Nuevo raro disponible en Habbo Hotel: Orígenes!</strong> Adquiere la exclusiva Hamaca zZz por solo 50 créditos, disponible solo por tiempo limitado. ¡Aprovecha esta oportunidad única!</p>', 'es', '2024-08-28 04:01:52'),
(67, '¡Es Funky Friday! Regalos especiales en Twitter y Catálogo por 24 horas', 'funky_friday_promo', 'Funky Friday Promoción', '<p><strong>Hoy es Funky Friday en Habbo Hotel!</strong></p><p>Para celebrar este día especial, Habbo está regalando una gran cantidad de premios a través de su cuenta de X/Twitter. Además, todos estos regalos también estarán disponibles en el Catálogo por 24 horas. ¡No te pierdas esta oportunidad única de obtener increíbles obsequios!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/207/es-funky-friday-10\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Promoción Funky Friday', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel celebra Funky Friday con regalos especiales!</strong> Aprovecha la promoción en la cuenta de X/Twitter y en el Catálogo por tiempo limitado. ¡No te lo pierdas!</p>', 'es', '2024-08-30 11:18:09'),
(68, 'Resultados de la encuesta sobre contar con \'títulos\' asociados a tu Habbo', 'encuesta_titulos', 'Encuesta sobre títulos en Habbo Hotel: Orígenes', '<p><strong>Habbo Hotel: Orígenes publica los resultados de la encuesta sobre \'títulos\' para lxs Habbos.</strong></p><p>Tras recibir 507 votos a favor y 345 votos en contra, se decide no introducir los \'títulos\' en el hotel. ¡Gracias a todos los participantes por expresar su opinión!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/209/resultados-de-la-encuesta-sobre-los-titulos\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Resultados de encuesta sobre \'títulos\' en Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>¡Resultados de la encuesta sobre \'títulos\' en Habbo Hotel: Orígenes!</strong> Después de contabilizar 852 votos, se decide no implementar los \'títulos\'. ¡Gracias a la comunidad por participar!</p>', 'es', '2024-08-31 13:44:17'),
(69, '¡Nuevos ganadores en la liga Battle Ball: Rebound de Habbo Hotel: Orígenes!', 'liga_battle_ball', 'Liga Battle Ball: Rebound de Habbo Hotel: Orígenes', '<p><strong>¡Felicidades a lxs vencedores de la liga de Battle Ball: Rebound de Habbo Hotel: Orígenes!</strong></p><p>La competencia ha concluido y los primeros 40 puestos han sido anunciados. ¡Aquí tienes el top 40! 1. .:josefaura:...40. mauror7</p><p>¡Agradecemos a todos los participantes y los premios serán entregados pronto!</p><p>Es posible que en el futuro se den más Dragones de Bronce en eventos similares, pero nunca serán vendidos para mantener su rareza en los hoteles.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/223/lxs-ganadores-del-battle-ball-rebound\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Liga Battle Ball - Ganadores', '<p class=\'noticia_descripcion\'><strong>Nuevos ganadores en la liga de Battle Ball: Rebound de Habbo Hotel: Orígenes!</strong> ¡Felicidades a lxs vencedores y gracias a todos los participantes! Los premios serán entregados pronto. ¡Mantente atento para futuros eventos!</p>', 'es', '2024-09-02 18:09:47'),
(70, 'Nuevo raro disponible! Aloe Vera', 'catalogo_aloe_vera', 'Catálogo Aloe Vera', '<p><strong>Raro añadido al Catálogo: Aloe Vera!</strong></p><p>Un Aloe Vera cuesta 50 créditos. Estará disponible en la sección de raros del Catálogo hasta el 10/09 a las 5am CST / 1pm CEST. Hazte con el tuyo mientras puedas. ¡Estas piezas no volverán a salir en Habbo Hotel: Orígenes!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/228/raro-anadido-al-catalogo-aloe-vera\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'rares_martes', 'nuevo raro jueves 10 de septiembre del 2024', '<p class=\'noticia_descripcion\'><strong>Raro añadido al Catálogo: Aloe Vera</strong> por tiempo limitado. ¡Consíguelo por solo 50 créditos antes del 10/09!</p>', 'es', '2024-09-05 16:53:24'),
(71, 'Habbo Hotel: Orígenes estrena canal de Discord', 'discord_channel', 'Canal de Discord de Habbo Hotel: Orígenes', '<p><strong>Habbo Hotel: Orígenes lanza oficialmente un nuevo canal de Discord para la comunidad</strong></p><p>El equipo de Habbo Hotel: Orígenes ha adoptado como oficial un Discord creado por la comunidad, ofreciendo un espacio para debatir, analizar reacciones y estrechar lazos con los jugadores. Para unirte al servidor, visita discord.gg/habbo-origins. Habrá secciones para chatear en portugués y español, aunque los avisos y comunicaciones del Staff se realizarán en inglés. Además, se ha implementado una lista de baneos para mantener un ambiente libre de toxicidad y seguro para todos los usuarios.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/232/232\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Noticia de Discord de Habbo Hotel: Orígenes', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel: Orígenes estrena canal de Discord para la comunidad</strong></p><p class=\'noticia_descripcion\'>Únete al nuevo canal de Discord oficial de Habbo Hotel: Orígenes para debatir, analizar reacciones y estrechar lazos con la comunidad. Visita discord.gg/habbo-origins para unirte. ¡No te lo pierdas!</p>', 'es', '2024-09-09 05:28:05'),
(72, '¡Es Funky Friday en el Catálogo de Habbo Hotel!', 'funky_friday_06_09_2024', 'Catálogo Funky Friday', '<p><strong>Habbo Hotel celebra el Funky Friday con artículos exclusivos!</strong></p><p>Por tiempo limitado, podrás encontrar una selección especial de artículos con temática funky en el catálogo. ¡No te pierdas esta oportunidad única de agregar un toque de estilo y diversión a tu sala! Visita el catálogo ahora y aprovecha esta oferta por 24 horas.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/238/es-funky-friday-12\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'funky_friday', 'nuevo funky friday en el catálogo de Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>Celebra el Funky Friday en Habbo Hotel con artículos exclusivos!</strong> ¡Encuentra una selección especial de artículos con temática funky en el catálogo por tiempo limitado! ¡No te lo pierdas!</p>', 'es', '2024-09-06 16:34:04'),
(74, 'El Flying tubman y sus piratas llegan a origenes', 'flying_tubman', 'flying_tubman', '<p><strong>El Flying Tubman y su Raro desaparecido</strong></p>\n<p>Durante las próximas semanas habrá muchas actividades relacionadas con los piratas en Habbo Hotel: Orígenes. El legendario barco, <strong>Flying Tubman</strong>, surca los océanos píxel en busca de los Raros robados por el pirata <strong>Capitán Murphy</strong>. 💀</p>\n<p><strong>Semana 1 (9 – 16 de septiembre):</strong> <br> Reto: ¡A la búsqueda del Raro! <br> Concurso: Construye un barco pirata en tu sala. Más información el 13 de septiembre.</p>\n<p><strong>Semana 2 (16 – 22 de septiembre):</strong> <br> Concurso: ¡Escribe una canción marinera! <br> Detalles el 17 de septiembre.</p>\n<p><strong>Semana 3 (23 – 29 de septiembre):</strong> <br> Lanzamiento del <strong>Dragón Celeste</strong>. <br> Reto: Encuentra el escondite del Capitán Murphy. <br> ¡Guerra de kicks pirata!</p>\n<p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/240/el-flying-tubman-y-sus-piratas-llegan-a-origenes\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA, por lo que puede tener errores gramaticales o hablar como si fuera parte del equipo de Habbo.</p>\n', 'staff', 'evento flying tubman', '<p class=\'noticia_descripcion\'><strong>El Flying Tubman y su Raro desaparecido llega a Habbo Hotel: Orígenes!</strong> Participa en las actividades piratas y busca los Raros robados por el Capitán Murphy. ¡No te lo pierdas!</p>\n', 'es', '2024-09-09 05:30:56'),
(75, '¡Misterio resuelto! ¡Encuentran los raros hurtados por el Capitán Murphy!', 'capitan_murphy_misterio_raro', 'Catalogo Capitán Murphy', '<p><strong>El misterio de los raros hurtados por el Capitán Murphy ha sido resuelto!</strong></p><p>Gracias a la increíble labor de la comunidad de Habbo, se han encontrado las pistas dejadas por el Capitán Murphy y su banda en la sala secreta del hotel. Los raros fueron recuperados y devueltos a sus legítimos dueños. Ahora, todos pueden volver a disfrutar de sus valiosas posesiones en Habbo Hotel. ¡Muchas gracias a todos los Habbo detectives por su valiosa ayuda!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/252/busca-el-misterio-raro\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen de staff en Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>El misterio de los raros hurtados por el Capitán Murphy ha sido resuelto!</strong> Gracias a la comunidad de Habbo, se encontraron las pistas y los raros fueron recuperados. ¡La aventura llegó a su fin de manera exitosa!</p>', 'es', '2024-09-11 19:09:39'),
(76, '¡Construye tu Barco Pirata en Habbo Hotel!', 'barco_pirata', 'Barco Pirata', '<p><strong>Habbo Hotel desafía a sus usuarios a construir su propio Barco Pirata para dar caza a Murphy!</strong></p><p>Del 13 al 16 de septiembre, los jugadores podrán participar en la creación de una sala temática de Barco Pirata 2024. La sala deberá representar un barco pirata de forma clara y creativa, sin necesidad de sobrecargarla con elementos. Las salas más llamativas serán premiadas el 18 de septiembre con Placas Pirata y furniture exclusivo del Catálogo.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/261/construye-tu-barco-pirata\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'nueva promoción en Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>Participa en el desafío de construir tu Barco Pirata en Habbo Hotel y gana increíbles premios!</strong></p>', 'es', '2024-09-13 11:18:39'),
(77, '¡Funky Friday en el Catálogo por 24 horas!', 'funky_13_09_2024', 'Catálogo Funky Friday', '<p><strong>Habbo Hotel presenta: ¡Funky Friday!</strong></p><p>En esta ocasión, el Catálogo se llena de artículos especiales para celebrar el Funky Friday. Durante las próximas 24 horas, podrás adquirir estos exclusivos objetos a precios únicos. No te pierdas esta oportunidad de darle un toque funky a tu habitación. ¡Corre a ver las novedades!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/236/es-funky-friday-11\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'funky_friday', 'Imagen resumida del Funky Friday en Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Nuevos artículos llegan al Catálogo por tiempo limitado!</strong> Celebra el Funky Friday con los objetos exclusivos disponibles por solo 24 horas. ¡No te los pierdas!</p>', 'es', '2024-09-13 14:02:23'),
(78, 'Raro añadido al Catálogo: Alfombra Playa', 'alfombra_playa', 'Alfombra Playa', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro en su Catálogo: Alfombra Playa!</strong></p><p>Por tiempo limitado, los usuarios podrán adquirir esta Alfombra Playa por 35 créditos. La oferta estará disponible hasta el 24 de septiembre a las 5am CST / 1pm CEST. ¡No dejes pasar la oportunidad de agregar este raro a tu colección antes de que desaparezca!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/269/raro-anadido-al-catalogo-aloe-vera-2\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'rares_martes', 'Alfombra Playa', '<p class=\'noticia_descripcion\'><strong>Nueva adición al Catálogo de Habbo Hotel: Orígenes!</strong> ¡Consigue la Alfombra Playa por tiempo limitado a un precio especial de 35 créditos! ¡No te lo pierdas!</p>', 'es', '2024-09-21 20:17:21');
INSERT INTO `noticias` (`id`, `titulo`, `imagen_completa`, `alt_imagen_completa`, `descripcion_completa`, `imagen_resumida`, `alt_imagen_resumida`, `descripcion_resumida`, `hotel`, `fecha_noticia`) VALUES
(79, 'Actualización de Origins: Macklebee responde a preguntas de la comunidad', 'actualizacion_origins_macklebee', 'Actualización de Origins: Macklebee responde a preguntas de la comunidad', '<p><strong>Hola Traders, tengo una nueva noticia, la cual generé con IA para ustedes.</strong></p><p>El líder de producto de Origins, Macklebee, ha respondido algunas preguntas de los miembros de la comunidad en el servidor de Discord de Origins. En respuesta a la percepción de la disminución de la actividad en el juego, Macklebee explicó que se está trabajando en la introducción de nuevas características como Trax y SnowStorm, además de desafíos diarios y opciones de personalización para los avatares. Hablando sobre los eventos del juego, admitió que inicialmente el equipo era pequeño y desempeñaba múltiples roles, lo que resultó en eventos menos impactantes. En cuanto al marketing en plataformas como TikTok, se está evaluando su efectividad para atraer nuevos jugadores.</p><p>Respecto a los desafíos técnicos en el lanzamiento, Macklebee reconoció las fallas iniciales pero destacó que se han superado y que el juego ahora puede ofrecer muebles más originales. En general, Origins está trabajando en mejorar la experiencia del usuario y traer innovación a la comunidad en el futuro.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/264/habbo-hotel-actualizacion-de-origins-nuestro-viaje-desafios-y-futuro-emocionante\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Nuevo raro jueves 08 de agosto del 2024', '<p class=\"noticia_descripcion\"><strong>Una actualización de Origins a través de Macklebee:</strong> Se están introduciendo nuevas características y mejoras en el juego para mantener a los jugadores comprometidos. El líder de producto ha respondido a las preocupaciones de la comunidad y está trabajando en eventos más emocionantes, mejoras técnicas y estrategias de marketing.</p>', 'es', '2024-09-17 14:17:03'),
(80, '¡Ganadores del Barco Pirata en Habbo Hotel!', 'ganadores_barco_pirata', 'Imagen de los ganadores del concurso Barco Pirata en Habbo Hotel', '<p><strong>Habbo Hotel anuncia a los ganadores del concurso Barco Pirata!</strong></p><p>Tras finalizar el concurso de salas, se han seleccionado a los talentosos ganadores que han dejado a todos impresionados. ¡Por la increíble participación, se han añadido 25 ganadores de placas extra! Los top 3 ganadores, Vulpes, XL y Jeringuillas, deben ponerse en contacto con soporte para reclamar sus premios. ¡Felicidades a todos los participantes!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/286/ganadores-del-barco-pirata\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen de los ganadores del concurso', '<p class=\"noticia_descripcion\"><strong>¡Anuncio de los ganadores del concurso Barco Pirata en Habbo Hotel!</strong> Descubre quiénes fueron los talentosos participantes que se destacaron en este emocionante concurso. ¡Felicidades a los ganadores y a todos los participantes!</p>', 'es', '2024-09-18 20:16:43'),
(81, '¡Es Funky Friday en Habbo Hotel!', 'funky_2024_09_21', 'Funky Friday en Habbo Hotel', '<p><strong>Habbo Hotel anuncia el Funky Friday!</strong></p><p>Hoy, Habbo Hotel celebra el Funky Friday regalando una variedad de artículos desde su cuenta oficial de X/Twitter. Además, todos estos artículos estarán disponibles en el Catálogo durante las próximas 24 horas. ¡No te pierdas la oportunidad de obtener increíbles regalos y ofertas exclusivas!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/317/317\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'funky_friday', 'nuevo raro jueves 08 de agosto del 2024', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel celebra el Funky Friday con regalos exclusivos!</strong> Descubre los increíbles obsequios que Habbo tiene preparados para ti y aprovecha las ofertas especiales por tiempo limitado. ¡Únete a la fiesta del Funky Friday!</p>', 'es', '2024-09-26 20:20:13'),
(82, '¡Venta del Dragón Celeste por 24h mañana!', 'dragón_celeste', 'Dragón Celeste en el Catálogo', '<p><strong>Anuncio especial de Habbo Hotel: Venta exclusiva del Dragón Celeste por 24 horas!</strong></p><p>Mañana será la primera vez que el Dragón Celeste esté disponible en el Catálogo de forma temporal. Este artículo tendrá un precio de 75 créditos y estará disponible por solo 24 horas. No te pierdas esta oportunidad única de adquirir este preciado objeto.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/325/venta-del-dragon-celeste-por-24h-manana\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'novedades del Catálogo de Habbo', '<p class=\'noticia_descripcion\'><strong>¡Atención Traders! Mañana en el Catálogo de Habbo estará disponible el Dragón Celeste por 24 horas. ¡Prepárate para esta venta exclusiva!</strong></p>', 'es', '2024-09-23 13:20:10'),
(83, '¡Rescata el tesoro del FlyingTubman robado por Capitán Murphy!', 'imagen_tesoro_vacía', 'Sala del tesoro vacía', '<p><strong>El Capitán Murphy ha robado el tesoro del FlyingTubman con su preciado Dragón Celeste incluido.</strong></p><p>El tesoro ha sido trasladado a una guarida secreta invisible a los motores de búsqueda. Es necesario actuar rápidamente para intentar recuperarlo. ¡La ayuda de todos los piratas de Habbo es imprescindible!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/328/rescata-el-tesoro-del-flyingtubman\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'nuevo evento de piratas', '<p class=\'noticia_descripcion\'><strong>El tesoro del FlyingTubman ha sido robado por el temido Capitán Murphy.</strong> Asegúrate de unirte a la misión para intentar recuperarlo antes de que sea demasiado tarde.</p>', 'es', '2024-09-24 08:06:22'),
(84, 'Encuentra el tesoro del Raro en Habbo Hotel', 'tesoro_pirata', 'Imagen del tesoro del Raro en Habbo Hotel', '<p><strong>¡El capitán Murphy y su banda han escondido un tesoro en Habbo Hotel!</strong></p><p>Los piratas Habbo están en busca de pistas ocultas para descubrir el paradero del tesoro del Raro. Se rumorea que el misterioso Flying Tubman puede tener la clave para encontrarlo. ¡Prepárate para descifrar el críptico mapa y reclamar tu recompensa!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/331/encuentra-el-tesoro-del-raro\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen promocional del evento en Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>¡Busca pistas para encontrar el tesoro del Raro en Habbo Hotel!</strong></p><p class=\"noticia_descripcion\">Capitán Murphy y su banda han escondido un tesoro y solo los más astutos piratas podrán descubrir su paradero. ¿Estás listo para la aventura?</p>', 'es', '2024-09-26 20:17:13'),
(85, 'Nuevo raro añadido al Catálogo: Dragón de Fuego Cielo', 'catalogo_dragon_fuego_cielo', 'Dragón de Fuego Cielo en el Catálogo', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro en su Catálogo: el Dragón de Fuego Cielo!</strong></p><p>Por un precio de 75 créditos, los usuarios de Habbo Hotel podrán adquirir este artículo exclusivo hasta el 25/09 a las 5 am CST / 1 pm CEST. Esta es una oportunidad única, ya que estas piezas no volverán a estar disponibles en el hotel. ¡Asegúrate de obtener el tuyo antes de que sea demasiado tarde!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/337/raro-anadido-al-catalogo-alfombra-playa\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'rares_martes', 'Imagen del raro Dragón de Fuego Cielo', '<p class=\'noticia_descripcion\'><strong>Nuevo raro disponible en el Catálogo de Habbo Hotel: Orígenes!</strong> Se trata del <strong>Dragón de Fuego Cielo</strong>, una pieza exclusiva que estará disponible solo por tiempo limitado. ¡No te lo pierdas!</p>', 'es', '2024-09-24 16:26:25'),
(86, '¡Ganadores del Cantos de sirena y canciones marineras!', 'ganadores_cantos_marineros', 'Ganadores del Cantos de sirena y canciones marineras', '<p><strong>Habbo Hotel anuncia a los ganadores del evento Cantos de sirena y canciones marineras.</strong></p><p>El pequeño Bulldozer ha sido finalmente encontrado y regresado a sus dueños, gracias a todas las hermosas canciones creadas para él durante la competencia. ¡Felicidades a los ganadores!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/339/ganadores-del-cantos-de-sirena-y-canciones-marineras\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'noticia habbo hotel', '<p class=\'noticia_descripcion\'><strong>Ganadores anunciados:</strong> Habbo Hotel revela los ganadores del concurso Cantos de sirena y canciones marineras, con el emocionante regreso del pequeño Bulldozer. ¡Enhorabuena a los participantes!</p>', 'es', '2024-09-24 19:16:54'),
(87, '¡Guerra de kicks pirata en Habbo Hotel: Orígenes!', 'guerra_de_kicks_pirata', 'Guerra de kicks pirata en Habbo Hotel', '<p><strong>El jueves 26 de agosto, Habbo Hotel: Orígenes se prepara para la guerra de kicks pirata.</strong></p><p>Vístete de pirata, únete a la lucha en la sala Cubierta del capitán Murphy y pelea hasta conseguir el raro de la semana, el Dragón Azul Celeste. La competencia empieza a las 17:00 CEST, donde solo el más astuto y rápido podrá llevarse el premio a casa. ¡No te lo pierdas!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/343/guerra-de-kicks-pirata\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Guerra de kicks pirata en Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>¡Alerta pirata en Habbo Hotel: Orígenes!</strong> Participa en la guerra de kicks el jueves 26 de agosto y lucha por el raro Dragón Azul Celeste. ¿Tienes lo que se necesita para ser el ganador?</p>', 'es', '2024-09-25 08:27:54'),
(88, 'Actualización de la Documentación de la API', 'actualizacion_api', 'Actualización de la Documentación de la API', '<p><strong>Habbo Hotel ha actualizado la documentación de su API para facilitar a los desarrolladores web y las fansites la creación de nuevas funcionalidades utilizando la base de datos del hotel.</strong></p><p>Cada hotel tiene sus propios <em>endpoints</em> en la API, y toda la información necesaria para este hotel se puede encontrar en el enlace proporcionado.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/377/documentacion-de-la-api-actualizada\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Noticia de actualización de la API', '<p class=\"noticia_descripcion\"><strong>La documentación de la API de Habbo Hotel ha sido actualizada para facilitar la creación de nuevas funcionalidades por parte de desarrolladores web y fansites.</strong></p>', 'es', '2024-09-25 12:51:28'),
(90, 'Piratas abandonan el Catálogo: Furnis Rústico recoloreados eliminados', 'piratas_catalogo', 'Piratas abandonan el Catálogo - Furnis Rústico recoloreados eliminados', '<p><strong>El 30 de septiembre, Habbo elimina del Catálogo los furnis Rústico recoloreados.</strong></p><p>Estas piezas podrían regresar a la venta en el futuro, ya que no son consideradas raras y no han formado parte de Funky Friday.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/379/los-piratas-abandonan-el-catalogo\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Piratas abandonan el Catálogo', '<p class=\"noticia_descripcion\"><strong>Habbo elimina los furnis Rústico recoloreados del Catálogo.</strong> Estas piezas podrían regresar en el futuro debido a su naturaleza no rara.</p>', 'es', '2024-09-26 15:03:35'),
(91, 'Correcciones y Actualizaciones: Mascotas, Timbres y la Consola', 'correcciones_actualizaciones', 'Imagen de correcciones y actualizaciones en Habbo Hotel', '<p>¡Habbo Hotel ha anunciado una serie de correcciones y actualizaciones para mejorar la experiencia de los usuarios! Entre las mejoras se encuentran la resolución de problemas con la consola, la capacidad de ocultar insignias, mejoras en el cuidado de mascotas y la reparación del timbre. Estas actualizaciones buscan hacer que la interacción en el hotel sea más fluida y satisfactoria para todos los jugadores. ¡No te pierdas estas novedades!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/382/382\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen resumen de correcciones y actualizaciones en Habbo Hotel', '<p class=\'noticia_descripcion\'>Habbo Hotel anuncia importantes correcciones y actualizaciones para mejorar la experiencia de juego. ¡No te pierdas los detalles de estas mejoras que llegarán pronto!</p>', 'es', '2024-09-26 16:05:54'),
(92, '¡Es Funky Friday en Habbo Hotel!', 'funky_friday_27_09_2024', 'Funky Friday en Habbo Hotel', '<p><strong>Hoy es Funky Friday en Habbo Hotel!</strong></p><p>Hoy Habbo Hotel está celebrando Funky Friday regalando una gran variedad de items desde su cuenta de X/Twitter. Pero eso no es todo, también estarán disponibles en el Catálogo durante 24 horas. ¡No te pierdas esta oportunidad de conseguir increíbles items!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/321/es-funky-friday-15\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'funky_friday', 'Imagen representativa de Funky Friday', '<p class=\'noticia_descripcion\'><strong>Hoy es Funky Friday en Habbo Hotel!</strong> Habbo Hotel está regalando y poniendo a la venta items especiales desde su cuenta de X/Twitter. ¡Aprovecha esta oportunidad única!</p>', 'es', '2024-09-27 13:38:03'),
(93, '¡Celebra Habboween en Habbo Hotel: Orígenes!', 'habboween_origins', 'Habboween en Habbo Hotel: Orígenes', '<p><strong>Habboween ha llegado a Habbo Hotel: Orígenes por primera vez este año, y viene cargado de actividades escalofriantemente divertidas para todos los ciudadanos!</strong></p><p>Prepárate para participar en un concurso creativo de arte IRL, una competición retro de dibujo en pixel art, eventos especiales como \'El Regreso de los Raros Muertos\' y \'La Fiesta de Terror del Año\', además de un emocionante desfile en el juego el día de Habboween.</p><p>Además, Habbo Hotel: Orígenes ha mejorado los premios para Habboween, incluyendo cantidades de artículos raros y de Funky Friday, distribuidos como premios en diversas competiciones.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/388/habboween-en-habbo-hotel-origins\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Habboween en Habbo Hotel: Orígenes', '<p class=\'noticia_descripcion\'><strong>¡Habboween ha llegado a Habbo Hotel: Orígenes con actividades espeluznantes y emocionantes para todos los ciudadanos!</strong></p><p class=\'noticia_descripcion\'>Concursos creativos, competiciones retro, eventos especiales y premios mejorados te esperan este mes.</p>', 'es', '2024-10-01 15:23:20'),
(94, '¡Nuevo raro añadido al Catálogo: Fontana Gótica!', 'catalogo_fuente_gotica', 'Catálogo Fontana Gótica', '<p><strong>¡Atención ciudadanos de Habbo Hotel: Orígenes!</strong></p><p>Desde el <strong>1 de octubre</strong> hasta el <strong>3 de octubre</strong>, estará disponible en el catálogo la impresionante <strong>Fontana Gótica</strong> a un precio de <strong>35 créditos</strong>.</p><p>¡No te pierdas la oportunidad de añadir este raro a tu colección! La Fontana Gótica es un objeto exclusivo que no estará disponible por mucho tiempo, así que asegúrate de hacerte con ella antes de que desaparezca.</p><p>Mantente al tanto de más novedades y eventos en Habbo Hotel: Orígenes.</p>', 'rares_martes', 'Fontana Gótica en Habbo Hotel: Orígenes', '<p class=\'noticia_descripcion\'><strong>¡La Fontana Gótica ha llegado al catálogo de Habbo Hotel: Orígenes!</strong></p><p class=\'noticia_descripcion\'>Disponible desde el 1 de octubre hasta el 3 de octubre por 35 créditos. ¡No te lo pierdas!</p>', 'es', '2024-10-01 15:24:32'),
(95, '¡Habboween ha llegado con el calendario de eventos de octubre!', 'calendario_habboween_octubre', 'Calendario de eventos Habboween octubre', '<p><strong>¡Buenos días a todos los Habbos!</strong></p><p>Como parte de las celebraciones de Habboween, el equipo de THO se complace en presentarles el <strong>calendario de eventos</strong> para el mes de octubre.</p><p>Confirmamos al 100% la llegada de los <strong>furnis Freaky Friday</strong>, ¡prepárense para decorar sus habitaciones con un toque espeluznante!</p><p>Respecto a los raros, hemos realizado una <strong>predicción basada en los emojis</strong> de la noticia oficial. Les recomendamos tomar esta información como una posible guía, ya que los detalles finales podrían variar.</p><p>¡Manténganse atentos a nuestras redes sociales para más novedades!</p>', 'THO', 'Calendario habboween THO', '<p class=\'noticia_descripcion\'><strong>¡Llega el calendario de eventos para Habboween en octubre!</strong></p><p class=\'noticia_descripcion\'>Confirmada la llegada de los furnis Freaky Friday y una predicción sobre los raros basados en emojis. ¡Mantente atento para más detalles!</p>', 'es', '2024-10-01 15:27:14'),
(96, 'Participa en nuestra sesión de recogida de opiniones sobre funcionalidades en Discord', 'sesion_recogida_opiniones', 'Sesión de recogida de opiniones en Discord', '<p><strong>Habbo Hotel invita a la comunidad a participar en una sesión de recogida de opiniones sobre nuevas funcionalidades.</strong></p><p>Los interesados pueden unirse a Discord y revisar los últimos avisos para obtener más información sobre esta actividad. Es importante tener en cuenta que se requiere que todos los participantes se comuniquen en inglés, pero todos son bienvenidos a participar. ¡No te pierdas esta oportunidad de compartir tus ideas y contribuir al desarrollo de Habbo Hotel!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/397/participa-en-nuestra-sesion-de-recogida-de-opiniones-sobre-funcionalidades\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'sesión de recogida de opiniones', '<p class=\'noticia_descripcion\'><strong>Participa en la sesión de recogida de opiniones sobre funcionalidades en Discord de Habbo Hotel!</strong> Únete a la comunidad para compartir tus ideas y contribuir al futuro del juego.</p>', 'es', '2024-10-02 13:07:42'),
(97, '¡Es Funky Friday en Habbo Hotel!', 'funky_friday_04_10_2024', 'Catálogo Funky Friday', '<p><strong>Habbo Hotel trae el evento Funky Friday!</strong></p><p>Disfruta de un día lleno de sorpresas y regalos en Habbo Hotel. Durante 24 horas, podrás encontrar una variedad de artículos especiales en el Catálogo y en nuestras redes sociales. No te pierdas la oportunidad de participar en esta celebración única. ¡Corre la voz y únete a la diversión!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/367/es-funky-friday-16\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'funky_friday', 'Evento Funky Friday', '<p class=\'noticia_descripcion\'><strong>Llega el Funky Friday a Habbo Hotel!</strong> Disfruta de regalos y sorpresas durante 24 horas. ¡No te lo pierdas!</p>', 'es', '2024-10-04 13:42:47'),
(98, 'Elección de Miss Vamp y Mister Cerebro en Habboween', 'habboween_miss_vamp_mister_cerebro', 'Elección de Miss Vamp y Mister Cerebro en Habboween', '<p><strong>El evento más esperado de Habboween: Miss Vamp y Mister Cerebro</strong></p><p>En el mes de octubre, Habboween trae de vuelta la glamurosa y horrorosa ceremonia de coronar a la reina y rey de la temporada con la elección de Miss Vamp y Mister Cerebro. Este concurso individual invita a los participantes a crear dos personajes terroríficos relacionados con Habboween. Los aspirantes pueden dibujar desde cero o vestir a sus avatares en el juego y capturar la imagen para enviarla. Los premios incluyen trofeos, la Máquina de escribir, el Raro de la semana y créditos. ¡Anímate a participar y descubre quiénes serán los ganadores el 17 de octubre!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/410/elegimos-a-miss-vamp-y-a-mister-cerebro\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Elección de Miss Vamp y Mister Cerebro en Habboween', '<p class=\'noticia_descripcion\'><strong>Miss Vamp y Mister Cerebro: Concurso terrorífico de Habboween</strong> Los participantes deben crear dos personajes relacionados con Habboween para ser coronados como la pareja más aterradora. Premios especiales esperan a los ganadores. ¡No te pierdas esta emocionante competencia en Habbo!</p>', 'es', '2024-10-07 11:04:04'),
(99, 'Nuevo raro disponible: Césped Habboween', 'catalogo_cesped_habboween', 'Catálogo Césped Habboween', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: ¡Césped Habboween!</strong></p><p>Por tiempo limitado, podrás adquirir un Césped Habboween en el Catálogo por 35 créditos. Esta oferta estará disponible hasta el 15/10 a las 5am CST / 1pm CEST, ¡así que asegúrate de conseguir el tuyo antes de que desaparezca!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/350/raro-anadido-al-catalogo-fontana-gotica\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'rares_martes', 'nuevo raro Césped Habboween', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel: Orígenes presenta: Césped Habboween</strong>. Adquiere este raro por tiempo limitado por 35 créditos. ¡No te lo pierdas!</p>', 'es', '2024-10-08 13:54:39'),
(100, '¡Es Funky Friday en Habbo Hotel!', 'funky_friday_11_10_2024', 'Imagen Funky Friday Habbo Hotel', '<p><strong>Habbo Hotel anuncia la llegada de Funky Friday!</strong></p><p>En el día de hoy, Habbo Hotel celebrará el Funky Friday regalando una variedad de artículos desde su cuenta de Twitter/X. Además, estos artículos estarán disponibles en el Catálogo por tiempo limitado durante 24 horas. No te pierdas esta oportunidad única de conseguir fantásticos regalos y artículos exclusivos en Habbo Hotel!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/369/es-funky-friday-13\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'funky_friday', 'Imagen Staff Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>Llega el Funky Friday a Habbo Hotel!</strong> Aprovecha la oportunidad de obtener regalos exclusivos a través de la cuenta de Twitter/X y en el Catálogo durante 24 horas. ¡No te lo pierdas!</p>', 'es', '2024-10-11 14:04:30'),
(101, '¡ABRIMOS LA VOTACIÓN a Miss Vamp y Míster Cerebro!', 'votacion_miss_vamp_mister_cerebro', 'Votación Miss Vamp y Míster Cerebro', '<p><strong>Habbo Hotel ha anunciado la apertura de la votación para Miss Vamp y Míster Cerebro.</strong></p><p>Los finalistas son Mateplata, dos, Nautik, Vaig, y Spirit-sea. ¡No te pierdas la oportunidad de elegir a tu favorito votando en el formulario de Google disponible en el enlace proporcionado!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/429/abrimos-la-votacion-a-miss-vamp-y-mister-cerebro\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Personal de Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>¡Participa en la votación de Miss Vamp y Míster Cerebro en Habbo Hotel!</strong> Elige a tu finalista favorito y vota en el formulario de Google disponible. ¡No te quedes sin dar tu opinión!</p>', 'es', '2024-10-14 11:04:13'),
(102, 'Nuevo raro disponible: Fontana Gótica!', 'catalogo_fontana_gotica', 'Catalogo Fontana Gótica', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: Fontana Gótica!</strong></p><p>Hasta el 17 de octubre, los jugadores pueden adquirir esta pieza única por 35 créditos en la sección de raros del Catálogo. ¡No te pierdas esta oportunidad exclusiva!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/353/raro-anadido-al-catalogo-cesped-habboween\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'rares_martes', 'Nuevo raro Fontana Gótica', '<p><strong>Nuevo raro en Habbo Hotel: Orígenes!</strong> Se ha añadido al Catálogo la Fontana Gótica, disponible por tiempo limitado. ¡Aprovecha esta oportunidad única!</p>', 'es', '2024-10-15 14:38:00'),
(103, 'Hoja de ruta para Origins: nuevas funcionalidades en camino', 'hoja_de_ruta_origins', 'Hoja de ruta para Origins', '<p><strong>Habbo Hotel: Orígenes presenta su hoja de ruta para futuras actualizaciones</strong></p><p>Después de un lanzamiento exitoso y un verano de consolidación, Habbo Hotel: Orígenes revela las nuevas funcionalidades que estarán llegando al juego en los próximos seis meses. Los jugadores tendrán la oportunidad de votar por las características que desean ver implementadas, siguiendo las preferencias expresadas en el Discord oficial del juego.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/446/una-hoja-de-ruta-para-origins\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen de staff', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel: Orígenes traza su ruta de desarrollo futuro</strong> Descubre las próximas funcionalidades que se agregarán al juego y participa votando por tus preferencias. ¡Mantente atento a las actualizaciones!</p>', 'es', '2024-10-16 11:22:00'),
(104, 'RESULTADOS de Miss Vamp y Míster Cerebro', 'resultados_miss_vamp_mister_cerebro', 'Resultados Miss Vamp y Míster Cerebro', '<p><strong>¡Gracias a todo el mundo que ha votado en el concurso de Miss Vamp y Míster Cerebro!</strong></p><p>Los ganadores son: <br>🥇 Mateplata <br>🥈 dos <br>🥉 Nautik</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/453/resultados-de-miss-vamp-y-mister-cerebro\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'resultados concurso Miss Vamp y Míster Cerebro', '<p class=\'noticia_descripcion\'><strong>Se han anunciado los ganadores del concurso de Miss Vamp y Míster Cerebro en Habbo Hotel.</strong> ¡Descubre quiénes se llevaron los primeros puestos!</p>', 'es', '2024-10-17 14:15:26'),
(105, 'Encuesta Infobus: ¡Trax regresa a Habbo Hotel: Origins!', 'trax_encuesta', 'Imagen de la encuesta sobre la vuelta de Trax a Habbo Hotel: Origins', '<p><strong>Habbo Hotel: Origins desea traer de vuelta la icónica funcionalidad Trax a su juego.</strong></p><p>Los jugadores tendrán la oportunidad de decidir si desean que Trax regrese al juego y en qué condiciones. La encuesta estará disponible desde el 21/10 por una semana, y los resultados serán publicados poco después. Los usuarios podrán votar sobre diferentes aspectos de Trax, como la posibilidad de crear CDs intercambiables, límites de listas de reproducción para miembros HC, y la introducción de la Jukebox.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/458/encuesta-infobus-trax\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen de una noticia sobre Habbo Hotel: Origins', '<p class=\'noticia_descripcion\'><strong>Encuesta Infobus: Trax regresa a Habbo Hotel: Origins!</strong> Los jugadores tendrán la oportunidad de votar sobre el regreso de Trax y su funcionamiento en el juego. ¡Participa en la encuesta y haz escuchar tu voz!</p>', 'es', '2024-10-18 13:57:27'),
(106, 'Nuevo raro añadido al Catálogo: Almohadón Verde Oscuro', 'almohadon_verde_oscuro', 'Almohadón Verde Oscuro', '<p><strong>Habbo Hotel: Orígenes añade un nuevo raro al Catálogo: Almohadón Verde Oscuro!</strong></p><p>Disponible por tiempo limitado hasta el 29/10 a las 6am CST / 1pm CET, este raro tiene un costo de 50 créditos. Aprovecha esta oportunidad única para adquirir esta exclusiva pieza.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/358/raro-anadido-al-catalogo-fontana-gotica-2\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'rares_martes', 'nuevo raro Almohadón Verde Oscuro', '<p class=\'noticia_descripcion\'><strong>¡Se agrega un nuevo raro al Catálogo de Habbo Hotel: Orígenes!</strong> Adquiere el Almohadón Verde Oscuro por tiempo limitado a un precio especial. ¡No te lo pierdas!</p>', 'es', '2024-10-22 16:29:46'),
(107, 'GANADORES del concurso de cuentas de colores de Habboween', 'concurso_habboween_colores', 'Concurso Habboween de cuentas de colores', '<p><strong>Los ganadores del concurso de cuentas de colores de Habboween han sido anunciados por Habbo Hotel.</strong></p><p>En primer lugar, felicidades a Gyar por obtener el primer puesto, seguido por Valito en segundo lugar y Spirit-sea en tercer lugar. Asimismo, Dinosaurio, Mastodon, ChoroMota y otaku ocupan los lugares del 4º al 7º. Los finalistas son invitados a reclamar sus premios poniéndose en contacto con la mesa de ayuda. A pesar de no recibir muchas participaciones, los ganadores demuestran su creatividad y dedicación en el concurso.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/477/ganadores-del-concurso-de-cuentas-de-colores-de-habboween\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'staff de Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel ha anunciado los ganadores del concurso de cuentas de colores de Habboween.</strong> Descubre quiénes se destacaron en este evento y cómo reclamar tus premios.</p>', 'es', '2024-10-23 14:42:35'),
(108, 'Actividad sorpresa con Aleksander', 'actividad_sorpresa_aleksander', 'Actividad sorpresa con Aleksander', '<p><strong>Habbo Hotel presenta una actividad sorpresa con Aleksander!</strong></p><p>¡Mañana a las 8am CST / 4pm CEST, únete a la diversión en Trap Doors en la sala propiedad de Aleksander! Participa en la actividad sorpresa y podrías ganar un premio especial. ¡No te lo pierdas!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/493/actividad-sorpresa\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Actividad sorpresa con Aleksander', '<p class=\'noticia_descripcion\'><strong>No te pierdas la actividad sorpresa de Habbo Hotel con Aleksander!</strong> Mañana a las 8am CST / 4pm CEST en Trap Doors. ¡Ven y diviértete!</p>', 'es', '2024-10-23 15:12:50'),
(109, 'Freaky Friday en Habbo Hotel', 'funky_24_10_2024', 'Catálogo Freaky Friday', '<p><strong>Habbo Hotel presenta: ¡Freaky Friday!</strong></p><p>En este evento especial, Habbo estará regalando una variedad de objetos exclusivos a través de su cuenta de X/Twitter y también los pondrá disponibles en el Catálogo durante 24 horas. ¡No te pierdas esta oportunidad única para obtener artículos increíbles!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/373/es-freaky-friday\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'funky_friday', 'nuevo evento en Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel celebra el Freaky Friday!</strong> Descubre los regalos exclusivos que Habbo está ofreciendo a través de su cuenta de X/Twitter y en el Catálogo durante 24 horas. ¡No te lo puedes perder!</p>', 'es', '2024-10-25 13:40:12'),
(110, 'Encuesta Infobus: ¡ventana de juego de pantalla más ancha!', 'ventana_juego_mas_ancha', 'Ventana de juego más ancha en Origins', '<p><strong>El lunes se lanzará una encuesta en el Infobus de Habbo Hotel sobre la posibilidad de ampliar la ventana de juego de Origins.</strong></p><p>Los usuarios podrán votar a favor o en contra de esta actualización que permitiría una pantalla más amplia para la jugabilidad. Habrá que esperar los resultados de la votación para conocer cuál será la decisión final. ¡Permanece atento a las novedades!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/472/encuesta-infobus-ventana-juego-pantalla-mas-ancha\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen de staff', '<p class=\'noticia_descripcion\'><strong>Se realizará una encuesta sobre la ventana de juego de Origins.</strong> Los usuarios tendrán la oportunidad de opinar sobre la posibilidad de ampliar la ventana de juego. ¡Participa y haz escuchar tu voz!</p>', 'es', '2024-10-25 18:52:26'),
(111, 'El retorno del Raro muerto: evento en vivo', 'habbo_infierno', 'Habbo Infierno', '<p><strong>Un evento especial llega a Habbo Hotel: El retorno del Raro muerto en vivo!</strong></p><p>En la noche de Habboween, una horda de criaturas se dirige a La Habbo Biblioteca para realizar un ritual satánico y invocar al Raro más terrorífico que se esconde en el Habbo Infierno. ¿Serán capaces de despertarlo con sus cánticos? Descúbrelo el martes 29 de octubre a las 5:30am CST / 12:30pm CET en La Habbo Biblioteca. ¡Prepárate para un evento lleno de misterio y terror!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/441/el-retorno-del-raro-muerto-evento-en-vivo\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Staff', '<p class=\'noticia_descripcion\'><strong>¡El Raro muerto regresa en un evento en vivo!</strong> Únete a la horda de criaturas en La Habbo Biblioteca el martes 29 de octubre. ¿Podrán despertar al Raro más aterrador? No te lo pierdas.</p>', 'es', '2024-10-28 10:45:01'),
(112, 'Resultados de la encuesta sobre la Trax en Habbo Hotel: Origins', 'encuesta_trax', 'Resultados de la encuesta sobre la Trax en Habbo Hotel', '<p><strong>¡La comunidad ha hablado sobre la introducción de Trax en Habbo Hotel: Origins!</strong></p><p>Los resultados globales muestran un claro apoyo a la incorporación de Trax, con la mayoría de los votos a favor en cada una de las preguntas planteadas. Los eventos de noviembre prometen ser más emocionantes con esta nueva función. Sin embargo, se ha especificado que los miembros HC no tendrán un límite de playlist más alto, una demanda escuchada y respetada por el equipo. </p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/497/resultados-de-la-encuesta-sobre-la-trax\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Resultados de la encuesta sobre la Trax en Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>La comunidad aprueba la introducción de Trax en Habbo Hotel: Origins!</strong> Los eventos de noviembre se vuelven más interesantes con esta nueva función. Los miembros HC no tendrán un límite de playlist más alto, en respuesta a una solicitud de la comunidad.</p>', 'es', '2024-10-28 13:36:42'),
(113, 'Nuevo raro disponible! Dragón de Fuego Negro', 'catalogo_dragondfuegonegro', 'Catalogo Dragón de Fuego Negro', '<p><strong>Habbo Hotel: Orígenes presenta el nuevo raro: Dragón de Fuego Negro!</strong></p><p>Disponible en el catálogo por tiempo limitado hasta el 31 de octubre a las 6am CST / 1pm CEST, por un precio de 75 créditos. Aprovecha esta oportunidad única para añadir esta pieza a tu colección antes de que desaparezca definitivamente de las tiendas. ¡No te lo pierdas!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/363/raro-anadido-al-catalogo-caldero-de-habboween\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'rares_martes', 'nuevo raro jueves 31 de octubre', '<p class=\"noticia_descripcion\"><strong>¡Nueva adición al Catálogo de raros en Habbo Hotel: Orígenes!</strong> Dragón de Fuego Negro disponible por tiempo limitado. ¡Hazte con el tuyo antes de que se agote!</p>', 'es', '2024-11-01 04:14:39'),
(114, '¡GANADORES de la Fiesta Terrorífica del año anunciados!', 'fiesta_terrorifica_ganadores', 'Fiesta Terrorífica Ganadores', '<p><strong>¡Los ganadores de la Fiesta Terrorífica del año han sido anunciados!</strong></p><p>¡Felicidades a Dinosaurio por llevarse el primer lugar, seguido de .:Deee:. en segundo lugar y Nautik en el tercer lugar! También queremos mencionar a los participantes en el 4º al 10º lugar: ChoroMota, CRISTAL, Diegocop, Mateplata, Roni, Spirit-sea y XL. ¡Por favor, póngase en contacto con nuestra mesa de ayuda para reclamar sus premios!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/517/ganadores-de-la-fiesta-terrorifica-del-ano\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Fiesta Terrorífica Ganadores Staff', '<p class=\'noticia_descripcion\'><strong>¡Anunciados los ganadores de la Fiesta Terrorífica del año!</strong> Dinosaurio en primer lugar, .:Deee:. en segundo lugar y Nautik en tercer lugar. ¡Felicidades a todos los participantes!</p>', 'es', '2024-10-29 19:49:29'),
(115, 'El Pase de Batalla para Creadores de Contenido se toma un descanso', 'pase_de_batalla', 'Imagen Pase de Batalla', '<p><strong>Habbo ha anunciado oficialmente que el Pase de Batalla para creadores de contenido se detendrá por el momento.</strong></p><p>Tras evaluar su efectividad, Habbo ha decidido interrumpir el Pase de Batalla en conjunto con la agencia KGeN. Todos los premios pendientes serán entregados hoy, y no se revisarán ni otorgarán más premios a partir de ahora. Además, Habbo se separa de KGeN.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/521/el-pase-de-batalla-para-creadores-de-contenido-se-toma-un-descanso\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen Staff', '<p><strong>Habbo toma un descanso del Pase de Batalla para Creadores de Contenido, poniendo fin a la asociación con KGeN.</strong></p>', 'es', '2024-10-30 12:18:40'),
(116, 'Desfile de Habboween en Habbo Hotel: Orígenes', 'desfile_habboween', 'Desfile de Habboween en Habbo Hotel: Orígenes', '<p><strong>El Desfile de Habboween llega a Habbo Hotel: Orígenes para celebrar el Día de Muertos</strong></p><p>El 31 de octubre a las 8am CST / 3pm CET, los jugadores están invitados a participar en un desfile virtual por las salas más creativas y embrujadas construidas por la comunidad. La diversión y las sorpresas están garantizadas en este evento especial de la temporada de miedo. ¡No te lo pierdas!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/523/vispera-del-dia-de-muertos-el-desfile-de-habboween\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Personal de Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>Prepárate para el Desfile de Habboween en Habbo Hotel: Orígenes</strong> este 31 de octubre. ¡Un evento lleno de sorpresas y emoción virtual te espera!</p>', 'es', '2024-10-30 12:48:57'),
(117, 'Nuevo raro disponible! Caldero de Habboween', 'catalogo_caldero_habboween', 'Caldero de Habboween en el Catálogo', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: el Caldero de Habboween!</strong></p><p>Por tiempo limitado, los usuarios podrán adquirir el Caldero de Habboween por 30 créditos en la sección de raros del Catálogo. Esta oferta estará disponible hasta el 02/11 a las 6am CST / 1pm CEST. ¡Asegúrate de conseguir el tuyo antes de que se agoten!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/360/raro-anadido-al-catalogo-almohadon-verde-oscuro\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'rares_martes', 'Nuevo raro en Habbo Hotel: Orígenes', '<p class=\"noticia_descripcion\"><strong>Nuevo raro disponible en Habbo Hotel: Orígenes!</strong> Consigue el exclusivo Caldero de Habboween por tiempo limitado. ¡No te lo pierdas!</p>', 'es', '2024-11-01 03:49:43'),
(118, '¡Es Funky Friday en Habbo Hotel!', 'catalogo_funkyfriday', 'Catalogo Funky Friday', '<p><strong>Habbo Hotel celebra el Funky Friday!</strong></p><p>En el día de hoy, Habbo Hotel está regalando una gran variedad de objetos exclusivos a través de su cuenta de X/Twitter, los cuales también estarán disponibles por 24 horas en el Catálogo. No te pierdas esta oportunidad única de conseguir increíbles regalos y disfrutar del Funky Friday en Habbo Hotel!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/375/es-funky-friday-17\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'funky_friday', 'nuevo raro jueves 08 de agosto del 2024', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel celebra el Funky Friday!</strong> No te pierdas la oportunidad de conseguir regalos exclusivos durante 24 horas. ¡Es una experiencia que no te puedes perder!</p>', 'es', '2024-11-01 20:35:34'),
(119, 'Los muebles de Habboween dejan el Catálogo mañana', 'catálogo_habboween', 'Catálogo Habboween', '<p>¡Atención Traders! Habbo Hotel ha anunciado que los muebles de Habboween se retirarán del Catálogo a partir de mañana. Se informa que los raros y los artículos de Freaky Friday no regresarán, pero existe la posibilidad de que otros elementos regresen en el futuro.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/538/los-muebles-de-habboween-se-van-del-catalogo-manana\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'imagen staff', '<p class=\'noticia_descripcion\'>¡Importante noticia! Los muebles de Habboween se despiden del Catálogo de Habbo mañana. ¡No te lo pierdas!</p>', 'es', '2024-11-01 13:08:28'),
(120, 'Aprobada la ventana de juego panorámica', 'ventana_panoramica', 'Ventana de juego panorámica', '<p><strong>Habbo Hotel introduce la nueva ventana de juego panorámica</strong></p><p>Con un apoyo del 90.6% a nivel mundial, Habbo Hotel ha decidido implementar una versión panorámica de la ventana del juego. Esta actualización permitirá a los usuarios disfrutar de una experiencia de juego más inmersiva. ¡Pronto estará disponible para todos los jugadores!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/474/aprobada-la-ventana-de-juego-panoramica\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'ventana panorámica', '<p><strong>Habbo Hotel aprueba la ventana de juego panorámica</strong></p><p>Tras una votación abrumadoramente positiva, Habbo Hotel anuncia la introducción de la ventana de juego panorámica. ¡Prepárate para una nueva experiencia en el hotel!</p>', 'es', '2024-11-04 14:14:33'),
(121, '¡Nuevos Sample Packs y Habbo Tocadiscos raros llegan a Origins!', 'sample_packs', 'Sample Packs y Habbo Tocadiscos raros', '<p>Habbo Hotel Origins se complace en anunciar la llegada de dos nuevos paquetes de artículos a su tienda web. Estos incluirán una variedad de samples de Trax, una Traxmachine y un exclusivo y raro Habbo Tocadiscos. Las fechas de lanzamiento son las siguientes: 06/11, 13/11, 20/11 y 27/11. ¡No te pierdas esta oportunidad de adquirir estos fabulosos artículos!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/541/541\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'descripción de la noticia', '<p class=\'noticia_descripcion\'>Habbo Hotel Origins anuncia la llegada de nuevos Sample Packs y un Habbo Tocadiscos raro a su tienda web. Aprovecha esta oportunidad exclusiva en las fechas mencionadas. ¡Imperdible!</p>', 'es', '2024-11-04 20:07:39'),
(122, 'Nuevo raro añadido al Catálogo: El Hablador', 'catalogo_hablador', 'Catálogo El Hablador', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: El Hablador!</strong></p><p>Disponible en el Catálogo por tiempo limitado hasta el 06/11 a las 6am CST / 1pm CEST por 50 créditos. ¡Aprovecha esta oportunidad única para agregar esta pieza a tu colección!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/549/raro-anadido-al-catalogo-xxxxx\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'nuevo raro añadido al Catálogo', '<p class=\'noticia_descripcion\'><strong>El Hablador llega al Catálogo de Habbo Hotel: Orígenes!</strong> Adquiere este raro por tiempo limitado. ¡No te lo pierdas!</p>', 'es', '2024-11-05 12:15:33'),
(123, 'Ganadores del caldero de la Parada de Habboween', 'caldero_habboween', 'Caldero de Habboween', '<p><strong>Los Habbos Vaig, Bala, Dinosaurio, Roni y Pululador ganaron un Caldero de Habboween </strong> por ser los primeros en encontrar el raro en el Desfile de Habboween la semana pasada. ¡Felicidades a los afortunados ganadores!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/566/ganadores-del-caldero-de-la-parada-de-habboween\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen de personal', '<p class=\'noticia_descripcion\'><strong>Los Habbos Vaig, Bala, Dinosaurio, Roni y Pululador fueron los afortunados ganadores del Caldero de Habboween en la Parada de Habboween. </strong> ¡Enhorabuena a los afortunados!</p>', 'es', '2024-11-06 16:29:39');
INSERT INTO `noticias` (`id`, `titulo`, `imagen_completa`, `alt_imagen_completa`, `descripcion_completa`, `imagen_resumida`, `alt_imagen_resumida`, `descripcion_resumida`, `hotel`, `fecha_noticia`) VALUES
(125, '¡Es Funky Friday en Habbo Hotel!', 'funky_08_11_2024', 'Catálogo Funky Friday', '<p><strong>Habbo Hotel celebra Funky Friday con regalos exclusivos!</strong></p><p>Hoy, Habbo Hotel está celebrando Funky Friday regalando una variedad de objetos especiales a través de su cuenta de X/Twitter. Además, estos objetos también estarán disponibles en el Catálogo por 24 horas. ¡No te pierdas esta oportunidad única de obtener increíbles regalos!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/587/es-funky-friday-18\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'funky_friday', 'Nuevo raro jueves 08 de agosto del 2024', '<p class=\'noticia_descripcion\'><strong>¡Funky Friday llega a Habbo Hotel!</strong> No te pierdas la oportunidad de obtener regalos exclusivos a través de la cuenta de X/Twitter y en el Catálogo por tiempo limitado.</p>', 'es', '2024-11-08 13:19:22'),
(126, '¡Nuevo raro disponible en el Catálogo: Disco Sign!', 'catalogo_disk_sign', 'Catálogo Disco Sign', '<p><strong>¡Habbo Hotel: Orígenes presenta un nuevo raro en el Catálogo: Disco Sign!</strong></p><p>Desde ahora y hasta el 14/11 a las 6am CST / 1pm CEST, los usuarios podrán adquirir el Disco Sign por 25 créditos. No dejes pasar esta oportunidad única, ya que estas piezas no volverán a estar disponibles en Habbo Hotel: Orígenes.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/594/raro-anadido-al-catalogo-el-hablador\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'nuevo raro en el Catálogo', '<p class=\'noticia_descripcion\'><strong>Nuevo raro disponible en Habbo Hotel: Orígenes: Disco Sign!</strong> Aprovecha la oportunidad de obtener esta pieza exclusiva por tiempo limitado en el Catálogo.</p>', 'es', '2024-11-12 12:17:38'),
(127, 'GANADORES de la Mezcla Trax: competición #1 anunciados!', 'catalogo_ganadores', 'Catálogo Ganadores Mezcla Trax', '<p><strong>Los ganadores de la competición Mezcla Trax ya han sido revelados por Habbo!</strong></p><p>Valito se lleva el primer lugar, seguido por josillo98 en segundo lugar y Perfectionist en tercer lugar. Las posiciones del 4º al 10º lugar son ocupadas por OrigenesH, El:Carritas, SpectracK, Padrino, Habbolympix, Bye y Roni. ¡Felicidades a todos los ganadores!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/585/ganadores-de-la-mezcla-trax-competicion-1\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Ganadores Mezcla Trax', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel revela a los afortunados ganadores de la competición Mezcla Trax!</strong> Descubre quiénes se destacaron en esta emocionante competencia.</p>', 'es', '2024-11-13 20:07:24'),
(128, '¡Se han añadido Jukeboxes a Origins!', 'jukeboxes_origins', 'Jukeboxes en Origins', '<p><strong>¡Habbo Hotel añade Jukeboxes a Origins!</strong></p><p>Se han añadido dos Jukeboxes a la sección Jukebox del Catálogo de Habbo Hotel. Estos Jukeboxes te permitirán reproducir tus CDs de Trax en tu habitación. Permanecerán disponibles indefinidamente y no se consideran raros. Habbo Hotel informará con anticipación si en algún momento deciden retirarlos.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/608/se-han-anadido-jukeboxes-a-origins\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Personal de Habbo', '<p class=\'noticia_descripcion\'><strong>¡Nuevas Jukeboxes disponibles en Origins!</strong> Ahora podrás reproducir tus CDs de Trax en tu habitación gracias a los dos nuevos Jukeboxes agregados al Catálogo de Habbo Hotel. ¡Aprovecha esta nueva funcionalidad!</p>', 'es', '2024-11-14 12:16:40'),
(129, '¡Es Funky Friday en Habbo Hotel!', 'catalogo_funkyfriday', 'Catálogo Funky Friday', '<p><strong>Habbo Hotel celebra Funky Friday!</strong></p><p>En este día especial, Habbo Hotel está regalando una variedad de objetos exclusivos a través de su cuenta de X/Twitter. Además, todos estos artículos estarán disponibles en el Catálogo durante 24 horas. ¡No te pierdas esta oportunidad de obtener increíbles regalos y nuevas adquisiciones para tu colección!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/613/es-funky-friday-19\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'funky_friday', 'Funky Friday en Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Celebra Funky Friday en Habbo Hotel!</strong> Aprovecha los regalos y nuevos objetos disponibles por tiempo limitado a través de la cuenta de X/Twitter y en el Catálogo durante 24 horas. ¡No te lo pierdas!</p>', 'es', '2024-11-19 13:23:57'),
(130, 'Encuesta Infobus: muebles Neón y Tocadiscos', 'encuesta_infobus', 'Encuesta Infobus', '<p><strong>Habbo Hotel: Origins lanza una nueva encuesta en el Infobus para conocer la opinión de la comunidad sobre muebles Neón y Tocadiscos.</strong></p><p>Los Habbos podrán votar sobre la posibilidad de añadir la línea de furnis Neón, hacer permanente la línea de muebles Neón, regalar algunos de estos muebles a los usuarios, otorgar Tocadiscos originales como premio de una competición y comprometerse a no vender nunca el Tocadiscos original de Habbo. ¡No te pierdas la oportunidad de participar en esta importante encuesta!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/617/617\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Encuesta Infobus', '<p class=\'noticia_descripcion\'><strong>Nueva encuesta en Habbo Hotel: Origins! </strong> Los usuarios podrán votar sobre la adición de muebles Neón y premios de Tocadiscos originales en una competición próxima. ¡Participa y haz escuchar tu voz en la comunidad de Habbo!</p>', 'es', '2024-11-15 15:06:06'),
(131, 'Actividad sorpresa con Aleksander en Trap Doors', 'aleksander_activity', 'Actividad sorpresa con Aleksander', '<p><strong>Habbo Hotel presenta una actividad sorpresa con Aleksander en Trap Doors!</strong></p><p>Únete a la diversión el 20/11 a las 4pm CET (9am CST) y el 21/11 a las 4pm CET (9 am CST) para participar en juegos y tal vez ganar increíbles premios. Busca la sala propiedad de Aleksander y disfruta de esta emocionante actividad secreta.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/630/actividad-sorpresa-2\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Actividad sorpresa con Aleksander', '<p class=\'noticia_descripcion\'><strong>No te pierdas la actividad sorpresa con Aleksander en Trap Doors!</strong> Únete a la diversión y participa en juegos para ganar premios. ¡Te esperamos!</p>', 'es', '2024-11-19 09:55:29'),
(132, 'Nuevo raro disponible! La Ventolera Ocre', 'catalogo_ventolera_ocre', 'Catalogo La Ventolera Ocre', '<p><strong>Habbo Hotel: Orígenes presenta el nuevo raro: La Ventolera Ocre!</strong></p><p>A partir de hoy y hasta el 26/11 a las 6am CST / 1pm CEST, podrás adquirir el La Ventolera Ocre en la sección de raros del Catálogo por tan solo 50 créditos. No dejes pasar la oportunidad de añadir esta exclusiva pieza a tu colección, ya que no volverá a estar disponible en Habbo Hotel: Orígenes!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/634/raro-anadido-al-catalogo-disco-sign\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'rares_martes', 'nuevo raro jueves 26 de noviembre del 2024', '<p class=\'noticia_descripcion\'><strong>Descubre el nuevo raro en Habbo Hotel: Orígenes, La Ventolera Ocre!</strong> Disponible por tiempo limitado a un precio especial de 50 créditos. ¡Aprovecha esta oportunidad única!</p>', 'es', '2024-11-19 13:24:18'),
(133, 'Preventa del vinilo de edición limitada de la Trax', 'vinilo_trax', 'Vinilo de edición limitada de la Trax', '<p><strong>Habbo Hotel: Orígenes anuncia la preventa del vinilo de edición limitada de la Trax!</strong></p><p>En colaboración con CptnAlex Designs, se producirán discos en formato vinilo que contienen los tres mejores trabajos de cada competición Mezcla Trax. Cada vinilo incluirá un código canjeable por una Placa Mezcla Trax 2024 en Habbo Hotel: Orígenes. La preventa ya está disponible en shophabbo.com hasta el 6 de diciembre. ¡No te pierdas esta edición limitada!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/641/preventa-del-vinilo-de-edicion-limitada-de-la-trax\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'imagen representativa de la Trax', '<p class=\'noticia_descripcion\'><strong>Anunciada la preventa del vinilo de edición limitada de la Trax en Habbo Hotel: Orígenes!</strong> ¡Consigue los mejores trabajos de las competiciones Mezcla Trax en un vinilo exclusivo. ¡Reserva antes del 6 de diciembre!</p>', 'es', '2024-11-20 12:36:12'),
(134, 'Competición Mezcla Trax #3: Música R&B', 'trax_competition', 'Imagen de la competición Mezcla Trax #3: Música R&B', '<p><strong>Hola Traders, tengo una nueva noticia, la cual generé con IA para ustedes.</strong></p><p>Cada semana de noviembre, en Habbo Hotel, se lleva a cabo la competición Mezcla Trax #3. En esta ocasión, el género musical solicitado es Música R&B. Los participantes deben usar la Traxmachine y las muestras proporcionadas para crear una nueva pista siguiendo este género. La fecha límite de entrega es el 22 de noviembre.</p><p>Los premios incluyen placas de oro, plata y bronce, así como créditos para los primeros tres lugares. Además, los 10 mejores participantes recibirán una placa exclusiva. Para enviar la propuesta, los participantes deben seguir ciertas reglas, como añadir un prefijo al nombre de la pista y ceñirse al género establecido.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/644/la-mezcla-trax-competicion-3\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen de Habbo Staff', '<p class=\"noticia_descripcion\"><strong>En Habbo Hotel se realiza la competición Mezcla Trax #3: Música R&B.</strong> Participa y muestra tu talento musical siguiendo las reglas establecidas, ¡no te lo pierdas!</p>', 'es', '2024-11-20 16:28:17'),
(135, 'Trofeos de Puerta Trampa entregados por error', 'trofeos_puerta_trampa', 'Trofeos de Puerta Trampa entregados por error', '<p>Por error, los trofeos equivocados fueron entregados a los ganadores del evento Puertas Trampa de ayer.</p><p>Los trofeos incorrectos fueron retirados y los ganadores recibirán los trofeos adecuados. Agradecemos la comprensión y paciencia de todos mientras solucionábamos este problema.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/662/trofeos-de-puerta-trampa\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Trofeos de Puerta Trampa', '<p class=\'noticia_descripcion\'>Por error, se entregaron trofeos equivocados a los ganadores del evento Puertas Trampa. Los trofeos incorrectos fueron retirados y los ganadores recibirán los trofeos correctos. Gracias por su paciencia.</p>', 'es', '2024-11-21 11:49:01'),
(136, 'Resultados de la encuesta Infobus sobre los furnis Neón y el Tocadiscos', 'encuesta_infobus_resultados', 'Encuesta Infobus Resultados', '<p><strong>Los resultados de la encuesta sobre los furnis Neón y el Tocadiscos han sido revelados!</strong></p><p>Infobus ha finalizado el recuento de votos globales para cada una de las cinco preguntas relacionadas con una próxima competición de construcción de salas en Habbo. ¡Descubre cuál fue la opinión mayoritaria de la comunidad en cada propuesta!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/647/resultados-de-la-encuesta-infobus-sobre-los-furnis-neon-y-el-tocadiscos\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Resultados de encuesta', '<p class=\'noticia_descripcion\'><strong>Infobus publica los resultados de la encuesta sobre furnis Neón y el Tocadiscos en Habbo!</strong> Los votos globales revelan la opinión de la comunidad ante las propuestas para la competición de salas.</p>', 'es', '2024-11-21 14:30:42'),
(137, 'Construye un club nocturno en Origins y gana un trofeo de martillo', 'club_nocturno_origins', 'Club Nocturno Origins', '<p><strong>Habbo Hotel: Orígenes te desafía a construir un club nocturno espectacular y ganar un trofeo de martillo exclusivo.</strong></p><p>Participa en el concurso construyendo una sala de discoteca innovadora y técnicamente impresionante. Utiliza los furnis Neón gratuitos de la tienda para crear un auténtico ambiente de fiesta.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/650/construye-un-club-nocturno-en-origins\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Club Nocturno 2024', '<p class=\'noticia_descripcion\'><strong>¡Construye un club nocturno en Origins y gana un trofeo de martillo exclusivo!</strong> Participa en el concurso y crea una sala de discoteca espectacular con furnis Neón gratuitos. ¡Demuestra tu creatividad y habilidad técnica!</p>', 'es', '2024-11-21 20:54:26'),
(138, 'Habbo Club: Edición Dedicada', 'habbo_club_edicion_dedicada', 'Habbo Club: Edición Dedicada', '<p><strong>Habbo Club presenta la Edición Dedicada en colaboración con CptnAlex Designs</strong></p><p>¡Los miembros del Habbo Club ahora pueden disfrutar de una experiencia completamente nueva con las nuevas cajas de suscripción mensual! Cada caja contiene productos temáticos de Habbo y un regalo icónico HC exclusivo para su uso en Origins. ¡No te pierdas esta emocionante oferta!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/667/667\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Habbo Club: Edición Dedicada', '<p class=\'noticia_descripcion\'><strong>Nueva oferta exclusiva para miembros del Habbo Club</strong> Descubre la Edición Dedicada con cajas mensuales llenas de productos temáticos de Habbo y un regalo único para usar en el juego. ¡Increíble oportunidad para los amantes de Habbo!</p>', 'es', '2024-11-22 12:53:26'),
(139, 'Funky Friday en Habbo Hotel!', 'funky_friday', 'Funky Friday en Habbo Hotel', '<p><strong>Habbo Hotel anuncia un Funky Friday especial!</strong></p><p>Hoy es Funky Friday en Habbo Hotel, y para celebrarlo, están regalando una gran cantidad de muebles y ropa desde su cuenta de Twitter. Además, todas estas recompensas estarán disponibles en el Catálogo durante 24 horas. ¡No te pierdas esta oportunidad única!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/675/es-funky-friday-20\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Funky Friday', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel celebra el Funky Friday!</strong> No te pierdas la oportunidad de conseguir increíbles premios desde su cuenta de Twitter y en el Catálogo durante 24 horas.</p>', 'es', '2024-11-22 14:24:18'),
(140, 'GANADORES de la Mezcla Trax: competición #2 anunciados por Trades Habbo (THO)!', 'mezcla_trax_ganadores', 'Ganadores de la competición de Mezcla Trax', '<p><strong>Trades Habbo (THO) ha revelado los ganadores de la competición de Mezcla Trax #2!</strong></p><p>¡Felicidades a los tres primeros lugares: AlfBeckenbauer en el primer puesto, Ceniciento en el segundo y CL4S1C0 en el tercero! Además, MasterTrades, guaypepelu, mossyman, MissVamp, xuco, nachakagamine y BenjiJr ocupan del cuarto al décimo lugar en la competición.¡Haz clic aquí para conocer los premios que recibirán los Habbo ganadores y participantes!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/678/ganadores-de-la-mezcla-trax-competicion-2\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Noticia Trax Ganadores', '<p class=\'noticia_descripcion\'><strong>Trades Habbo (THO) presenta a los ganadores de la Mezcla Trax competición #2!</strong> Descubre quiénes se destacaron en esta emocionante competencia. ¡Felicidades a todos los participantes!</p>', 'es', '2024-11-22 15:14:55'),
(141, 'Encuesta InfoBus de 24 horas: productos digitales', 'encuesta_infobus', 'Imagen de la encuesta InfoBus de Habbo Hotel', '<p><strong>Encuesta InfoBus de 24 horas: productos digitales</strong></p><p>Los Habbos han expresado su opinión sobre la inclusión de activos digitales junto con el merchandising físico en Habbo Club: Signature Edition. En respuesta, se ha lanzado una encuesta en el InfoBus para decidir si se deberían incluir artículos digitales en futuros lanzamientos de merchandising. Los usuarios tienen 24 horas para votar y participar en la toma de decisiones de Habbo Hotel: Orígenes.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/681/encuesta-infobus-de-24-horas-productos-digitales\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen representativa de una encuesta en Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>Encuesta en el InfoBus:</strong> Los Habbos tendrán la oportunidad de decidir si se incluyen artículos digitales en futuros lanzamientos de merchandising en Habbo Hotel: Orígenes. ¡Participa y haz escuchar tu voz!</p>', 'es', '2024-11-25 13:03:34'),
(142, 'Nuevo raro disponible! Habbo Tocadiscos', 'catalogo_tocadiscos', 'Catálogo Tocadiscos', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: Habbo Tocadiscos!</strong></p><p>A partir de hoy, podrás adquirir el Habbo Tocadiscos en el Catálogo por un precio de 75 créditos. Esta pieza estará disponible solo hasta el 28/11 a las 6am CST / 1pm CEST. ¡No dejes pasar esta oportunidad única!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/689/raro-anadido-al-catalogo-la-ventolera-ocre\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'nuevo raro Habbo Tocadiscos', '<p class=\'noticia_descripcion\'><strong>¡Nueva adición al Catálogo de raros!</strong> Consigue el exclusivo Habbo Tocadiscos por tiempo limitado a un precio especial. ¡Corre y obtén el tuyo!</p>', 'es', '2024-11-26 14:48:14'),
(143, 'Importante información sobre la competencia de habitaciones', 'discoteca_construccion', 'Construcción de discoteca', '<p><strong>Habbo Hotel emite comunicado sobre la competencia de habitaciones</strong></p><p>Los organizadores del concurso de construcción de discotecas informan a los usuarios que no se están viendo todas las participaciones en el juego, debido a problemas técnicos al visitar salas con muchos furnis. Solicitan a los participantes que suban una foto de sus salas a una red social y la envíen a un formulario de Google en un plazo de 2 días. La fecha límite para enviar las fotos es este viernes. Lamentan los inconvenientes causados y agradecen la comprensión de la comunidad.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/692/importante-informacion-sobre-la-competencia-de-habitaciones\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Personal de Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel solicita fotos de salas de discoteca para concurso</strong> Los organizadores piden a los participantes del concurso de habitaciones que suban fotos de sus discotecas a una red social y las envíen a un formulario de Google en un plazo de 2 días. Ganadores serán anunciados este viernes.</p>', 'es', '2024-11-26 16:29:17'),
(144, 'Evento en Vivo: Fiesta de escucha Trax', 'fiesta_escucha_trax', 'Fiesta de escucha Trax', '<p><strong>El personal de Habbo Hotel invita a todos a la Fiesta de escucha Trax</strong></p><p>¡Mañana, 27 de noviembre, a las 8 a.m. CST / 3 p.m. CET, únete al personal en el Recibidor para disfrutar de una fiesta de escucha! Pronto abrirán una de sus salas y trasladarán la fiesta allí, donde podrás entregar tus CDs Trax para que los reproduzcan en su Jukebox. ¡No te lo pierdas!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/696/evento-en-vivo-fiesta-de-escucha-trax\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Personal de Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel anuncia la Fiesta de escucha Trax</strong></p><p>Mañana, no te pierdas la oportunidad de unirte al personal en el Recibidor para disfrutar de una fiesta de escucha y compartir tus CDs Trax. ¡Vive la experiencia musical con Habbo!</p>', 'es', '2024-11-26 20:11:29'),
(145, 'Competición Mezcla Trax: semana #4 - género ROCK', 'trax_comp_rock', 'Competición Mezcla Trax', '<p><strong>¡Participa en la competición Mezcla Trax de esta semana con el género musical ROCK!</strong></p><p>Crea una pista única utilizando la Traxmachine y las muestras proporcionadas. Graba tu mejor pista en un CD y entrégala antes de la fecha límite del 29/11. ¡Gana una placa exclusiva y hasta 100 créditos!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/702/la-mezcla-trax-competicion-3-2\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Staff Trades Habbo', '<p class=\'noticia_descripcion\'><strong>Participa en la competición Mezcla Trax de esta semana con el género ROCK y gana premios exclusivos!</strong></p>', 'es', '2024-11-27 16:12:56'),
(146, 'Reducción de precios en Habbo Origins', 'habbo_origins_precio', 'Precios reducidos en Habbo Origins', '<p><strong>Habbo Hotel: Orígenes anuncia una reducción de precios en sus hoteles .COM.BR y .ES</strong></p><p>En respuesta a los comentarios de los jugadores, Habbo Origins reducirá los precios de los Créditos y las suscripciones en aproximadamente un 50% en dos semanas. Esta medida busca hacer más accesibles los créditos y la membresía al Habbo Club, estimulando la participación de más jugadores en la comunidad. Adicionalmente, se ofrece la opción de transferir objetos de las cuentas .ES y .COM.BR a .COM para quienes deseen hacerlo.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/714/bajadas-de-precio-y-transferencias-de-objetos-para-com-br-y-es\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Noticia sobre reducción de precios en Habbo Origins', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel: Orígenes reduce precios y ofrece transferencia de cuentas</strong> para fomentar la actividad en la comunidad. ¡Consulta los cambios y opciones disponibles!</p>', 'es', '2024-11-28 14:55:37'),
(147, 'Pausado el lanzamiento de la línea HC: Edición Dedicada', 'hc_linea_edicion_dedicada', 'Línea HC: Edición Dedicada', '<p><strong>Habbo anuncia la pausa en el lanzamiento de la HC: Edición Dedicada</strong></p><p>Tras escuchar las opiniones de la comunidad, Habbo ha decidido detener temporalmente el lanzamiento de la línea HC: Edición Dedicada. El equipo se tomará un tiempo para replantear el proyecto y asegurarse de que sea atractivo para todos los fans de Habbo. Lamentan cualquier frustración causada y se comprometen a resolver el asunto para un futuro relanzamiento.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/728/informacion-sobre-el-hc-edicion-dedicada\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Pausa en el lanzamiento HC: Edición Dedicada', '<p class=\'noticia_descripcion\'><strong>Se detiene temporalmente el lanzamiento de la HC: Edición Dedicada en Habbo</strong> Después de escuchar las opiniones de la comunidad, el equipo ha decidido pausar el proyecto para hacer mejoras. ¡Estén atentos a futuras actualizaciones!</p>', 'es', '2024-11-28 16:06:26'),
(148, 'Ganadores de la Mezcla Trax: Competición #3 anunciados por Habbo', 'ganadores_mezcla_trax', 'Ganadores Mezcla Trax', '<p><strong>En una emocionante competición, Habbo ha anunciado los ganadores de la Mezcla Trax: competición #3!</strong></p><p>Los tres primeros puestos son: 🥇 Romeo, 🥈 BobMarley, y 🥉 Mateoro. Además, las posiciones del 4º al 10º lugar fueron ocupadas por azulito, SpectracK, HX, Codigo, Rainbow, Javotx y ACMER. ¡Felicidades a todos los participantes!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/736/ganadores-de-la-mezcla-trax-competicion-3\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Ganadores Mezcla Trax', '<p class=\'noticia_descripcion\'><strong>Habbo anuncia los ganadores de la Mezcla Trax: Competición #3</strong>. ¡Descubre quiénes se destacaron en esta competición emocionante!</p>', 'es', '2024-11-29 13:48:26'),
(149, 'Nuevo raro disponible: Hologirl en Habbo Hotel Orígenes', 'hologirl_catalogo', 'Catálogo de Hologirl en Habbo Hotel', '<p><strong>Habbo Hotel Orígenes presenta el nuevo raro: Hologirl</strong></p><p>El 8 de agosto de 2024, se lanzó el raro mítico Hologirl en el catálogo de Habbo Hotel Orígenes. Este exclusivo artículo está disponible por tiempo limitado a un precio especial de 50 créditos. Es el primer raro lanzado en un jueves y solo estará disponible por 48 horas. ¡Aprovecha esta oportunidad para agregarlo a tu colección!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/752/una-navidad-como-en-los-origenes-%f0%9f%8e%84\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Nuevo raro del jueves 08 de agosto del 2024 en Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel Orígenes presenta el nuevo raro: Hologirl</strong>. Descubre y adquiere este exclusivo artículo, disponible por 48 horas.</p>', 'es', '2024-12-03 12:21:42'),
(150, '¡Una Navidad como en los Orígenes en Habbo Hotel!', 'navidad_origenes_habbo', 'Decoración navideña en Habbo Hotel', '<p><strong>¡Los usuarios de Habbo Hotel: Orígenes podrán disfrutar de una Navidad llena de eventos y diversión!</strong></p><p>Con la llegada de la temporada navideña, Habbo Hotel ha lanzado una amplia gama de furnis originales, juegos en vivo con los Staff y premios, un concurso de salas, la apertura del Teatro de Navidad, Raros y lanzamientos de Viernes de Fiesta, entre otras sorpresas. Además, la placa de Navidad estará disponible de forma gratuita para todos los usuarios. ¡No te pierdas esta celebración única en Habbo Hotel: Orígenes!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/760/una-navidad-como-en-los-origenes\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'nuevas sorpresas navideñas en Habbo Hotel: Orígenes', '<p class=\"noticia_descripcion\"><strong>¡Celebra una Navidad especial en Habbo Hotel: Orígenes con eventos exclusivos y premios!</strong> Descubre todos los detalles de la celebración navideña que te espera en la icónica versión de Habbo Hotel.</p>', 'es', '2024-12-03 12:31:53'),
(151, 'Nuevo raro disponible en Habbo Hotel: Orígenes: Alfombra de nieve', 'catalogo_alfombra_nieve', 'Catalogo Alfombra de Nieve', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: la Alfombra de nieve!</strong></p><p>Disponible por tiempo limitado en el Catálogo, esta exclusiva Alfombra de nieve puede ser tuya por tan solo 35 créditos. ¡No te pierdas la oportunidad de decorar tu sala con este rarito antes de que desaparezca! La oferta termina el 10/12 a las 6am CST / 1pm CEST.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/748/raro-anadido-al-catalogo-habbo-tocadiscos\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'nuevo raro Alfombra de nieve', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Aprovecha la oportunidad de adquirir la Alfombra de nieve por 35 créditos antes de que desaparezca. ¡Decora tu sala con este exclusivo artículo!</p>', 'es', '2024-12-03 12:42:03'),
(152, '¡Es Festive Friday en Habbo Hotel!', 'catalogo_festivefriday', 'Catálogo Festive Friday', '<p><strong>Habbo Hotel celebra Festive Friday!</strong></p><p>Hoy es un día especial en Habbo Hotel, ya que están regalando una gran variedad de artículos desde su cuenta de X/Twitter y también los van a poner en el Catálogo durante 24 horas. No te pierdas esta ocasión única de obtener increíbles regalos festivos. ¡Corre a por ellos!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/780/es-festive-friday\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'nueva promoción en Habbo Hotel', '<p class=\'noticia_descripcion\'><strong>Festive Friday en Habbo Hotel!</strong> Habbo está regalando muchos artículos desde su cuenta de X/Twitter y los ha puesto en el Catálogo por 24 horas. ¡Aprovecha esta oportunidad para conseguir regalos festivos!</p>', 'es', '2024-12-06 12:28:58'),
(153, '¡Estamos redecorando para Navidad!', 'decoracion_navidad', 'Decoración de Navidad', '<p><strong>Habbo Hotel se prepara para la temporada festiva redecorando cuatro habitaciones públicas y añadiendo el icónico vestíbulo navideño, ¡con nieve incluida! </strong></p><p>Las habitaciones redecoradas son El Teatro, La Terraza del Sol, La Azotea y Cafe Olé. Además, se ha incluido una nueva adición para Navidad: Main Lobby. ¡Disfruta del ambiente navideño en Habbo!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/768/estamos-redecorando-para-navidad\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Personal staff', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel se prepara para la Navidad redecorando habitaciones públicas y añadiendo una nueva sala festiva. ¡No te pierdas el ambiente navideño único en el hotel!</strong></p>', 'es', '2024-12-06 19:53:05'),
(154, 'Raro añadido al Catálogo: La Bola de Nieve', 'catalogo_bola_nieve', 'Catálogo La Bola de Nieve', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: La Bola de Nieve!</strong></p><p>Por tiempo limitado, podrás adquirir La Bola de Nieve en el catálogo por tan solo 35 créditos. Esta pieza estará disponible hasta el 12/12 a las 6am CST / 1pm CET. ¡No dejes pasar esta oportunidad única de agregar este raro a tu colección!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/786/raro-anadido-al-catalogo-alfombra-de-nieve\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'rares_martes', 'Evento nuevo raro La Bola de Nieve', '<p class=\'noticia_descripcion\'><strong>Nuevo raro disponible en Habbo Hotel: Orígenes!</strong> Adquiere La Bola de Nieve por un tiempo limitado en el catálogo. ¡Aprovecha esta oportunidad única!</p>', 'es', '2024-12-10 14:28:07'),
(155, 'GANADORES de la Mezcla Trax: ¡competición #4!', 'catalogo_mezcla_trax', 'Catalogo Mezcla Trax', '<p><strong>¡Anuncio oficial de los ganadores de la competición de Mezcla Trax por parte de Habbo Hotel!</strong></p><p>Los tres primeros puestos son Esculapio, R.Hagrid y box. Las posiciones del 4º al 10º lugar son ocupadas por Spirit-sea, BenjiJr, Amo, JuanJoseJoey, .:Venus82:., Alejandrusco y w!gu3.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/791/ganadores-de-la-mezcla-trax-competicion-4\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'nuevo raro jueves 08 de agosto del 2024', '<p class=\'noticia_descripcion\'><strong>Ganadores anunciados de la competición de Mezcla Trax por Habbo Hotel!</strong> Descubre quiénes se llevaron los primeros puestos en esta emocionante competición musical.</p>', 'es', '2024-12-10 20:12:35'),
(156, 'El InfoBus vuelve con una charla sobre el impacto de las redes sociales en la salud mental', 'infobus_salud_mental', 'Imagen del InfoBus y el tema de la charla sobre salud mental', '<p><strong>El InfoBus vuelve a estar en marcha en Habbo Hotel con una sesión exclusiva sobre el impacto de las redes sociales en la salud mental.</strong></p><p>En esta ocasión, se abordarán los trastornos y problemáticas emocionales asociadas al uso de las redes, así como consejos para protegernos en internet. No te pierdas esta oportunidad de aprender y compartir con la comunidad.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/806/vuelven-las-charlas-de-seguridad-en-el-infobus\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen de un staff de Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>El InfoBus vuelve con una charla sobre el impacto de las redes sociales en la salud mental en Habbo Hotel.</strong> Aprende sobre trastornos emocionales y seguridad en internet en esta sesión exclusiva. ¡Únete a la conversación!</p>', 'es', '2024-12-13 13:40:58'),
(157, '¡Festive Friday en Habbo Hotel!', 'festive_friday', 'Imagen promocional de Festive Friday en Habbo Hotel', '<p><strong>Hoy es Festive Friday en Habbo Hotel!</strong></p><p>Celebramos este día regalando una variedad de artículos desde nuestra cuenta de X/Twitter, los cuales también estarán disponibles en el Catálogo durante 24 horas. ¡No te pierdas esta oportunidad única de obtener increíbles regalos!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/803/es-festive-friday-2\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen del personal de la fansite Trades Habbo (THO)', '<p class=\"noticia_descripcion\"><strong>Celebra el Festive Friday en Habbo Hotel!</strong> Disfruta de regalos exclusivos disponibles en nuestro Catálogo por tiempo limitado. ¡Únete a la diversión!</p>', 'es', '2024-12-13 13:51:07'),
(158, 'Juego XMAS BOOM esta semana!', 'dados_juego', 'Dados del juego XMAS BOOM', '<p>Esta semana, Habbo está organizando un nuevo y emocionante juego llamado BOOM. El objetivo del juego es lograr la suma más alta entre los dos equipos al tirar los dados cuando la caja de regalo esté en los rodillos de tu equipo. El primer equipo en alcanzar 3 puntos en el marcador, gana. ¡No te pierdas la diversión!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/830/juega-boom-con-el-personal-esta-semana\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Imagen de staff', '<p class=\'noticia_descripcion\'>¡Participa en el juego XMAS BOOM esta semana y trata de lograr la suma más alta entre los equipos! No te lo pierdas.</p>', 'es', '2024-12-16 15:57:12'),
(159, 'Raro añadido al Catálogo: \'¿Adivinas quien soy?\'', 'adivina_quien_soy', 'Adivina quien soy en el Catálogo', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro en su Catálogo: \'¿Adivinas quien soy?\'</strong></p><p>Por un costo de 40 créditos, los usuarios podrán adquirir este misterioso raro hasta el 24/12 a las 6am CST / 1pm CET. ¡No te pierdas esta oportunidad única en Habbo Hotel: Orígenes!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/818/raro-anadido-al-catalogo-adivinas-quien-soy\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Nuevo raro en el Catálogo de Habbo Hotel: Orígenes 24/12', '<p class=\'noticia_descripcion\'><strong>Habbo Hotel: Orígenes ha añadido un nuevo raro al Catálogo: \'¿Adivinas quien soy?\'. </strong>Disponible por 40 créditos hasta el 24/12. ¡Consigue el tuyo antes de que se agoten!</p>', 'es', '2024-12-17 12:39:54'),
(160, 'Consigue una placa de Navidad 2024 gratis en Habbo Orígenes', 'placa_navidad_2024', 'Placa de Navidad 2024 en Habbo Orígenes', '<p><strong>Habbo Orígenes ofrece una placa de Navidad 2024 de forma gratuita como obsequio especial!</strong></p><p>Desde ahora y hasta el 25 de diciembre, todos los usuarios que inicien sesión en Habbo Orígenes recibirán una exclusiva placa conmemorativa de la primera Navidad en la historia del hotel. ¡Aprovecha esta oportunidad única!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/837/consigue-una-placa-de-navidad-2024-gratis\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'imagen representativa de staff', '<p class=\'noticia_descripcion\'><strong>Habbo Orígenes regala una placa de Navidad 2024 a sus usuarios!</strong> Solo tienes que ingresar al hotel y la placa será tuya al instante. ¡No te lo pierdas!</p>', 'es', '2024-12-17 19:44:07'),
(161, 'Regalo anticipado de Navidad de Dave', 'regalo_navidad_dave', 'Regalo anticipado de Navidad de Dave', '<p><strong>Dave, también conocido como Macklebee o Dom, ha sorprendido a los jugadores activos con un regalo especial de Navidad</strong></p><p>Los jugadores activos han recibido un pequeño regalo enviado por Dave. Se les pide que abran el regalo, tomen una foto del contenido y etiqueten a X en las redes sociales (@HabboOrigins).</p><p>Si no recibiste uno, es probable que no hayas iniciado sesión en los últimos 2 meses. Habbo Origins decidió premiar a los jugadores activos con este regalo. Es importante destacar que no se atenderán tickets individuales de servicio al cliente relacionados con regalos faltantes, por lo que se pide a los usuarios que colaboren y no envíen solicitudes relacionadas.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/843/regalo-antemano-de-navidad-de-dave\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Regalo anticipado de Navidad de Dave', '<p class=\'noticia_descripcion\'><strong>Dave, también conocido como Macklebee o Dom, ha enviado un regalo sorpresa a los jugadores activos en Habbo</strong></p><p>Se insta a los jugadores a abrir el regalo, tomar una foto del contenido y etiquetar a X (@HabboOrigins). Aquellos que no hayan iniciado sesión en los últimos 2 meses probablemente no recibieron el regalo, ya que Habbo Origins está premiando a los jugadores activos con esta iniciativa especial.</p>', 'es', '2024-12-18 08:52:09'),
(163, 'Concurso de Pixel Art: Papá Noel Rastafari y la nieve infinita', 'papa_noel_nieve_infinita', 'Papá Noel Rastafari y la nieve infinita', '<p><strong>Habbo Hotel: Orígenes anuncia un emocionante concurso de Pixel Art</strong></p><p>Participa en el concurso individual para dibujar a Papá Noel Rastafari descubriendo su método para generar nieve infinita en Habbo Hotel. Demuestra tu creatividad y talento artístico digitalmente para ganar increíbles premios. ¡No te lo pierdas!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/854/854\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Concurso de Pixel Art', '<p class=\'noticia_descripcion\'><strong>¡Participa en el concurso de Pixel Art de Papá Noel Rastafari y la nieve infinita en Habbo Hotel: Orígenes!</strong> Demuestra tu creatividad digital y gana premios increíbles. ¡Diviértete creando arte pixelado!</p>', 'es', '2024-12-18 19:41:12'),
(164, '¡Ganadores de la Fiesta de Navidad de DJ-Bling anunciados!', 'fiesta_navidad_dj_bling_ganadores', 'Fiesta de Navidad DJ-Bling Ganadores', '<p><strong>¡Anunciamos los 10 primeros puestos de la Fiesta de Navidad de DJ-Bling!</strong></p><p>Los ganadores son: otaku, DM-AVENGER, Vaig, Nene, ChoroMota, Valito, florida-135, CL4S1C0, MatePlata, reylukas. Haz clic en el enlace para ver qué premios recibirán.</p><p><strong>NOTA:</strong> Debido a la alta participación, la entrega de insignias puede retrasarse hasta mañana. Agradecemos tu paciencia.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/812/812\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Staff', '<p class=\"noticia_descripcion\"><strong>Ganadores anunciados para la Fiesta de Navidad de DJ-Bling en Habbo Hotel.</strong> Descubre quiénes ocuparon los primeros 10 puestos y qué premios recibirán. ¡Consulta los resultados ahora!</p>', 'es', '2024-12-19 01:53:47'),
(167, 'Raro añadido al Catálogo: Dragón Púrpura', 'catalogo_dragon_purpura', 'Catálogo Dragón Púrpura', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: Dragón Púrpura!</strong></p><p>Desde ahora y hasta el 26/12 a las 6am CST / 1pm CET, podrás adquirir el increíble <strong>Dragón Púrpura</strong> por tan solo 75 créditos en la sección de raros del Catálogo. Asegúrate de obtener el tuyo antes de que desaparezca, ya que esta pieza no volverá a salir en Habbo Hotel: Orígenes.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/824/raro-anadido-al-catalogo-dragon-de-fuego\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'nuevo raro jueves 26 de diciembre del 2024', '<p class=\'noticia_descripcion\'><strong>Descubre el nuevo raro en Habbo Hotel: Orígenes!</strong> Se ha añadido al Catálogo el <strong>Dragón Púrpura</strong> por tiempo limitado. ¡No te lo pierdas!</p>', 'es', '2024-12-26 11:11:34'),
(168, 'Ganadores del modo nieve infinita de Papá Noel Rastafari', 'ganadores_papa_noel', 'Ganadores Papá Noel Rastafari', '<p><strong>Habbo Hotel anuncia a los ganadores del modo nieve infinita de Papá Noel Rastafari!</strong></p><p>Los afortunados ganadores del evento son: Empty, El:Carritas, MatePlata, Outname, otaku, Eurocopa2024, Nautik, AleuSm y Vaig. ¡Felicidades a todos ellos por su excelente desempeño!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/874/el-modo-nieve-infinita-de-papa-noel-rastafari-ganadores\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'nuevos ganadores evento', '<p class=\'noticia_descripcion\'><strong>Anunciados los ganadores del modo nieve infinita de Papá Noel Rastafari en Habbo Hotel!</strong> ¡Descubre quiénes fueron los afortunados en este emocionante evento!</p>', 'es', '2024-12-27 09:41:06'),
(169, 'Es Festive Friday en Habbo Hotel!', 'festive_friday', 'Festive Friday en Habbo Hotel', '<p><strong>Habbo Hotel anuncia Festive Friday!</strong></p><p>Desde su cuenta de X/Twitter, Habbo Hotel está regalando una gran cantidad de objetos especiales. Además, todos estos objetos estarán disponibles en el Catálogo durante 24 horas. ¡No te pierdas esta oportunidad de conseguir increíbles regalos para tu avatar!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/827/es-festive-friday-4\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Festive Friday', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel celebra Festive Friday!</strong> Objetos especiales disponibles en el Catálogo por tiempo limitado. ¡Aprovecha esta oportunidad única!</p>', 'es', '2024-12-27 14:54:00'),
(170, '¡Juega BOOM con el personal esta semana!', 'juego_boom', 'Juego BOOM', '<p><strong>Habbo Hotel anuncia evento especial: ¡Juega BOOM con el personal esta semana!</strong></p><p>El 02 de enero a las 3pm CET (8am CST), en XMAS BOOM (buscar la sala propiedad de Aleksander), los usuarios podrán participar en un divertido juego con premios en juego. ¡No te lo pierdas y únete a la diversión!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/880/juega-boom-con-el-personal-esta-semana-2\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Personal de Habbo', '<p class=\'noticia_descripcion\'><strong>Nuevo evento en Habbo Hotel: ¡Juega BOOM con el personal!</strong> Participa en esta actividad especial esta semana y disfruta de grandes premios en juego. ¡Te esperamos!</p>', 'es', '2024-12-31 09:38:44'),
(171, 'Nueva encuesta en InfoBus: Regulador de Luces', 'encuesta_regulador_luces', 'Encuesta Regulador de Luces', '<p><strong>¡Nuevo contenido llega a Habbo Hotel!</strong></p><p>La encuesta entrante en InfoBus presentará la posibilidad de añadir Regulador de Luces al juego, con la opción de incluir otros modos de iluminación en el futuro. Los votos estarán abiertos a los miembros del Habbo Club a partir de las 6 a.m. CST / 1 p.m. CET de mañana. No te pierdas la oportunidad de participar en la decisión de este nuevo contenido para Habbo Hotel.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/883/encuesta-entrante-en-infobus-luces-de-ambiente\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Encuesta Regulador de Luces', '<p class=\'noticia_descripcion\'><strong>Nueva encuesta en InfoBus!</strong> Habbo Hotel presenta la oportunidad de votar sobre la adición de Regulador de Luces y otros modos de iluminación en el futuro. ¡Únete y participa en la encuesta desde mañana!</p>', 'es', '2025-01-01 19:48:12');
INSERT INTO `noticias` (`id`, `titulo`, `imagen_completa`, `alt_imagen_completa`, `descripcion_completa`, `imagen_resumida`, `alt_imagen_resumida`, `descripcion_resumida`, `hotel`, `fecha_noticia`) VALUES
(172, 'Encuesta InfoBus sobre el Regulador de Luces', 'regulador_luces', 'Regulador de Luces', '<p><strong>Habbo Hotel: Encuesta de InfoBus sobre el Regulador de Luces</strong></p><p>Mañana a las 6 a.m. CST / 1 p.m. CET, se abrirá una encuesta en InfoBus para que los miembros del Habbo Club voten sobre la adición del Regulador de Luces y otros modos de iluminación en el futuro. Dave, conocido como Macklebee, ha actualizado el Regulador de Luces y los usuarios tendrán la oportunidad de expresar su opinión. ¡No olvides votar y ser parte de la decisión!.</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/883/encuesta-entrante-en-infobus-luces-de-ambiente\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'Noticia Habbo Encuesta', '<p class=\'noticia_descripcion\'><strong>Encuesta en InfoBus para agregar Regulador de Luces en Habbo</strong>. Mañana se abre la oportunidad para que miembros del Habbo Club voten sobre la adición del Regulador de Luces y otros modos de iluminación futuros. ¡Exprese su opinión y sea parte de la decisión!</p>', 'es', '2025-01-02 07:59:50'),
(173, '¡Es Funky Friday en Habbo Hotel!', 'catalogo_funkyfriday', 'Catálogo Funky Friday', '<p><strong>Habbo Hotel celebra el Funky Friday con regalos y ofertas exclusivas!</strong></p><p>En este día especial, Habbo Hotel estará regalando una gran cantidad de objetos desde su cuenta de X/Twitter y también los pondrá disponibles en el Catálogo por 24 horas. ¡No te pierdas esta oportunidad única de obtener increíbles premios y ofertas especiales!</p>Este es un resumen de la noticia oficial <a href=\"https://origins.habbo.es/community/article/900/es-funky-friday-21\" target=\"_blank\">Link</a><br>Esta noticia ha sido generada con IA por lo mismo puede tener errores gramaticales o hablar como si fuera parte del equipo de habbo', 'staff', 'nuevo raro jueves', '<p class=\'noticia_descripcion\'><strong>¡Celebra el Funky Friday en Habbo Hotel con regalos y ofertas exclusivas!</strong> Habbo Hotel estará regalando una gran cantidad de objetos desde su cuenta de X/Twitter y también los pondrá disponibles en el Catálogo por 24 horas. ¡Aprovecha esta oportunidad única!</p>', 'es', '2025-01-03 12:13:09'),
(204, 'É a Festive Friday!', '2025-01-05-23-26-33', 'Catálogo Festive Friday', '<p><strong>A Festive Friday chegou ao Habbo Hotel!</strong></p><p>No dia 5 de janeiro de 2025, o Habbo Hotel anunciou a Festive Friday, onde vários itens estarão disponíveis por um período limitado de 24 horas no catálogo. Os usuários também poderão acompanhar a distribuição desses itens através da conta oficial do Habbo no X/Twitter. Não perca a oportunidade de garantir esses itens exclusivos!</p>', 'staff', 'evento Festive Friday no Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Chegou a Festive Friday no Habbo Hotel!</strong> Itens especiais estarão disponíveis no catálogo por apenas 24 horas. Fique ligado!</p>', 'com.br', '2025-01-05 23:26:50'),
(205, 'Enquete sobre novas roupas no Habbo Hotel: Origins!', '2025-01-05-23-27-40', 'Nova atualização de roupas do Habbo Hotel', '<p><strong>A Habbo anunciou uma enquete para saber a opinião da comunidade sobre novas opções de roupas no jogo.</strong></p><p>No dia 23 de outubro, os usuários poderão responder a perguntas sobre a adição de novas roupas, incluindo opções exclusivas e a possibilidade de comprá-las com moeda real. A Habbo busca envolver a comunidade antes de implementar essas mudanças, especialmente em relação aos desejados Chapéus de Papai Noel.</p>', 'staff', 'Enquete de roupas Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>A Habbo Hotel está realizando uma enquete sobre novas roupas!</strong> Os jogadores podem opinar sobre a introdução de novas opções e chapéus de Papai Noel. Participe até dia 23 de outubro!</p>', 'com.br', '2025-01-05 23:28:03'),
(206, 'Item Raro disponível! Lâmpada do Dragão Roxa', '2025-01-05-23-28-53', 'Catálogo Lâmpada do Dragão Roxa', '<p><strong>Um novo item raro foi adicionado ao catálogo de Habbo Hotel: Origens: Lâmpada do Dragão Roxa!</strong></p><p>Disponível a partir de agora, a <strong>Lâmpada do Dragão Roxa</strong> pode ser adquirida por 75 créditos até às 9h BR / 12h PT do dia 26/12. Este item raro estará na seção de Raros do Catálogo e não será lançado novamente. Não perca a oportunidade de obter este item exclusivo para sua coleção!</p>', 'rares_martes', 'novo raro Lâmpada do Dragão Roxa', '<p class=\"noticia_descripcion\"><strong>Chegou um novo raro ao Habbo Hotel: Origens!</strong> Descubra e adquira a nova <strong>Lâmpada do Dragão Roxa</strong>, disponível por tempo limitado. Não fique de fora!</p>', 'com.br', '2025-01-05 23:29:10'),
(207, 'O modo de neve infinita do Papai Noel Rasta: VENCEDORES', '2025-01-05-23-30-01', 'Vencedores do modo de neve infinita do Papai Noel Rasta', '<p><strong>O modo de neve infinita do Papai Noel Rasta chegou a sua conclusão!</strong></p><p>Com grande empolgação, Habbo Hotel anunciou os vencedores do evento especial de Natal, que trouxe o modo de neve infinita. Os sortudos vencedores incluem: <strong>MatheusCaldas</strong>, <strong>Daviandro</strong>, <strong>Post</strong>, <strong>Rakut</strong>, <strong>Remorso</strong>, <strong>Yami</strong>, <strong>Socorro</strong>, <strong>Collection</strong>, <strong>Marcos</strong> e <strong>Arclean</strong>. Parabéns a todos eles! Este evento foi uma excelente oportunidade para os jogadores se divertirem e experimentarem a magia do Natal em Habbo.</p>', 'staff', 'Vencedores do modo de neve infinita do Papai Noel Rasta', '<p class=\"noticia_descripcion\"><strong>Os vencedores do modo de neve infinita do Papai Noel Rasta foram anunciados!</strong> Parabéns a <strong>MatheusCaldas</strong>, <strong>Daviandro</strong>, <strong>Post</strong>, <strong>Rakut</strong>, <strong>Remorso</strong>, <strong>Yami</strong>, <strong>Socorro</strong>, <strong>Collection</strong>, <strong>Marcos</strong> e <strong>Arclean</strong>!</p>', 'com.br', '2025-01-05 23:30:25'),
(208, 'É a Festive Friday!', '2025-01-05-23-31-11', 'Catálogo Festive Friday', '<p><strong>A Habbo Hotel anunciou a Festive Friday!</strong></p><p>Além de distribuir vários itens em sua conta X/Twitter, esses itens estarão disponíveis no Catálogo por 24 horas! Não perca a chance de adquirir esses itens temáticos e aproveite ao máximo essa festividade que promete trazer muita diversão e novidades para a comunidade!</p>', 'staff', 'eventos Festive Friday no Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Chegou a Festive Friday no Habbo Hotel!</strong> Confira e adquira itens exclusivos, disponíveis apenas por 24 horas. Aproveite essa oportunidade!</p>', 'com.br', '2025-01-05 23:31:27'),
(209, 'Novo raro disponível! Almofada de Seda Vermelha', '2025-01-05-23-32-20', 'Catálogo Almofada de Seda Vermelha', '<p><strong>A nova adição ao catálogo de Habbo Hotel: Origens: Almofada de Seda Vermelha!</strong></p><p>Até o dia 02 de janeiro de 2024, às 9h BR / 12h PT, os jogadores podem adquirir a nova <strong>Almofada de Seda Vermelha</strong> por apenas 50 créditos. Este item raro estará disponível apenas por um tempo limitado na seção de Raros do Catalogo. Não percam a oportunidade de garantir esse item exclusivo para suas coleções, pois não haverá um novo lançamento no Habbo Hotel: Origens!</p>', 'rares_martes', 'novo raro disponível até 02 de janeiro de 2024', '<p class=\"noticia_descripcion\"><strong>Um novo raro chega ao Habbo Hotel: Origens!</strong> Conheça e adquira a <strong>Almofada de Seda Vermelha</strong>, disponível por tempo limitado. Não perca essa chance!</p>', 'com.br', '2025-01-05 23:32:39'),
(210, 'Enquete chegando no InfoBus: Regulador de Luzes!', '2025-01-05-23-33-29', 'Regulador de Luzes no jogo', '<p><strong>Habbo anuncia a chegada do Regulador de Luzes!</strong></p><p>A partir das 9h BR / 12h PT de amanhã, uma nova enquete no InfoBus permitirá que os jogadores votem sobre a adição do Regulador de Luzes ao jogo e sobre a possibilidade de incluir outros modos de iluminação no futuro. Os participantes devem acessar a sala pública do InfoBus através do Navegador do jogo para exercer seu direito de voto. Lembre-se: apenas membros do Habbo Club podem participar. A enquete se encerrará na próxima quinta-feira, às 9h BR / 12h PT.</p>', 'staff', 'enquete sobre Regulador de Luzes no InfoBus', '<p class=\"noticia_descripcion\"><strong>Participe da nova enquete no InfoBus!</strong> A enquete sobre a adição do Regulador de Luzes começa amanhã. Apenas membros do Habbo Club podem votar. Não perca esta oportunidade!</p>', 'com.br', '2025-01-05 23:33:50'),
(211, 'É a Funky Friday!', '2025-01-05-23-34-37', 'Catálogo Funky Friday', '<p><strong>A nova Funky Friday chegou ao Habbo Hotel!</strong></p><p>Durante 24 horas, vários itens serão adicionados ao catálogo e distribuídos na conta X/Twitter. Os jogadores terão a oportunidade de adquirir esses itens únicos por tempo limitado. Não perca a chance de enriquecer sua coleção com essas novidades especiais!</p>', 'funky_friday', 'evento Funky Friday no Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Chegou a Funky Friday no Habbo Hotel!</strong> Vários itens estarão disponíveis no catálogo e na conta oficial. Aproveite esta oportunidade por 24 horas!</p>', 'com.br', '2025-01-05 23:34:53'),
(212, 'Impromptu Poll on Clothing in Habbo Hotel: Origins', '2025-01-05-23-36-58', 'Poll on New Clothing Options', '<p><strong>Habbo Hotel: Origins launches an impromptu poll regarding clothing options!</strong></p><p>As part of their initiative, Habbo has introduced Santa hats to thank active users but seeks community input on the future direction of clothing in the game. Players are invited to share their thoughts on various options, including new clothing items, introduction to Habbo Club, and exclusive clothing time-limited items. Responses are requested before Monday, the 23rd, 12:00 PM UTC, in hopes of incorporating community feedback before Christmas.</p>', 'staff', 'Poll on Clothing Options in Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel: Origins is conducting a poll!</strong> Share your opinion on new clothing options and help shape the future of Habbo’s wardrobe. Your feedback is essential!</p>', 'com', '2025-01-05 23:37:17'),
(213, 'New rare available! The Purple Dragon Lamp', '2025-01-05-23-38-08', 'Purple Dragon Lamp Catalogue', '<p><strong>The new rare item in Habbo Hotel: Origins: Purple Dragon Lamp!</strong></p><p>On December 15, 2023, a new rare item is launched in the catalogue of Habbo Hotel: Origins. The <strong>Purple Dragon Lamp</strong> is now available for a limited time at the special price of 75 credits. This rare item will only be available until 12pm GMT (4am PDT) on December 26, and will never return to the catalogue again. Don’t miss the chance to add this unique piece to your collection!</p>', 'rares_martes', 'new rare December 15, 2023', '<p class=\"noticia_descripcion\"><strong>A new rare has arrived in Habbo Hotel: Origins!</strong> Discover and acquire the new rare, <strong>Purple Dragon Lamp</strong>, available for a limited time. Don’t miss out!</p>', 'com', '2025-01-05 23:38:26'),
(214, 'Play Winter Trap Doors with us tomorrow!', '2025-01-05-23-39-16', 'Winter Trap Doors event announcement', '<p><strong>Join us tomorrow for another seasonal game of Trap Doors with Aleksander!</strong></p><p>Scheduled for the 27th of December at 2pm GMT (6am PST), players are invited to experience the Winter Trap Doors event. Participants can find the room owned by Aleksander to join the fun!</p>', 'staff', 'Winter Trap Doors event announcement', '<p class=\"noticia_descripcion\"><strong>Don\'t miss out on the Winter Trap Doors game!</strong> Join Aleksander tomorrow at 2pm GMT for a thrilling game of Trap Doors. Be sure to find the right room!</p>', 'com', '2025-01-05 23:39:34'),
(215, 'Rasta Santa’s Infinite Snow Mode Winners!', '2025-01-05-23-40-23', 'Winners of Rasta Santa’s Infinite Snow Mode', '<p><strong>Habbo Hotel has announced the winners of Rasta Santa’s Infinite Snow Mode!</strong></p><p>The lucky winners are: Areppo, Jeca, HlT, amiee, Kitartas, Weske, MrTroll, Murkell, Robbi, and pillowcased. Congratulations to all winners for their achievements in this festive event!</p>', 'staff', 'Rasta Santa’s Infinite Snow Mode winners announcement', '<p class=\"noticia_descripcion\"><strong>Great news from Habbo Hotel!</strong> The winners of Rasta Santa’s Infinite Snow Mode have been revealed: Areppo, Jeca, HlT, amiee, Kitartas, Weske, MrTroll, Murkell, Robbi, and pillowcased. Congratulations to all!</p>', 'com', '2025-01-05 23:40:41'),
(216, 'It\'s FESTIVE FRIDAY!', '2025-01-05-23-41-32', 'Festive Friday event announcement', '<p><strong>It\'s FESTIVE FRIDAY at Habbo!</strong></p><p>In addition to giving away a variety of exciting items on their X/Twitter account, Habbo has also added these items to the Catalogue for a limited time of 24 hours! Users are encouraged to check the Catalogue for a chance to grab these exclusive items before they disappear.</p>', 'staff', 'Festive Friday event items', '<p class=\"noticia_descripcion\"><strong>A Festive Friday surprise at Habbo!</strong> Discover a range of exciting items now available in the Catalogue for just 24 hours. Don\'t miss out!</p>', 'com', '2025-01-05 23:41:47'),
(217, 'Play BOOM with staff this Friday!', '2025-01-05-23-42-38', 'Play BOOM game event', '<p><strong>Join the staff for an exciting game of BOOM this Friday!</strong></p><p>On March 1st, 2024, at 2pm GMT (6am PST), players are invited to participate in a game of BOOM. The event will take place in the room named \'XMAS BOOM\', owned by Aleksander. Prizes will be available for participants, making this a perfect opportunity for players to join the fun!</p>', 'staff', 'BOOM game with staff event', '<p class=\"noticia_descripcion\"><strong>Don\'t miss the BOOM game event!</strong> Join the staff on March 1st at 2pm GMT for a thrilling game of BOOM in the \'XMAS BOOM\' room. Exciting prizes await!</p>', 'com', '2025-01-05 23:42:57'),
(218, 'New Rare Available! Red Silk Pillow', '2025-01-05-23-43-46', 'Red Silk Pillow Catalog', '<p><strong>The new rare item in Habbo Hotel: Origins: Red Silk Pillow!</strong></p><p>From January 2nd, 2025, a limited-time rare item is available in the Habbo Hotel: Origins catalog. The <strong>Red Silk Pillow</strong> is priced at 50 credits and will remain in the rare section of the catalog until 12pm GMT (4am PDT) on February 1st. This is a unique opportunity to add a one-of-a-kind piece to your collection, as this item will never be released again in Habbo Hotel: Origins.</p>', 'rares_martes', 'new rare Red Silk Pillow January 2nd, 2025', '<p class=\"noticia_descripcion\"><strong>A new rare arrives at Habbo Hotel: Origins!</strong> Discover and acquire the new rare, <strong>Red Silk Pillow</strong>, available for a limited time only. Don’t miss out!</p>', 'com', '2025-01-05 23:44:03'),
(219, 'Incoming InfoBus Poll: Mood Lights!', '2025-01-05-23-44-54', 'Mood Lights Announcement', '<p><strong>The new poll regarding Mood Lights has been announced by Habbo!</strong></p><p>On the upcoming date of tomorrow at approximately 12pm GMT, a new InfoBus poll will be activated. The poll will consist of two questions: <strong>Shall we add Mood Lights?</strong> and <strong>Should we introduce other lighting modes in the future?</strong> Players are encouraged to join the InfoBus public room through the in-game Navigator to cast their votes. Voting is exclusive to Habbo Club members, and the poll will close next Thursday at around 12pm GMT. Be sure to participate!</p>', 'staff', 'Mood Lights poll announcement', '<p class=\"noticia_descripcion\"><strong>A new poll on Mood Lights is coming to Habbo!</strong> Players can vote on adding Mood Lights and future lighting modes starting tomorrow at 12pm GMT. Participation is limited to Habbo Club members only!</p>', 'com', '2025-01-05 23:45:14'),
(220, 'It’s FUNKY FRIDAY!', '2025-01-05-23-46-02', 'Funky Friday Event', '<p><strong>Today marks the exciting occasion of FUNKY FRIDAY!</strong></p><p>As part of this celebration, a variety of items are being given away on Habbo\'s X/Twitter account and will also be available in the Catalogue for 24 hours. Don’t miss the opportunity to grab some amazing goodies during this limited-time event!</p>', 'funky_friday', 'Funky Friday Event Announcement', '<p class=\"noticia_descripcion\"><strong>Exciting news from Habbo!</strong> It\'s FUNKY FRIDAY, featuring giveaways and exclusive items available for 24 hours. Be sure to take advantage of this fun event!</p>', 'com', '2025-01-05 23:46:19'),
(221, 'New Clothing Options Coming to Habbo Hotel: Origins!', '2025-01-05-23-47-10', 'Habbo Clothing Options', '<p><strong>Exciting news from Habbo Hotel: Origins!</strong></p><p>In December, Habbo conducted an InfoBus poll regarding the addition of new clothing options in Origins, with overwhelming support from the community. A staggering 90.3% of voters expressed enthusiasm for new clothing, emphasizing that items should be earnable through gameplay rather than purchased with real money. The results also indicated a strong preference for seasonal collections and limited-time exclusives, making it clear that players desire more engagement in clothing options.</p>', 'staff', 'New clothing options coming soon', '<p class=\"noticia_descripcion\"><strong>Exciting updates for Habbo Hotel: Origins!</strong> A recent poll reveals that players overwhelmingly want new clothing options, preferring earnable items and seasonal collections. Stay tuned for more updates!</p>', 'com', '2025-01-05 23:47:34'),
(222, 'Item Raro adicionado ao catálogo: Chafariz Vermelho', '2025-01-07-12-09-15', 'Catalogo Chafariz Vermelho', '<p><strong>Um novo item raro chegou ao Habbo Hotel: Origens!</strong></p><p>O <strong>Chafariz Vermelho</strong> está disponível por tempo limitado no catálogo por apenas 75 créditos. Ele ficará disponível na seção de Raros até às 9h BR / 12h PT do dia 10/01. Não perca a oportunidade de garantir esse item exclusivo, pois não será lançado novamente!</p>', 'rares_martes', 'novo raro Chafariz Vermelho', '<p class=\"noticia_descripcion\"><strong>Um item raro chegou ao Habbo Hotel: Origens!</strong> Confira o <strong>Chafariz Vermelho</strong>, disponível por 75 créditos e apenas até o dia 10/01. Não fique de fora!</p>', 'com.br', '2025-01-07 12:09:35'),
(223, 'New Rare Available! The Red Bird Bath', '2025-01-07-12-10-30', 'Red Bird Bath Catalogue Item', '<p><strong>Introducing the latest rare item in Habbo Hotel: Origins: Red Bird Bath!</strong></p><p>The Red Bird Bath is now available in the rare section of the Catalogue for a limited time at a price of 75 credits. It can be purchased until 12pm GMT (4am PDT) on January 10th. Be sure to grab one while you can, as these items will never be made available in Habbo Hotel: Origins again!</p>', 'rares_martes', 'New rare item Red Bird Bath January 2025', '<p class=\"noticia_descripcion\"><strong>A new rare item arrives at Habbo Hotel: Origins!</strong> Discover and acquire the new rare item, <strong>Red Bird Bath</strong>, available for a limited time. Don\'t miss out!</p>', 'com', '2025-01-07 12:10:47'),
(224, 'Raro añadido al Catálogo: Fontana Roja', '2025-01-07-12-11-43', 'Catalogo Fontana Roja', '<p><strong>El nuevo raro de Habbo Hotel: Orígenes: Fontana Roja!</strong></p><p>Desde hoy, se ha añadido un nuevo raro al catálogo de Habbo Hotel: Orígenes. La <strong>Fontana Roja</strong> está disponible por 75 créditos y podrá adquirirse en la sección de raros hasta el 10 de enero a las 6 am CST / 1 pm CET. No pierdas la oportunidad de obtener esta pieza única, ya que no volverá a estar disponible en el catálogo.</p>', 'rares_martes', 'nuevo raro Fontana Roja', '<p class=\"noticia_descripcion\"><strong>Un nuevo raro llega a Habbo Hotel: Orígenes!</strong> Adquiere la <strong>Fontana Roja</strong>, disponible solo hasta el 10 de enero. ¡No te lo pierdas!</p>', 'es', '2025-01-07 12:12:03'),
(225, 'Meet the .COM Origins Hobbas!', '2025-01-10-12-08-29', 'Hobbas Meet and Greet at Café Ole', '<p><strong>Exciting news from Habbo Hotel: Origins!</strong></p><p>From January 10-12, 2025, players are invited to meet the .COM Hobba team at Café Ole. This virtual gathering promises a weekend full of fun, with Hobbas stopping by to chat and answer questions about Habbo Origins. Whether you’re new to the game or a seasoned player, this event is the perfect opportunity to learn more about the Hobbas and their roles. Prepare to uncover some mysteries and enjoy a coffee-themed experience!</p>', 'staff', 'Hobbas event announcement for January 2025', '<p class=\"noticia_descripcion\"><strong>Get ready for a Hobba-tastic event!</strong> Meet the .COM Hobbas at Café Ole from January 10-12, 2025, where players can enjoy a fun-filled weekend and connect with the Hobba team!</p>', 'com', '2025-01-08 12:08:52'),
(226, 'Mood Lights Added to Origins!', '2025-01-09-13-34-06', 'Mood Lights in Origins', '<p><strong>Habbo has officially added Mood Lights to the Origins catalogue!</strong></p><p>Following a community poll conducted last week, the results revealed that 90.6% of participants voted in favor of introducing Mood Lights. Additionally, 86.6% of respondents supported the idea of implementing more lighting modes in the future. Mood Lights can now be found in the Accessories page of the Catalogue. Stay tuned for more updates regarding future functionalities related to Mood Lights, including suggestions from community members on how to enhance their capabilities.</p>', 'staff', 'Mood Lights introduction news', '<p class=\"noticia_descripcion\"><strong>Mood Lights have arrived in Habbo Origins!</strong> Check out the new Mood Lights now available in the Accessories page of the Catalogue, and look forward to more lighting modes in the future. Don\'t miss out!</p>', 'com', '2025-01-09 13:34:28'),
(227, 'Resultados de la encuesta sobre el Regulador de Luces', '2025-01-09-13-35-22', 'Resultados de la encuesta sobre Regulador de Luces en Habbo Hotel', '<p><strong>Resultados de la encuesta InfoBus sobre el Regulador de Luces.</strong></p><p>Hace una semana, Habbo Hotel: Orígenes preguntó a los usuarios si debería añadirse el Regulador de Luces al juego. Los resultados han sido contundentes: el 90.6% ha votado a favor de añadirlo, mientras que solo el 9.4% se ha opuesto. Esto representa un total de 635 votos a favor y 66 en contra. En otra pregunta, el 86.6% de los votantes también se mostró a favor de la inclusión del Regulador de Luces. Habbo ha decidido entonces agregar este nuevo elemento al juego. ¡Gracias a todos los que participaron en la encuesta!</p>', 'staff', 'Resultados de la encuesta Regulador de Luces', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel: Orígenes agrega el Regulador de Luces!</strong> La encuesta reveló un amplio apoyo con el 90.6% de los votos a favor. ¡Gracias a todos los participantes!</p>', 'es', '2025-01-09 13:35:45'),
(228, 'Concurso de Pixel Art do Papai Noel Rasta', '2025-01-10-08-58-01', 'Concurso de Pixel Art do Papai Noel Rasta', '<p><strong>Clarificações sobre o concurso de pixel art do Papai Noel Rasta!</strong></p><p>A comunidade Origens expressou frustração em relação ao concurso de pixel art, onde participantes que reutilizaram ativos ainda alcançaram posições altas. Devido a mudanças na equipe, as regras quanto à reutilização de ativos não foram seguidas de forma consistente. A equipe decidiu não reavaliar a competição nem distribuir mais prêmios, destacando que essa decisão visa manter a integridade de futuras competições.</p>', 'staff', 'Concurso de Pixel Art do Papai Noel Rasta', '<p class=\"noticia_descripcion\"><strong>Atualizações sobre o concurso de pixel art do Papai Noel Rasta!</strong> A equipe comunicou que não haverá reavaliação dos resultados e pediu compreensão da comunidade após as críticas sobre a reutilização de ativos nas entradas.</p>', 'com.br', '2025-01-10 08:58:25'),
(229, 'Moodlights, Follow a Friend, and Other Fixes!', '2023-10-17-10-24-06', 'Moodlights and Follow a Friend feature in Habbo', '<p><strong>Habbo has introduced several exciting updates including Moodlights and the ability to follow friends in public rooms!</strong></p><p>The recent update allows players to follow friends in both private and public rooms, and control whether friends can follow them. Moodlights have also been reintroduced, fulfilling players\' requests from a community poll. In addition, the Click & Drag feature in private rooms was released, albeit with plans for further refinement. Further enhancements have been made under the hood to improve game performance and user experience.</p>', 'staff', 'Updates on Moodlights and new features in Habbo', '<p class=\"noticia_descripcion\"><strong>Exciting updates arrive at Habbo!</strong> Discover the new Moodlights feature and the ability to follow friends in both private and public rooms, enhancing your Habbo experience.</p>', 'com', '2025-01-10 10:24:27'),
(230, 'Exciting News: Asian Furni Arrival for Lunar New Year!', '2024-01-10-12-59-35', 'Asian Furni Collection in Habbo Hotel', '<p><strong>Habbo Hotel: Origins is thrilled to announce a long-awaited shipment of Asian furni has arrived just in time for the Lunar New Year!</strong></p><p>This new delivery includes elegant tables, glowing lamps, stylish chairs, and a traditional Chinese Calligraphy poster. Notably, the arrival of the Dragon Screens, which come in two different wood colors, is generating buzz. Players are encouraged to check the Catalogue on specified dates for exclusive rares and Funky Friday items!</p><p>Additionally, a room-building competition is announced, challenging players to design the coziest Chinese Tea Room with exciting prizes. Participants must submit their entries by the deadline outlined in the competition rules.</p>', 'staff', 'Asian Furni Arrival for Lunar New Year', '<p class=\"noticia_descripcion\"><strong>A new shipment of Asian furni has just landed in Habbo Hotel!</strong> Make sure to explore the stunning new items available and participate in the exciting Chinese Tea Room competition for a chance to win amazing prizes!</p>', 'com', '2025-01-10 13:00:00'),
(231, '¡Recién llegado: muebles asiáticos!', '2025-01-10-13-00-52', 'Catálogo de muebles asiáticos en Habbo Hotel: Origin', '<p><strong>Habbo Hotel: Orígenes trae un nuevo envío de muebles asiáticos justo a tiempo para el Año Nuevo Lunar!</strong></p><p>Este envío, esperado por mucho tiempo, incluye una variedad de furnis como mesas elegantes, lámparas luminosas, sillas con estilo y un póster de caligrafía china tradicional. Además, destaca la llegada de las Pantallas de Dragón, disponibles en dos versiones de color. También se están organizando eventos especiales de Funky Friday y raros, junto a un emocionante concurso de construcción donde los jugadores pueden diseñar la Sala de Té China más acogedora. Los premios son generosos, incluyendo créditos y trofeos por las mejores construcciones!</p>', 'funky_friday', 'Nuevos muebles asiáticos y concurso en Habbo Hotel: Origins', '<p class=\"noticia_descripcion\"><strong>¡Nuevos muebles asiáticos han llegado a Habbo Hotel: Orígenes!</strong> La comunidad está invitada a participar en un concurso de construcción y aprovechar las sorpresas de los Funky Fridays y objetos raros. ¡No te lo pierdas!</p>', 'es', '2025-01-10 13:01:17'),
(232, '¡Recién llegado: muebles asiáticos!', '2025-01-10-13-14-53', 'Muebles asiáticos en Habbo Hotel', '<p><strong>Habbo Hotel: Orígenes ha recibido un envío muy esperado de muebles asiáticos.</strong> Este envío incluye una variedad de furnis como mesas elegantes, lámparas luminosas, sillas con estilo y un póster de caligrafía china tradicional. Entre los objetos destacados se encuentran las Pantallas de Dragón, disponibles en dos tonos de madera. No te pierdas la oportunidad de adquirir estos nuevos artículos en el Catálogo, así como participar en el concurso de construcción de una Sala de Té China con grandes premios.</p>', 'staff', 'Muebles asiáticos en Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Se han incorporado nuevos muebles asiáticos a Habbo Hotel: Orígenes.</strong> Este envío previo al Año Nuevo Lunar incluye muebles decorativos y un concurso para diseñar una Sala de Té China. ¡No te lo pierdas!</p>', 'es', '2025-01-10 13:15:17'),
(233, 'É a Funky Friday!', '2025-01-10-13-27-41', 'Catálogo Funky Friday', '<p><strong>A Habbo anunciou a Funky Friday!</strong></p><p>Além de distribuir vários itens em sua conta X/Twitter, a Habbo vai adicionar esses itens ao Catálogo por 24 horas. A Funky Friday é uma oportunidade incrível para os traders garantirem novos itens raros e aumentarem suas coleções. Não perca essa chance única!</p>', 'funky_friday', 'Funky Friday', '<p class=\"noticia_descripcion\"><strong>Chegou a Funky Friday na Habbo!</strong> Itens incríveis estarão disponíveis no catálogo por 24 horas. Aproveite para garantir os novos itens!</p>', 'com.br', '2025-01-10 13:27:57'),
(234, '¡Es Funky Friday!', '2025-01-10-13-40-18', 'Funky Friday en Habbo Hotel', '<p><strong>Habbo ha anunciado un nuevo evento: ¡Funky Friday!</strong></p><p>Desde la cuenta de X/Twitter, Habbo ha decidido celebrar esta ocasión especial regalando una gran cantidad de artículos. Además, todos estos artículos estarán disponibles en el Catálogo durante 24 horas. Esta es una excelente oportunidad para los jugadores para obtener ítems exclusivos y disfrutar de la festividad!</p>', 'funky_friday', 'Funky Friday en Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>¡Celebra el Funky Friday en Habbo Hotel!</strong> Habbo regalará diversos artículos y estarán disponibles en el Catálogo durante 24 horas. ¡No te lo pierdas!</p>', 'es', '2025-01-10 13:40:36'),
(235, 'Update on the HC: Signature Edition Project', '2025-01-10-15-34-30', 'Habbo Club: Signature Edition Announcement', '<p><strong>Habbo has announced the discontinuation of the Habbo Club: Signature Edition project.</strong></p><p>After internal discussions, the decision was made to end the project, with the team feeling this is the best course of action for the game and community at this time. While some players may be disappointed, Habbo expresses gratitude for the collaboration with CptnAlex Designs on the Origins Trax vinyl, appreciating the support and creativity involved in pitching the HC: Signature Edition project. It’s important to note that shipments of the Origins Trax vinyl will continue as planned.</p>', 'staff', 'Announcement of discontinuation of the HC: Signature Edition', '<p class=\"noticia_descripcion\"><strong>Habbo announces the end of the Habbo Club: Signature Edition project!</strong> Despite some disappointment, the decision is seen as a positive step for the community. Meanwhile, Origins Trax vinyl shipments will proceed as scheduled. Stay tuned for further updates!</p>', 'com', '2025-01-10 15:34:49'),
(236, 'Atualização sobre HC: Edição de Assinatura', '2025-01-10-15-45-59', 'Atualização sobre Habbo Club: Edição de Assinatura', '<p><strong>A equipe de Habbo anunciou a descontinuação do projeto Habbo Club: Edição de Assinatura.</strong></p><p>Após discussões internas com a CptnAlex Designs, a decisão foi tomada para o bem do jogo e da comunidade. A equipe expressou sua gratidão pela colaboração na produção do vinil Origins Trax, que continuará conforme planejado. O projeto HC: Edição de Assinatura não será mais desenvolvido.</p>', 'staff', 'Atualização sobre Habbo Club: Edição de Assinatura', '<p class=\"noticia_descripcion\"><strong>Habbo descontinua o projeto Habbo Club: Edição de Assinatura!</strong> O jogo anunciou que a colaboração com CptnAlex Designs foi encerrada, mas os envios de vinil da Origins Trax continuarão normalmente.</p>', 'com.br', '2025-01-10 15:46:18'),
(237, 'É a Funky Friday!', '2025-01-17-12-14-10', 'Catálogo Funky Friday', '<p><strong>A Funky Friday chegou ao Habbo Hotel!</strong></p><p>No dia 8 de agosto de 2024, a Habbo anunciou a distribuição de diversos itens especiais em sua conta X/Twitter. Além disso, estes itens serão adicionados ao Catálogo por um período de 24 horas. Não perca a chance de adquirir essas novidades divertidas para o seu inventário!</p>', 'funky_friday', 'Funky Friday 08 de agosto de 2024', '<p class=\"noticia_descripcion\"><strong>Funky Friday está aqui!</strong> Confira e adquira itens especiais disponíveis apenas por 24 horas. Não fique de fora!</p>', 'com.br', '2025-01-17 12:14:28'),
(238, '¡Es Funky Friday!', '2025-01-17-12-16-40', 'Catálogo Funky Friday', '<p><strong>¡Es Funky Friday en Habbo Hotel!</strong></p><p>Hoy, Habbo Hotel celebra el Funky Friday, donde se están regalando una serie de artículos a través de su cuenta de X/Twitter, y además, estos mismos artículos estarán disponibles en el Catálogo durante 24 horas. No te pierdas la oportunidad de obtener estos fabulosos regalos que llegarán para alegrar el día de los traders.</p>', 'funky_friday', 'noticia Funky Friday', '<p class=\"noticia_descripcion\"><strong>Funky Friday en Habbo Hotel!</strong> Este día especial, Habbo lanza una serie de artículos en el Catálogo que estarán disponibles por 24 horas. ¡No dejen pasar la oportunidad de conseguir estos regalos!</p>', 'es', '2025-01-17 12:16:59'),
(239, 'Enquete InfoBus: Mobis de Dia dos Namorados', '2025-01-17-16-27-02', 'Catálogo Mobis de Dia dos Namorados', '<p><strong>Vem aí o Dia dos Namorados no Habbo Hotel: Origens!</strong></p><p>Na primeira metade de fevereiro de 2024, Habbo Hotel: Origens irá celebrar o Dia dos Namorados e a comunidade terá a oportunidade de votar em dois novos lotes de mobis: <strong>Romantique (rosa)</strong> e <strong>Iced (rosa e azul)</strong>. A votação acontecerá na sala pública InfoBus no dia 20 de fevereiro, após as 9h BRT / 12h PT. Lembre-se: apenas membros do Habbo Club poderão votar. A enquete se encerrará no dia 27 de fevereiro, às 9h BRT / 12h PT. Se aprovados, os mobis serão lançados no dia 03 de fevereiro.</p>', 'staff', 'Enquete de Mobis para o Dia dos Namorados', '<p class=\"noticia_descripcion\"><strong>O Dia dos Namorados está chegando ao Habbo Hotel: Origens!</strong> Participe da votação para decidir sobre novos mobis para o catálogo. Vote na sala InfoBus e ajude a escolher entre <strong>Romantique</strong> e <strong>Iced</strong>.</p>', 'com.br', '2025-01-17 16:27:23'),
(240, 'Valentines Furni Incoming Poll!', '2025-01-17-16-28-16', 'Valentines Furni Items', '<p><strong>Habbo Hotel: Origins is celebrating Valentine\'s Day!</strong></p><p>From the first half of next month, the community is invited to vote on new furni to be added to the Catalogue alongside the original items. Players can approve or reject two sets of furni: Romantique (pink) and Iced (pink and blue). The voting is open from 20/02 at 12pm GMT until 27/02. If the items are voted for, they will be released on 03/02.</p>', 'staff', 'Valentines Furni Poll Announcement', '<p class=\"noticia_descripcion\"><strong>Exciting poll for Valentines furni in Habbo Hotel: Origins!</strong> Players can vote for the new furni on February 20th. Don\'t miss the chance to influence the Catalogue!</p>', 'com', '2025-01-17 16:28:35'),
(241, 'Encuesta InfoBus: furnis por San Valentín', '2025-01-17-16-29-31', 'Catálogo de furnis por San Valentín', '<p><strong>Durante la primera mitad del próximo mes, Habbo Hotel: Orígenes celebra San Valentín.</strong></p><p>La comunidad tendrá la oportunidad de decidir qué objetos se añadirán al Catálogo. Se presentarán dos líneas de furnis: <strong>Romántica</strong> (rosa) y <strong>Norja</strong> (rosa y azul). La votación se llevará a cabo el lunes 20 de febrero desde las 6:00 a.m. CST / 1:00 p.m. CET, en la sala pública InfoBus.</p><p>Es importante recordar que solo los miembros del Habbo Club podrán votar. La encuesta se cerrará el 27 de febrero a las 6:00 a.m. CST / 1:00 p.m. CET. Los furnis por San Valentín están programados para lanzarse el 3 de febrero, si son aprobados por la comunidad.</p>', 'staff', 'Encuesta para furnis de San Valentín', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel: Orígenes celebra San Valentín con una encuesta.</strong> Los usuarios podrán votar por nuevas líneas de furnis: <strong>Romántica</strong> y <strong>Norja</strong>. Recuerda que la votación es solo para miembros del Habbo Club.</p>', 'es', '2025-01-17 16:30:00'),
(242, 'Atividade surpresa com Cayde-6!', '2025-01-20-16-36-01', 'Atividade surpresa Cayde-6', '<p><strong>Prepare-se para uma atividade surpresa com Cayde-6!</strong></p><p>No dia 21 de janeiro, às 12h BR / 15h PT, e no dia 22 de janeiro, às 11h BR / 14h PT, os jogadores são convidados a participar de um evento divertido no Boom Game. A sala de Cayde-6 estará à espera de todos, onde é possível participar e concorrer a prêmios incríveis!</p>', 'staff', 'atividade surpresa com Cayde-6', '<p class=\"noticia_descripcion\"><strong>Surpresa a caminho!</strong> Participe de uma atividade com Cayde-6 nos dias 21 e 22 de janeiro no Boom Game. Venha se divertir e concorra a prêmios!</p>', 'com.br', '2025-01-20 16:36:23'),
(243, '¡Actividad sorpresa con Aleksander!', '2025-01-21-11-56-14', 'Actividad sorpresa con Aleksander', '<p><strong>¡Aleksander tiene una actividad sorpresa para ti!</strong></p><p>No te pierdas la oportunidad de divertirte en un evento especial. Se llevará a cabo mañana, 22 de enero y el 23 de enero a las 8 am CST / 3 pm CEST. La actividad se realizará en la sala Trap Doors, propiedad de Aleksander. ¡Además, podrás ganar algunos premios!</p>', 'staff', 'Actividad sorpresa con Aleksander en Trap Doors', '<p class=\"noticia_descripcion\"><strong>¡Prepárate para la actividad sorpresa de Aleksander!</strong> Únete a esta emocionante experiencia en Trap Doors el 22 y 23 de enero. ¡Diviértete y gana premios!</p>', 'es', '2025-01-21 11:56:39'),
(244, 'Item Raro disponível! Toldo Amarelo', '2025-01-22-09-06-26', 'Catálogo Toldo Amarelo', '<p><strong>O novo item raro de Habbo Hotel: Origens: Toldo Amarelo!</strong></p><p>Um Toldo Amarelo foi adicionado ao catálogo e estará disponível por um tempo limitado. Ele custa <strong>45 créditos</strong> e pode ser adquirido na seção de Raros até às <strong>9h BR / 12h PT</strong> do dia <strong>28/01</strong>. Este item não será lançado novamente, então aproveitem enquanto têm a chance de garantir este item exclusivo para suas coleções!</p>', 'rares_martes', 'novo item raro Toldo Amarelo disponível até 28 de janeiro', '<p class=\"noticia_descripcion\"><strong>Um novo item raro chegou a Habbo Hotel: Origens!</strong> O <strong>Toldo Amarelo</strong> pode ser adquirido por 45 créditos, disponível por tempo limitado. Aproveitem antes que acabe!</p>', 'com.br', '2025-01-22 09:06:45'),
(245, 'New Rare Available! Yellow Marquee', '2025-01-22-09-07-38', 'Catalogue Yellow Marquee', '<p><strong>The new rare item in Habbo Hotel: Origins: Yellow Marquee!</strong></p><p>Starting from 28th January 2025 at 12pm GMT (4am PDT), the <strong>Yellow Marquee</strong> can be purchased from the rare section of the Catalogue for 45 credits. This item will never be released again in Habbo Hotel: Origins, so traders should seize the opportunity to add this unique piece to their collection!</p>', 'rares_martes', 'new rare January 28, 2025', '<p class=\"noticia_descripcion\"><strong>A new rare arrives at Habbo Hotel: Origins!</strong> Discover and acquire the new rare, <strong>Yellow Marquee</strong>, available for a limited time. Don\'t miss out!</p>', 'com', '2025-01-22 09:07:55'),
(246, 'Raro añadido al Catálogo: Toldo Amarillo', '2025-01-22-09-08-50', 'Catalogo Toldo Amarillo', '<p><strong>La última adición al catálogo de Habbo Hotel: Orígenes: Toldo Amarillo!</strong></p><p>Desde el 22 de enero de 2025, se encuentra disponible un nuevo raro en Habbo: el <strong>Toldo Amarillo</strong>. Este exclusivo objeto puede ser adquirido por 45 créditos y estará en la sección de raros del catálogo hasta el 28 de enero a las 6am CST / 1pm CET. ¡Aprovecha esta oportunidad, ya que estas piezas no volverán a estar disponibles!</p>', 'rares_martes', 'nuevo raro Toldo Amarillo en el catálogo', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Adquiere el <strong>Toldo Amarillo</strong>, disponible por 45 créditos hasta el 28 de enero. ¡No te lo pierdas!</p>', 'es', '2025-01-22 09:09:10'),
(247, 'Chinese Zodiac Art Competition', '2025-01-23-13-24-17', 'Chinese Zodiac Art Competition', '<p><strong>Announcing the Chinese Zodiac art competition in Habbo Hotel: Origins!</strong></p><p>Habbo invites all creative users to participate in a unique art competition where contestants are asked to create a large picture of their favorite Chinese Zodiac animal using smaller images of furni available in the game. Participants can submit their artwork digitally or physically, provided that it captures one of the twelve Zodiac animals solely through existing Habbo Hotel: Origins furni. The competition will reward the top five entries with credits and a special badge for the top twenty.</p>', 'staff', 'Chinese Zodiac Art Competition announcement', '<p class=\"noticia_descripcion\"><strong>Join the Chinese Zodiac art competition in Habbo Hotel: Origins!</strong> Create a mosaic of your favorite Zodiac animal using available furni and stand a chance to win exciting prizes. Don’t miss out!</p>', 'com', '2025-01-23 13:24:42'),
(248, 'É a Funky Friday!', '2025-01-24-12-23-55', 'Catálogo Funky Friday', '<p><strong>Funky Friday está aqui!</strong></p><p>A partir de hoje, a Habbo Hotel está lançando a Funky Friday, um evento emocionante que irá distribuir vários itens pela conta X/Twitter. Esses itens também estarão disponíveis no Catálogo por 24 horas! Não perca a chance de adicionar esses itens incríveis à sua coleção!</p>', 'funky_friday', 'promoção Funky Friday', '<p class=\"noticia_descripcion\"><strong>Funky Friday chegou ao Habbo Hotel!</strong> Descubra e adquira itens especiais durante a Funky Friday, disponíveis apenas por 24 horas. Não fique de fora!</p>', 'com.br', '2025-01-24 12:24:13'),
(249, 'It’s FUNKY FRIDAY!', '2025-01-24-12-25-06', 'Funky Friday event items', '<p><strong>It\'s FUNKY FRIDAY in Habbo Hotel!</strong></p><p>As part of today\'s celebration, Habbo is giving away several exciting items on their X/Twitter account. Additionally, these items will be available in the Catalogue for a limited time of 24 hours. Traders are encouraged to participate and snag these fun items while they last!</p>', 'funky_friday', 'Funky Friday event announcement', '<p class=\"noticia_descripcion\"><strong>Exciting news from Habbo Hotel!</strong> It’s FUNKY FRIDAY, where new items are available for free giveaways and will also be added to the Catalogue for 24 hours. Don’t miss out!</p>', 'com', '2025-01-24 12:25:24'),
(250, '¡Es Funky Friday!', '2025-01-24-12-26-19', 'Evento Funky Friday', '<p><strong>¡Hoy es Funky Friday en Habbo Hotel!</strong></p><p>Al mismo tiempo que se regalan un montón de artículos a través de la cuenta de X/Twitter, Habbo también pondrá estos artículos en el Catálogo durante 24 horas. Esta es una oportunidad única para conseguir artículos especiales y exclusivos que estarán disponibles por tiempo limitado. No te pierdas la oportunidad de participar en este evento emocionante y obtener tus artículos favoritos.</p>', 'funky_friday', 'Evento especial Funky Friday', '<p class=\"noticia_descripcion\"><strong>¡Funky Friday ha llegado a Habbo Hotel!</strong> Participa en el evento y obtén artículos exclusivos que estarán disponibles durante 24 horas. ¡Aprovecha esta oportunidad única!</p>', 'es', '2025-01-24 12:26:42'),
(251, 'Pesquisa Anual Habbo Hotel: Origins', '2025-01-25-18-30-36', 'Pesquisa Anual Habbo Hotel: Origins', '<p><strong>A Habbo Hotel: Origins está abordando as primeiras etapas de 2025 com uma pesquisa anual!</strong></p><p>A equipe do Habbo Hotel está ansiosa para receber feedback da comunidade sobre o que gostaria de ver no jogo. O feedback é fundamental para aprimorar o jogo e várias perguntas foram elaboradas para ajudar a moldar o futuro do Habbo Hotel: Origins. A participação da comunidade é muito valorizada e ajuda a melhorar a experiência no jogo.</p>', 'staff', 'pesquisa anual Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel: Origins realiza Pesquisa Anual!</strong> A comunidade é convidada a compartilhar opiniões e sugestões sobre recursos e melhorias para o ano. O feedback é essencial para o desenvolvimento futuro do jogo.</p>', 'com.br', '2025-01-25 18:30:54'),
(252, 'Habbo Hotel: Origins Annual Survey', '2025-01-25-18-31-49', 'Habbo Hotel: Origins Survey', '<p><strong>Habbo Hotel: Origins is seeking community feedback!</strong></p><p>As 2025 unfolds, Habbo Hotel is eager to collect valuable insights from the community regarding Habbo Hotel: Origins. The team is particularly interested in hearing what features and improvements players would like to see introduced this year. Participation in the survey is crucial, and all feedback is appreciated as it will help shape the future of the game. Players can fill out the survey form provided by Habbo.</p>', 'staff', 'Habbo Hotel: Origins Annual Survey', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel: Origins wants your feedback!</strong> Share your thoughts on upcoming features and improvements in the annual survey. Your input matters!</p>', 'com', '2025-01-25 18:32:07'),
(253, 'Encuesta Anual sobre Habbo Hotel: Origins', '2025-01-25-18-33-00', 'Encuesta Habbo Hotel', '<p><strong>Habbo Hotel: Origins solicita feedback a su comunidad.</strong></p><p>A medida que se adentran en las primeras etapas de 2025, Habbo Hotel: Origins invita a los jugadores a participar en una encuesta anual para recopilar opiniones sobre características y mejoras que les gustaría ver este año. Esta retroalimentación es crucial para dar forma al futuro del juego.</p>', 'staff', 'Encuesta sobre Habbo Hotel: Origins', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel: Origins busca tu opinión!</strong> Participa en la encuesta anual y comparte tus sugerencias sobre las futuras características y mejoras del juego. ¡Tu voz cuenta!</p>', 'es', '2025-01-25 18:33:23'),
(254, 'Atividade surpresa com Cayde-6!', '2025-01-27-10-26-10', 'Atividade com Cayde-6 no Habbo Hotel', '<p><strong>A nova atividade surpresa chegou ao Habbo Hotel!</strong></p><p>Nos dias 29 e 30 de janeiro de 2024, os jogadores são convidados a se juntar a Cayde-6 para uma mistura de diversão e boas chances de ganhar prêmios. A atividade será realizada no Delivery, e os participantes devem procurar pela sala do Cayde-6. Não perca essa oportunidade única de se divertir e ganhar recompensas!</p>', 'staff', 'Atividade surpresa com prêmios no Habbo', '<p class=\"noticia_descripcion\"><strong>Participe da atividade surpresa com Cayde-6!</strong> Junte-se à diversão e tenha a chance de ganhar prêmios nos dias 29 e 30 de janeiro no Habbo Hotel.</p>', 'com.br', '2025-01-27 10:26:33'),
(255, '¡Actividad sorpresa con Aleksander!', '2025-01-27-16-18-16', 'Actividad sorpresa con Aleksander', '<p><strong>¡No te pierdas la actividad sorpresa con Aleksander!</strong></p><p>El 29 y 30 de enero de 2024, a las 8 am CST / 3 pm CEST, se llevará a cabo una divertida actividad en la sala propiedad de Aleksander. ¡Ven a disfrutar y podrías ganar algún premio! La comunidad también se une a la diversión gracias al usuario Ryco, quien ofrecerá su juego para entretener a todos los participantes. No olvides buscar la sala de Delivery Asian.</p>', 'staff', 'Actividad sorpresa Aleksander 29 y 30 de enero del 2024', '<p class=\"noticia_descripcion\"><strong>Actividad sorpresa con Aleksander!</strong> Este 29 y 30 de enero, a las 8 am CST / 3 pm CEST, participa en una divertida sesión y gana premios. ¡No te lo pierdas!</p>', 'es', '2025-01-27 16:18:39'),
(256, '¡Actividades de la semana con Aleksander!', '2025-01-28-07-58-24', 'Actividad sorpresa con Aleksander', '<p><strong>¡No te pierdas las divertidas actividades de esta semana!</strong></p><p>Ven a unirte a Aleksander en una emocionante actividad sorpresa que se llevará a cabo el 29 y 30 de enero a las 8:00 AM MX / 3:00 PM ES. Además, tendrás la oportunidad de ganar premios. La actividad tendrá lugar en Delivery, busca la sala propiedad de Aleksander. Esta es una colaboración con los usuarios Ryco y Jaguar del Hotel BR, quienes han ofrecido su juego para disfrutar y repartir premios. ¡Mantente atento a las reglas y cómo participar!</p>', 'staff', 'Actividades semanales con Aleksander', '<p class=\"noticia_descripcion\"><strong>Únete a las actividades de la semana con Aleksander!</strong> Participa el 29 y 30 de enero en una actividad sorpresa y gana premios. ¡No te lo pierdas!</p>', 'es', '2025-01-28 07:58:48');
INSERT INTO `noticias` (`id`, `titulo`, `imagen_completa`, `alt_imagen_completa`, `descripcion_completa`, `imagen_resumida`, `alt_imagen_resumida`, `descripcion_resumida`, `hotel`, `fecha_noticia`) VALUES
(257, 'New Rare Available! Fire Dragon Lamp', '2025-01-28-13-46-51', 'Fire Dragon Lamp in Catalogue', '<p><strong>The new rare item in Habbo Hotel: Origins: Fire Dragon Lamp!</strong></p><p>On January 30, 2024, a new rare item, the <strong>Fire Dragon Lamp</strong>, will be available in the rare section of the Habbo Hotel: Origins catalogue for a limited time at a price of 75 credits. This rare item will only be available until 12pm GMT (4am PDT) and will never be released again. Make sure to get it while you can!</p>', 'rares_martes', 'new rare Fire Dragon Lamp January 30, 2024', '<p class=\"noticia_descripcion\"><strong>A new rare arrives at Habbo Hotel: Origins!</strong> Discover and acquire the new rare, <strong>Fire Dragon Lamp</strong>, available for a limited time. Don\'t miss out!</p>', 'com', '2025-01-28 13:47:13'),
(258, 'Raro añadido al Catálogo: Dragón de Fuego', '2025-01-28-13-48-05', 'Catalogo Dragón de Fuego', '<p><strong>Se ha añadido un nuevo raro al Catálogo de Habbo Hotel: Orígenes: Dragón de Fuego!</strong></p><p>Este magnífico Dragón de Fuego estará disponible en la sección de raros del catálogo por el precio de 75 créditos hasta el 30 de enero a las 6am CST / 1pm CET. Los jugadores tienen la oportunidad de adquirir esta pieza única, ya que no volverá a estar disponible. ¡No pierdas la oportunidad de ampliar tu colección con este increíble raro!</p>', 'rares_martes', 'nuevo raro Dragón de Fuego', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el nuevo raro, <strong>Dragón de Fuego</strong>, disponible hasta el 30 de enero. ¡No te lo pierdas!</p>', 'es', '2025-01-28 13:48:25'),
(259, 'Item Raro disponível! Lâmpada do Dragão de Fogo', '2025-01-28-13-59-36', 'Catálogo Lâmpada do Dragão de Fogo', '<p><strong>O novo item raro em Habbo Hotel: Origens: Lâmpada do Dragão de Fogo!</strong></p><p>A partir de agora, a <strong>Lâmpada do Dragão de Fogo</strong> está disponível no catálogo por 75 créditos. Este item raro pode ser adquirido na seção de Raros até às 9h BR / 12h PT do dia 30/01. Não perca a oportunidade de garantir esse item exclusivo, pois ele não será relançado novamente!</p>', 'rares_martes', 'novo raro Lâmpada do Dragão de Fogo disponível até 30 de janeiro', '<p class=\"noticia_descripcion\"><strong>Chega um novo raro ao Habbo Hotel: Origens!</strong> Conheça e adquira o novo raro, <strong>Lâmpada do Dragão de Fogo</strong>, disponível por tempo limitado. Não fique de fora!</p>', 'com.br', '2025-01-28 13:59:56'),
(260, 'Habbo Hotel: Origens – o futuro', '2025-01-30-12-23-59', 'Atualizações de Habbo Hotel: Origens', '<p class=\"noticia_descripcion\"><strong>Descubra as novas atualizações planejadas para Habbo Hotel: Origens!</strong></p><p>Habbo anunciou várias melhorias para o Origens, buscando aumentar a retenção de jogadores e oferecer uma experiência mais envolvente. Entre os recursos que estão por vir estão uma nova moeda que pode ser ganha, tarefas diárias, estandes de informações personalizáveis, novas opções de roupas, um livro de adesivos, mais layouts de quartos e temporadas de jogos automatizadas. O objetivo é manter a essência do jogo enquanto se adapta às necessidades dos novos e antigos jogadores, proporcionando uma sensação de progresso e engajamento.</p>', 'staff', 'Atualizações de Habbo Hotel: Origens 2025', '<p class=\"noticia_descripcion\"><strong>Novas atualizações estão a caminho para Habbo Hotel: Origens!</strong> O Habbo anunciou melhorias que incluem uma nova moeda, tarefas diárias, personalização de estandes, novas roupas e muito mais. Fique atento para mais detalhes!</p>', 'com.br', '2025-01-30 12:24:30'),
(261, 'É a Funky Friday!', '2025-01-31-12-14-55', 'Catálogo Funky Friday', '<p><strong>A novidade da Habbo Hotel: É a Funky Friday!</strong></p><p>No evento especial da Funky Friday, a Habbo anunciou que vários itens serão distribuídos em sua conta X/Twitter e estarão disponíveis no Catálogo por 24 horas. Esta é uma ocasião imperdível para reunir alguns dos itens mais desejados! Não deixe de conferir a conta oficial e garantir suas aquisições durante este evento exclusivo.</p>', 'funky_friday', 'evento Funky Friday na Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Funky Friday chegou ao Habbo Hotel!</strong> Vários itens disponíveis por 24 horas no Catálogo. Não perca esta oportunidade!</p>', 'com.br', '2025-01-31 12:15:14'),
(262, 'It\'s FUNKY FRIDAY!', '2025-01-31-12-16-06', 'Funky Friday Celebration', '<p><strong>Today is FUNKY FRIDAY!</strong></p><p>Habbo has announced a fun event where a variety of exciting items will be given away through their X/Twitter account. Additionally, these items will be added to the Catalogue for a limited time of 24 hours! Traders are encouraged to participate and take advantage of this unique offer.</p>', 'funky_friday', 'Funky Friday Event Announcement', '<p class=\"noticia_descripcion\"><strong>Funky Friday has arrived!</strong> Traders can check out the exciting giveaway of items on the X/Twitter account and can also find them in the Catalogue for 24 hours. Don\'t miss out!</p>', 'com', '2025-01-31 12:16:25'),
(263, '¡Es Funky Friday!', '2025-01-31-12-17-20', 'Catálogo Funky Friday', '<p><strong>¡Es Funky Friday en Habbo Hotel!</strong></p><p>Desde la cuenta de X/Twitter, Habbo ha anunciado que estará regalando una gran cantidad de objetos durante 24 horas. Además, estos artículos estarán disponibles en el Catálogo durante el mismo período. Este evento promete ser emocionante, así que no te pierdas la oportunidad de conseguir estos increíbles regalos.</p>', 'funky_friday', 'evento Funky Friday en Habbo', '<p class=\"noticia_descripcion\"><strong>¡Funky Friday llegó a Habbo Hotel!</strong> En este evento, Habbo regalará una variedad de objetos y los pondrá en el Catálogo por solo 24 horas. ¡Aprovecha esta oportunidad única!</p>', 'es', '2025-01-31 12:17:40'),
(264, 'Resultados de la encuesta sobre furnis de San Valentín', '2025-01-31-16-27-24', 'Resultados de la encuesta de San Valentín', '<p><strong>Habbo ha realizado una consulta sobre la aceptación de nuevos furnis de San Valentín en Habbo Hotel: Orígenes.</strong></p><p>A principios de mes, la comunidad votó sobre varias propuestas. Las piezas rosas de la línea Romántica obtuvieron un gran apoyo, con un 81,3% de votos a favor. Por otro lado, las piezas rosa y azul de la línea Iced también fueron aprobadas, aunque con un 72% de aceptación. Estos resultados muestran el interés de la comunidad en añadir nuevos furnis. ¡Habbo espera ver cómo los usuarios utilizan estas nuevas piezas!</p>', 'staff', 'Resultados de la encuesta sobre furnis de San Valentín', '<p class=\"noticia_descripcion\"><strong>Habbo ha compartido los resultados de la encuesta sobre nuevos furnis de San Valentín.</strong> Las piezas de la línea Romántica y de la línea Iced han sido aprobadas por la comunidad. ¡Grandes novedades están por venir!</p>', 'es', '2025-01-31 16:27:50'),
(265, 'Resultados da pesquisa InfoBus sobre os mobis do Dia dos Namorados', '2025-01-31-16-39-04', 'Resultados da pesquisa InfoBus sobre os mobis do Dia dos Namorados', '<p><strong>A pesquisa InfoBus revelou os resultados sobre a adição de novos mobis para o Dia dos Namorados no Habbo Hotel: Origins!</strong></p><p>No início deste mês, a comunidade foi convidada a votar a favor ou contra a inclusão de móveis específicos. A Pink Romantique recebeu impressionantes 81,3% de votos positivos, enquanto os mobis Iced rosa e azul obtiveram 72% de aprovação, demonstrando o entusiasmo dos jogadores. A equipe do Habbo aguarda ansiosamente para ver as criações da comunidade no X e no Discord!</p>', 'staff', 'Resultados da pesquisa InfoBus sobre os mobis do Dia dos Namorados', '<p class=\"noticia_descripcion\"><strong>Novos mobis do Dia dos Namorados no Habbo Hotel: Origins!</strong> Os resultados da pesquisa mostram que a comunidade aprovou a adição da Pink Romantique e dos mobis Iced rosa e azul. Não perca a oportunidade de usar esses novos itens em suas construções!</p>', 'com.br', '2025-01-31 16:39:29'),
(266, 'Valentines furni InfoBus poll results', '2025-01-31-16-40-19', 'Valentines furni proposals', '<p><strong>Habbo has released the results of the recent InfoBus poll regarding the addition of specific Valentines furni to Habbo Hotel: Origins.</strong></p><p>The community overwhelmingly approved the pink Romantique furni with 81.3% YES votes. The pink and blue Iced furni received a more modest approval at 72%, but still passed. The pink Romantique items will be launched on February 3rd and removed from the Catalogue on February 17th, while the Iced furni will be added on February 17th and removed on March 3rd.</p>', 'staff', 'Valentines furni poll results', '<p class=\"noticia_descripcion\"><strong>Habbo has confirmed the addition of new Valentines furni!</strong> The community approved the pink Romantique and pink and blue Iced furni, set to launch soon. Don\'t miss these new additions!</p>', 'com', '2025-01-31 16:40:44'),
(267, '¡Actividades de la semana con Aleksander!', '2025-02-03-10-10-17', 'Actividades de la semana con Aleksander', '<p><strong>¡No te pierdas las emocionantes actividades de esta semana junto a Aleksander!</strong></p><p>El 5 y 6 de febrero de 2024, únete a un entretenido juego a las 8hs en México y 15hs en España. Participa y tendrás la oportunidad de ganar emocionantes premios. Recuerda buscar la sala propiedad de Aleksander para unirte a la diversión. ¡Todos están invitados!</p>', 'staff', 'Actividades de la semana con Aleksander', '<p class=\"noticia_descripcion\"><strong>¡Únete a las actividades de la semana junto a Aleksander!</strong> Participa en juegos el 5 y 6 de febrero por la mañana y gana premios. ¡No faltes!</p>', 'es', '2025-02-03 10:10:41'),
(268, 'Dia dos Namorados no Habbo Hotel: Origins!', '2025-02-03-16-04-11', 'Catálogo Dia dos Namorados', '<p><strong>O Dia dos Namorados chegou ao Habbo Hotel: Orígenes!</strong></p><p>Neste mês especial, Habbo trouxe novas adições ao catálogo, incluindo móveis temáticos de Dia dos Namorados. Além disso, os jogadores poderão participar de um jogo de caça ao tesouro, competições de construção e mixagem, e muito mais! Eventos ao vivo também estão programados para manter a comunidade animada e envolvida.</p>', 'staff', 'Notícias do Dia dos Namorados no Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>O Dia dos Namorados chegou ao Habbo Hotel: Orígenes!</strong> Explore novas adições ao catálogo e participe de jogos e competições temáticas. Fique atento!</p>', 'com.br', '2025-02-03 16:04:42'),
(269, 'Atividades da semana com Cayde-6!', '2025-02-03-16-05-29', 'Cayde-6 se divertindo com os jogadores', '<p><strong>Venha se divertir com Cayde-6 em um jogo especial!</strong></p><p>Nos dias 04 e 05 de fevereiro de 2025, os jogadores terão a oportunidade de se juntar a Cayde-6 para uma atividade interativa que promete prêmios emocionantes. No dia 04, a atividade acontece às 12h BR / 15h PT e no dia 05, às 11h BR / 14h PT. Para participar, basta procurar pela sala do Cayde-6 em Delivery. Não perca essa chance de diversão e recompensas!</p>', 'staff', 'Atividades da semana com Cayde-6', '<p class=\"noticia_descripcion\"><strong>Participe das atividades da semana com Cayde-6!</strong> Junte-se aos jogos nos dias 04 e 05 de fevereiro e tenha a chance de ganhar prêmios. Não fique de fora!</p>', 'com.br', '2025-02-03 16:05:51'),
(270, 'Valentines in Habbo Hotel: Origins!', '2025-02-03-16-06-42', 'Valentines event in Habbo Hotel', '<p><strong>This month, Habbo Hotel brings excitement with the Valentine\'s Day celebrations!</strong></p><p>After gathering player preferences through an InfoBus poll, the hotel has added delightful new Valentine\'s furniture to the Catalogue. In addition, players can look forward to a special Valentine\'s hunt game that promises a new badge, as well as a Valentine\'s-themed room building competition. Trax CDs with a Valentine\'s twist have also been introduced, alongside a fresh Trax Mixdown competition. To top it off, live events featuring staff, including games and social gatherings, are on the agenda this month.</p>', 'staff', 'Valentines event activities in Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>A new Valentine\'s celebration is happening in Habbo Hotel: Origins!</strong> Players can engage in a Valentine\'s hunt, join a room building contest, and attend various live events. Don\'t miss out on this festive month!</p>', 'com', '2025-02-03 16:07:07'),
(271, '¡San Valentín en Habbo Hotel: Origins!', '2025-02-03-16-07-59', 'Catálogo San Valentín', '<p><strong>¡La celebración de San Valentín ha llegado a Habbo Hotel: Orígenes!</strong></p><p>Tras atender a las preferencias de los usuarios en la encuesta InfoBus del mes anterior, Habbo ha añadido nuevos y adorables furnis al Catálogo. Además, los jugadores podrán disfrutar de un juego especial de búsqueda del tesoro por San Valentín, participar en un concurso de construcción de salas y adquirir CDs Trax de temática romántica. Habrá también un nuevo concurso Mezcla Trax con sorpresas. Para completar la experiencia, el equipo Staff estará llevando a cabo eventos en vivo que incluirán juegos y un evento social, asegurando que todos los Habbos tengan una celebración inolvidable.</p>', 'staff', 'Eventos de San Valentín en Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>¡Celebraciones de San Valentín en Habbo Hotel: Orígenes!</strong> Habbo lanza nuevos furnis, un juego de búsqueda del tesoro y concursos para celebrar el amor. ¡No te lo pierdas!</p>', 'es', '2025-02-03 16:08:29'),
(272, 'Dia dos Namorados no Habbo Hotel: Origins!', '2025-02-03-16-19-42', 'Celebra o Dia dos Namorados no Habbo Hotel', '<p><strong>O Dia dos Namorados chegou ao Habbo Hotel: Origins!</strong></p><p>Após escutar as preferências da comunidade em uma enquete anterior, Habbo adicionou novos móveis ao Catálogo pelo Dia dos Namorados. Além disso, acontecem várias atividades, incluindo um jogo de caça ao tesouro com um novo distintivo, uma competição de construção de quartos, CDs Trax temáticos, e eventos ao vivo com a equipe. Não perca as novidades e divirta-se!</p>', 'staff', 'Dia dos Namorados no Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Chegou o Dia dos Namorados no Habbo Hotel: Origins!</strong> Participe das diversas atividades e descubra os novos móveis especiais. Excitantes eventos aguardam os Habbos!</p>', 'com.br', '2025-02-03 16:20:12'),
(273, 'Valentines in Habbo Hotel: Origins!', '2025-02-03-16-21-00', 'Valentines event in Habbo Hotel', '<p><strong>Valentines has finally arrived in Habbo Hotel: Origins!</strong></p><p>After gathering insights from the InfoBus poll last month, Habbo has unveiled an array of charming new Valentines furni in the Catalogue. In addition to this, the month is packed with exciting events: a special Valentines hunt game featuring a new badge, a Valentines-themed room building competition, new Valentines Trax CDs, a Valentines-themed Trax Mixdown competition with a twist, and live events hosted by staff, including games and socializing sessions.</p>', 'staff', 'Valentines events in Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>A special Valentines celebration is on in Habbo Hotel: Origins!</strong> Discover the new events and updates, including a Valentines hunt game, room competitions, and live events. Don\'t miss out!</p>', 'com', '2025-02-03 16:21:25'),
(274, 'New Rare Available! Holiday Romance', '2025-02-04-12-25-26', 'Catalog Holiday Romance', '<p><strong>The new rare in Habbo Hotel: Origins: Holiday Romance!</strong></p><p>Starting on November 2, 2023, a new rare item called <strong>Holiday Romance</strong> will be available in the rare section of the Catalogue for 40 credits. This item will only be available until 12pm GMT (4am PDT). Once the time expires, it will never be released in Habbo Hotel: Origins again! Don’t miss your chance to add this unique piece to your collection!</p>', 'rares_martes', 'new rare November 2, 2023', '<p class=\"noticia_descripcion\"><strong>A new rare arrives in Habbo Hotel: Origins!</strong> Discover and acquire the new rare, <strong>RARE Holiday Romance</strong>, available for a limited time. Don\'t miss out!</p>', 'com', '2025-02-04 12:25:47'),
(275, 'Raro añadido al Catálogo: Romance de Vacaciones', '2025-02-04-12-26-41', 'Catalogo Romance de Vacaciones', '<p><strong>Un nuevo raro de Habbo Hotel: Orígenes ha sido añadido al catálogo: Romance de Vacaciones!</strong></p><p>Este exclusivo Raro tiene un costo de 40 créditos y estará disponible en la sección de raros del Catálogo hasta el 11 de febrero a las 6 am CST / 1 pm CET. Es importante que los usuarios adquieran su pieza mientras esté disponible, ya que no volverá a salir en Habbo Hotel: Orígenes.</p>', 'rares_martes', 'nuevo raro Romance de Vacaciones', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Adquiere el nuevo Raro, <strong>Romance de Vacaciones</strong>, disponible hasta el 11 de febrero. ¡No te lo pierdas!</p>', 'es', '2025-02-04 12:27:02'),
(276, 'Item Raro adicionado ao catálogo: Amor de verão', '2025-02-04-12-38-16', 'Catálogo Amor de verão', '<p><strong>O novo raro de Habbo Hotel: Origens: Amor de verão!</strong></p><p>Um Amor de verão custa 40 créditos e estará disponível na seção de Raros do Catálogo até às 9h BR / 12h PT do dia 11/02. Garanta o seu enquanto há tempo, eles não serão lançados novamente no Habbo Hotel: Origens!</p>', 'rares_martes', 'novo raro Amor de verão', '<p class=\"noticia_descripcion\"><strong>Llega um novo raro a Habbo Hotel: Orígenes!</strong> Descubra e adquira o novo raro, <strong>RARO Amor de verão</strong>, disponível até o dia 11/02. Não perca a oportunidade!</p>', 'com.br', '2025-02-04 12:38:42'),
(277, 'January Updates for Habbo Hotel: Origins Game Client', '2025-02-06-11-05-48', 'January Update Overview for Habbo Hotel: Origins', '<p><strong>Habbo Hotel: Origins has released several updates to enhance user experience in January!</strong></p><p>The Navigator has received notable improvements, increasing the visibility of Public Rooms based on community feedback. The Chat History window now records more messages, includes text wrapping, and offers new buttons for easier accessibility. ALT-Codes are now readily available and can be accessed via new icons in the room bar.</p><p>The camera functionality has been adjusted to allow users to view photos from their friends while filtering inappropriate content remains a work in progress. Additionally, many miscellaneous bugs and issues have been fixed, contributing to an overall smoother gameplay experience.</p>', 'staff', 'January Update for Habbo Hotel: Origins', '<p class=\"noticia_descripcion\"><strong>New updates have arrived for Habbo Hotel: Origins!</strong> Discover improvements in navigation, chat history, and camera functionality, along with multiple bug fixes enhancing overall gameplay.</p>', 'com', '2025-02-06 11:06:12'),
(278, 'Join the SUPERLOVE hunt', '2025-02-06-13-12-14', 'SUPERLOVE event in Habbo Hotel: Origins', '<p><strong>The SUPERLOVE hunt has begun in Habbo Hotel: Origins!</strong></p><p>From now until February 17th, SUPERLOVE bots will be chasing players around both private and public rooms. If they catch you, you\'ll have to find out what happens next! Anyone can participate in this exciting event regardless of their HC membership status. Be alert and avoid getting caught!</p>', 'staff', 'SUPERLOVE event announcement', '<p class=\"noticia_descripcion\"><strong>Exciting news from Habbo Hotel: Origins!</strong> Join the SUPERLOVE hunt and evade the bots until February 17th. Will you escape the chase?</p>', 'com', '2025-02-06 13:12:32'),
(279, 'Junte-se à caça do SUPERAMOR', '2025-02-06-13-23-50', 'Bots SUPERAMOR no Habbo Hotel', '<p><strong>Entre agora e 17 de fevereiro, os bots SUPERAMOR vão estar perseguindo os jogadores em quartos públicos e privados no Habbo Hotel: Origins.</strong></p><p>Se eles te pegarem... bem, você terá que ver o que acontece. Este evento está acessível a todos, e não é necessário ser um membro do HC para participar. Os bots perseguirão qualquer um que esteja no jogo!</p>', 'staff', 'evento SUPERAMOR no Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Participe da caça do SUPERAMOR!</strong> Bots estarão em busca de jogadores até 17 de fevereiro. Não fique de fora dessa divertida perseguição!</p>', 'com.br', '2025-02-06 13:24:10'),
(280, 'Únete a la cacería del SUPERAMOR', '2025-02-06-13-25-06', 'Cacería del SUPERAMOR en Habbo Hotel', '<p><strong>Habbo Hotel: Orígenes presenta un emocionante evento: la cacería del SUPERAMOR!</strong></p><p>Desde ahora hasta el 17 de febrero, los bots del SUPERAMOR estarán persiguiendo jugadores en las salas públicas y privadas. Si algún jugador es atrapado, tendrá que descubrir qué sucederá a continuación. Este evento es accesible para todos, ya que no es necesario ser miembro HC para participar. ¡Prepárense para vivir una experiencia única llena de sorpresas y diversión!</p>', 'staff', 'Evento de cacería del SUPERAMOR en Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>La cacería del SUPERAMOR ya está aquí!</strong> Desde ahora hasta el 17 de febrero, los bots perseguirán a todos los jugadores en Habbo Hotel: Orígenes. ¡No te pierdas esta emocionante aventura!</p>', 'es', '2025-02-06 13:25:28'),
(281, 'É a Funky Friday!', '2025-02-07-12-49-12', 'Catálogo Funky Friday', '<p><strong>Funky Friday chegou ao Habbo Hotel!</strong></p><p>No dia 8 de agosto de 2024, a Habbo anunciou uma promoção especial chamada Funky Friday, onde diversos itens serão distribuídos na conta X/Twitter e adicionados ao Catálogo por apenas 24 horas. Aproveite essa oportunidade única para adquirir itens limitados!</p>', 'funky_friday', 'promoção Funky Friday 08 de agosto de 2024', '<p class=\"noticia_descripcion\"><strong>Chegou o Funky Friday no Habbo Hotel!</strong> Descubra e adquira itens incríveis, que estarão disponíveis por apenas 24 horas. Não perca essa oportunidade!</p>', 'com.br', '2025-02-07 12:49:30'),
(282, 'It\'s FUNKY FRIDAY!', '2025-02-07-12-50-23', 'Funky Friday event in Habbo Hotel', '<p><strong>Funky Friday has arrived in Habbo Hotel!</strong></p><p>On this exciting day, Habbo is giving away numerous fun items on their X/Twitter account. In addition, selected items are added to the Catalogue for 24 hours! Don’t miss out on the chance to grab some exclusive items and enjoy the festive atmosphere!</p>', 'funky_friday', 'Funky Friday announcement for Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Funky Friday is here in Habbo Hotel!</strong> Discover a range of exciting items available for 24 hours in the Catalogue. Make sure to grab them while you can!</p>', 'com', '2025-02-07 12:50:40'),
(283, '¡Es Funky Friday!', '2025-02-07-12-51-36', 'Funky Friday en Habbo Hotel', '<p><strong>¡Es Funky Friday en Habbo Hotel!</strong></p><p>Hoy, a través de su cuenta de X/Twitter, Habbo está regalando una gran cantidad de sorpresas mientras las pone en el Catálogo por un tiempo limitado de 24 horas. Esta es una oportunidad única para que los usuarios adquieran fantásticos objetos a través de este evento especial. ¡No te lo pierdas!</p>', 'funky_friday', 'Funky Friday promoción', '<p class=\"noticia_descripcion\"><strong>¡Funky Friday ha llegado a Habbo Hotel!</strong> Disfruta de las increíbles sorpresas que el evento trae, disponibles en el Catálogo solo por 24 horas. ¡Aprovecha esta oportunidad!</p>', 'es', '2025-02-07 12:51:56'),
(284, 'Atividades da semana com Cayde-6!', '2025-02-10-16-00-38', 'Evento com Cayde-6 no Cachorro Malandro', '<p><strong>Participe das atividades da semana e divirta-se com Cayde-6!</strong></p><p>No dia 11 de fevereiro, às 12h BR / 15h PT, o evento acontecerá no Cachorro Malandro. É uma oportunidade incrível para jogar e concorrer a prêmios, graças à colaboração do usuário Dos da comunidade ES. Não perca a chance de se divertir e ganhe prêmios!</p>', 'staff', 'Evento de jogos com prêmios de Cayde-6', '<p class=\"noticia_descripcion\"><strong>Divirta-se com Cayde-6!</strong> Junte-se ao evento no Cachorro Malandro e tenha a chance de ganhar prêmios jogando com amigos. Não fique de fora!</p>', 'com.br', '2025-02-10 16:00:58'),
(285, '¡Actividades de la semana con Aleksander!', '2025-02-10-16-01-54', 'Actividades semanales en El Perro Traicionero', '<p><strong>¡Esta semana se presentan actividades emocionantes con Aleksander!</strong></p><p>El 2 de diciembre a las 8hs MX / 15hs ES, los jugadores están invitados a participar en una actividad sorpresa en El Perro Traicionero, donde se pueden ganar premios. Adicionalmente, el viernes habrá un evento especial para corazones apasionados. Mantente informado a lo largo de la semana para más detalles sobre ambos eventos y no te pierdas la diversión.</p>', 'staff', 'Actividades con Aleksander en El Perro Traicionero', '<p class=\"noticia_descripcion\"><strong>No te pierdas las actividades de la semana con Aleksander!</strong> Únete a la sorpresa el 2 de diciembre y participa en el evento especial del viernes. ¡Premios también estarán disponibles!</p>', 'es', '2025-02-10 16:02:17'),
(286, 'Play The Treacherous Dog with Staff this Week!', '2025-02-11-07-48-47', 'Event for The Treacherous Dog game', '<p><strong>Join the new game of The Treacherous Dog with Staff this week!</strong></p><p>On February 12, 2023, a new game created by ES Hotel user DOS will take place. Join the fun at 3 PM GMT (6 AM PST) in the room named The Treacherous Dog, owned by Huntermain. This special event promises excitement, and there will be prizes available. Stay tuned for more details throughout the week!</p>', 'staff', 'Event for The Treacherous Dog game on February 12, 2023', '<p class=\"noticia_descripcion\"><strong>Get ready for The Treacherous Dog game with Staff!</strong> Join the exciting event on February 12, 2023, for fun and prizes!</p>', 'com', '2025-02-11 07:49:06'),
(287, 'Item Raro adicionado ao catálogo: Ventilador Rosa', '2025-02-11-12-31-15', 'Catálogo Ventilador Rosa', '<p><strong>Chegou um novo raro no Habbo Hotel: Origens: Ventilador Rosa!</strong></p><p>O Ventilador Rosa, disponível até às 9h BR / 12h PT do dia 13/02, pode ser adquirido no catálogo por 75 créditos. Este raro estará disponível por tempo limitado e não será relançado posteriormente. Garanta o seu enquanto há tempo!</p>', 'rares_martes', 'novo raro Ventilador Rosa disponível', '<p class=\"noticia_descripcion\"><strong>Um novo raro chegou ao Habbo Hotel: Origens!</strong> Não perca a oportunidade de adquirir o <strong>RARO Ventilador Rosa</strong>, disponível por tempo limitado. Aproveite!</p>', 'com.br', '2025-02-11 12:31:38'),
(288, 'New Rare Available! The Superlove Pink Fan', '2025-02-11-12-32-30', 'Superlove Pink Fan Catalogue', '<p><strong>Introducing the new rare item in Habbo Hotel: Origins: Superlove Pink Fan!</strong></p><p>Available from the rare section of the Catalogue, this fan costs 75 credits and will be available until 12pm GMT (4am PDT) on 13/02. Once this item is gone, it will never be released again. Don\'t miss out on your chance to add this unique piece to your collection!</p>', 'rares_martes', 'new rare Superlove Pink Fan', '<p class=\"noticia_descripcion\"><strong>A new rare arrives at Habbo Hotel: Origins!</strong> Discover and acquire the new rare, <strong>Superlove Pink Fan</strong>, available for a limited time. Don\'t miss out!</p>', 'com', '2025-02-11 12:32:49'),
(289, 'Raro añadido al Catálogo: La Ventolera Rosa', '2025-02-11-12-33-44', 'Catalogo La Ventolera Rosa', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: La Ventolera Rosa!</strong></p><p>El 13 de febrero de 2024, se lanza un raro único en el catálogo de Habbo Hotel: Orígenes. La <strong>Ventolera Rosa</strong> estará disponible por tiempo limitado a un precio de 75 créditos. Este raro permanecerá en la sección de raros del Catálogo hasta el 13/02 a las 6am CST / 1pm CET. ¡No pierdas la oportunidad de adquirir este objeto exclusivo!</p>', 'rares_martes', 'nuevo raro Ventolera Rosa 13 de febrero del 2024', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Conoce y adquiere el nuevo raro, <strong>La Ventolera Rosa</strong>, disponible solo hasta el 13 de febrero. ¡No te lo pierdas!</p>', 'es', '2025-02-11 12:34:04'),
(290, 'Trax Mixdown: Valentines edition!', '2025-02-11-16-07-24', 'Trax Mixdown Valentines Edition', '<p><strong>Valentine\'s Day is approaching, and Habbo Hotel has launched a special Trax Mixdown competition!</strong></p><p>To celebrate the occasion, Habbos can now enjoy new Valentines Trax CDs added to the Catalogue. Participants are invited to compose a song using a Trax Machine and record themselves singing over it. The competition allows the use of AI for lyrics and singing, as long as original creations are submitted. The contest emphasizes creativity, humor, and quality music production. Entries will be judged based on clever lyrics, references to Habbo lore, and overall sound quality.</p><p>Submissions are open until 8 am GMT on February 17th, with exciting prizes including Gold, Silver, and Bronze Plaques, along with credits for the best entries!</p>', 'staff', 'Trax Mixdown Valentines Edition Competition', '<p class=\'noticia_descripcion\'><strong>A special Valentines Trax Mixdown competition has been announced!</strong> Habbos can submit their original songs for a chance to win amazing prizes. Don\'t miss out!</p>', 'com', '2025-02-11 16:07:51'),
(291, 'Mezcla Trax: ¡Edición San Valentín!', '2025-02-11-16-08-44', 'Concurso de Mezcla Trax San Valentín', '<p><strong>¡Celebra San Valentín con Mezcla Trax en Habbo Hotel: Orígenes!</strong></p><p>Se han agregado nuevos CDs de Trax de San Valentín al catálogo y, para conmemorar la ocasión, se está llevando a cabo un concurso de Mezcla Trax. Los participantes deben componer y grabar una canción original utilizando la Trax Machine, con un límite de 30 segundos. Se permite el uso de herramientas de IA para la letra y la interpretación, siempre y cuando no se utilicen letras de canciones existentes. El concurso premiará a los tres mejores con placas y créditos, y las diez mejores propuestas recibirán una placa y créditos adicionales.</p>', 'staff', 'Concurso de Mezcla Trax Edición San Valentín', '<p class=\"noticia_descripcion\"><strong>¡Concurso de Mezcla Trax por San Valentín en Habbo Hotel: Orígenes!</strong> Participa en el concurso creando una canción original usando la Trax Machine y gana increíbles premios. ¡No te lo pierdas!</p>', 'es', '2025-02-11 16:09:13'),
(292, 'Mixagem Trax: Edição dos Dia dos Namorados!', '2025-02-11-16-20-29', 'Competição de Mixagem Trax para o Dia dos Namorados', '<p><strong>A competição de Mixagem Trax para o Dia dos Namorados já está rolando!</strong></p><p>A ocasião traz uma nova chance de ganhar placas especiais de Mixagem. Para participar, os Habbos devem compor uma música usando a Trax Machine e gravar-se cantando. O uso de IA para letras e canto é permitido, mas não se pode usar músicas existentes. As composições devem ter no máximo 30 segundos e as inscrições vão até as 5:00 (BR) / 8:00 (PT) do dia 17/02. Os vencedores receberão prêmios como Disco de Ouro e créditos!</p>', 'staff', 'Competição de Mixagem Trax para o Dia dos Namorados em Habbo', '<p class=\"noticia_descripcion\"><strong>Participe da competição de Mixagem Trax para o Dia dos Namorados!</strong> Componha uma música e cante, valendo prêmios incríveis! Inscrições até 17/02 às 5:00 (BR) / 8:00 (PT).</p>', 'com.br', '2025-02-11 16:20:56'),
(293, 'Cupid’s Gala', '2025-02-12-15-07-40', 'Cupid Gala Event', '<p><strong>Get ready for a magical evening at the Cupid Gala, hosted in Habbo Hotel: Origins!</strong></p><p>On February 14th at 11am GMT, players are invited to celebrate online friendship, pixelated conversations, and timeless Habbo dances while dressed in their best digital attire. Attend the event in the Cupid Gala Room by searching for Aleksander’s room in the Navigator. B0bba will also be streaming on Twitch, where attendees can request their favorite romantic songs to be played throughout the night! Don\'t miss this delightful virtual gathering!</p>', 'staff', 'Cupid Gala Event Announcement', '<p class=\"noticia_descripcion\"><strong>The Cupid Gala is coming to Habbo Hotel: Origins!</strong> Join on February 14th for a magical evening filled with friendship and music. Don’t miss the chance to dress up and dance!</p>', 'com', '2025-02-12 15:08:00'),
(294, 'La Gala Cupido llega a Habbo Hotel: Origins', '2025-02-12-15-08-54', 'Gala Cupido en Habbo Hotel', '<p><strong>Únete a la Gala Cupido este Día de San Valentín en Habbo Hotel: Origins!</strong> El 14 de febrero a las 5 a. m. CST / 12 p. m. CET, los usuarios podrán disfrutar de una noche mágica celebrando la amistad online, confesiones pixeladas y bailes atemporales. La fiesta tendrá lugar en la sala Gala Cupido, disponible en el Navegador buscando entre las salas de Morgana. DM-Avenger también estará presente para ayudar en el baile, y los participantes podrán sintonizar la retransmisión en Twitch para solicitar sus canciones románticas favoritas.</p>', 'staff', 'Evento Gala Cupido en Habbo', '<p class=\"noticia_descripcion\"><strong>La Gala Cupido se celebra en Habbo Hotel: Origins!</strong> No te pierdas la oportunidad de unirte a la fiesta el 14 de febrero, donde habrá bailes y sorpresas para todos. ¡Celebra el amor y la amistad en un entorno único!</p>', 'es', '2025-02-12 15:09:16'),
(295, 'It\'s FUNKY FRIDAY!', '2025-02-14-14-01-59', 'Funky Friday Event', '<p><strong>It\'s FUNKY FRIDAY!</strong></p><p>On this special day, Habbo has decided to give away a variety of exclusive items on their X/Twitter account. Additionally, these items will be added to the Catalogue for a limited time of 24 hours. Don\'t miss out on this opportunity to grab some unique goodies!</p>', 'funky_friday', 'Funky Friday Special Event', '<p class=\"noticia_descripcion\"><strong>It\'s FUNKY FRIDAY at Habbo!</strong> Exclusive items are being given away and will be available in the Catalogue for 24 hours. Seize the moment!</p>', 'com', '2025-02-14 14:02:19'),
(296, '¡Es Funky Friday!', '2025-02-14-14-03-14', 'Evento Funky Friday', '<p><strong>Habbo Hotel celebra el Funky Friday con regalos y sorpresas!</strong></p><p>Este 20 de octubre de 2023, Habbo lanza el Funky Friday, donde se regalarán múltiples ítems en su cuenta de X/Twitter. Además, todos los ítems que se presenten estarán disponibles en el Catálogo durante 24 horas. ¡Los usuarios no deben perderse esta emocionante oportunidad de conseguir increíbles artículos!</p>', 'funky_friday', 'Evento Funky Friday 20 de octubre del 2023', '<p class=\"noticia_descripcion\"><strong>¡Funky Friday está aquí en Habbo Hotel!</strong> Regalos y artículos disponibles en el Catálogo solo por 24 horas. ¡Aprovecha esta oportunidad única!</p>', 'es', '2025-02-14 14:03:31'),
(297, 'É a Funky Friday!', '2025-02-14-14-14-44', 'Catálogo Funky Friday', '<p><strong>A notícia de hoje é sobre a Funky Friday!</strong></p><p>Além de distribuir uma variedade de itens em sua conta X/Twitter, Habbo também adicionará esses itens ao Catálogo por um período de 24 horas. Os jogadores não podem perder essa oportunidade de adquirir novas e divertidas adições às suas coleções. Fique atento!</p>', 'funky_friday', 'evento Funky Friday', '<p class=\"noticia_descripcion\"><strong>A Funky Friday chegou a Habbo!</strong> Aproveite a distribuição de itens e a adição ao Catálogo por 24 horas. Não perca essa chance!</p>', 'com.br', '2025-02-14 14:15:02'),
(298, 'Private room ban management system added', '2025-02-17-11-14-15', 'Private Room Ban Management System', '<p><strong>The private room ban management system has been implemented!</strong></p><p>This is the final Quality of Life improvement from the roadmap published last year. Users who provided feedback on X and Discord contributed to this feature. Thank you for your input!</p>', 'staff', 'New Management System for Private Room Bans', '<p class=\"noticia_descripcion\"><strong>A new management system for private room bans has been introduced!</strong> This feature marks the final addition to the Quality of Life improvements announced last year. Check it out!</p>', 'com', '2025-02-17 11:14:33'),
(299, 'Atividades da semana com Cayde-6!', '2025-02-17-16-04-13', 'Evento de Cayde-6', '<p><strong>Participe das atividades da semana com Cayde-6!</strong></p><p>Nos dias 18 e 19 de fevereiro de 2023, os jogadores poderão se divertir em um jogo com Cayde-6 e, quem sabe, ganhar alguns prêmios. Não perca essa oportunidade de se envolver em atividades emocionantes e ter a chance de faturar prêmios incríveis.</p>', 'staff', 'Atividades semanais com Cayde-6', '<p class=\"noticia_descripcion\"><strong>Atividades da semana estão chegando!</strong> Junte-se a Cayde-6 em um emocionante evento de jogos e tenha a chance de ganhar prêmios. Não fique de fora!</p>', 'com.br', '2025-02-17 16:04:34'),
(300, '¡Actividades de la semana!', '2025-02-17-16-15-46', 'Actividades semanales en El Perro Traicionero', '<p><strong>¡Ven a divertirte con Aleksander en una actividad sorpresa!</strong></p><p>La fansite Origins Kingdom informa que se llevarán a cabo diversas actividades durante esta semana con Aleksander. Los anfitriones estarán entregando premios y sorpresas a los asistentes. Las fechas son el 19 de febrero a las 8hs MX / 15hs ES y el 21 de febrero a las 7hs MX / 14hs ES. El lugar es El Perro Traicionero, donde podrás encontrar la sala propiedad de Aleksander. ¡No te lo pierdas!</p>', 'staff', 'Actividades sorpresas en El Perro Traicionero', '<p class=\"noticia_descripcion\"><strong>¡Disfruta de actividades sorpresivas con Aleksander!</strong> Los días 19 y 21 de febrero, participa y disfruta de la oportunidad de ganar premios en El Perro Traicionero. ¡Te esperamos!</p>', 'es', '2025-02-17 16:16:07'),
(301, 'New Rare Available! The White Smoke Machine', '2025-02-18-12-58-53', 'Catalogue White Smoke Machine', '<p><strong>The new rare item in Habbo Hotel: Origins: White Smoke Machine!</strong></p><p>Starting on 20th February 2025, a limited-time rare, the <strong>White Smoke Machine</strong>, will be available in the rare section of the Catalogue for a price of 50 credits. This item will only be available until 12pm GMT (4am PDT) on the same day. Make sure to grab this unique item while you can, as it will never be released in Habbo Hotel: Origins again!</p>', 'rares_martes', 'new rare Tuesday 20th February 2025', '<p class=\"noticia_descripcion\"><strong>A new rare arrives at Habbo Hotel: Origins!</strong> Discover and acquire the new rare, <strong>White Smoke Machine</strong>, available for a limited time. Don\'t miss out!</p>', 'com', '2025-02-18 12:59:11'),
(302, 'Raro añadido al Catálogo: La Humareda Blanca', '2025-02-18-13-00-06', 'Catálogo La Humareda Blanca', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: La Humareda Blanca!</strong></p><p>Desde hoy, y hasta el 20 de febrero a las 6am CST / 1pm CET, los usuarios pueden adquirir este exclusivo raro por solo 50 créditos en la sección de raros del Catálogo. Esta es una oportunidad única, ya que estas piezas no volverán a estar disponibles en Habbo Hotel: Orígenes.</p>', 'rares_martes', 'nuevo raro La Humareda Blanca', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el nuevo raro, <strong>La Humareda Blanca</strong>, disponible hasta el 20 de febrero. ¡No te lo pierdas!</p>', 'es', '2025-02-18 13:00:26'),
(303, 'Ajude-nos a criar a nova moeda do Habbo Origens!', '2025-02-20-13-18-56', 'Nova moeda Habbo Origens', '<p><strong>O Habbo Hotel: Origens está convidando a comunidade a ajudar na criação da nova moeda obtível!</strong></p><p>No mês de janeiro, Macklebee, o líder de produto, compartilhou os planos para o Habbo Hotel: Origens, que inclui a introdução de uma nova moeda que poderá ser usada para adquirir diversos itens, como roupas e novos cosméticos. Os usuários são encorajados a enviar suas ideias sobre o nome e o design da moeda até o dia 27 de fevereiro, às 5h BR / 8h PT.</p>', 'staff', 'Participação da comunidade para nova moeda', '<p class=\"noticia_descripcion\"><strong>Participe da criação da nova moeda do Habbo Hotel: Origens!</strong> Envie suas sugestões até 27 de fevereiro e ajude a moldar o futuro do jogo.</p>', 'com.br', '2025-02-20 13:19:23'),
(304, 'Ayúdanos a diseñar la moneda de recompensa de Origins', '2025-02-20-13-20-14', 'Diseño de la nueva moneda de recompensa en Habbo Hotel', '<p><strong>Habbo invita a su comunidad a participar en el diseño de la nueva moneda de recompensa para Origins.</strong></p><p>Desde enero, Macklebee, el jefe de producto, ha compartido que la nueva moneda se utilizará para adquirir diversas items, tales como ropa y elementos estéticos para el infostand del avatar. Los jugadores son animados a enviar sus propuestas a través de X o Imgur, con una fecha límite el 27 de febrero a las 2 a.m. CST / 9 a.m. CET. Se requiere un nombre para la moneda, su diseño y cualquier detalle adicional que se considere relevante.</p>', 'staff', 'Convocatoria para diseñar la moneda de recompensa en Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Participa en el diseño de la nueva moneda de recompensa para Habbo Hotel: Orígenes.</strong> Envía tus ideas hasta el 27 de febrero y sé parte de este emocionante nuevo capítulo en la historia de Habbo!</p>', 'es', '2025-02-20 13:20:40'),
(305, 'Help us design Origins’ earnable currency!', '2025-02-20-13-31-48', 'Earnable currency concept for Habbo Hotel: Origins', '<p><strong>Habbo Hotel: Origins invites the community to contribute ideas for a new earnable currency!</strong></p><p>In a recent announcement, product lead Macklebee emphasized the importance of community involvement in designing this currency, which will be used for purchasing various items in the game, such as clothing and Info Stand cosmetics. Players are encouraged to submit their ideas, including a name for the currency, design concepts, and any relevant details that tie back to Habbo\'s lore. Submissions can be made through X or Imgur, with a deadline set for 8am GMT on February 27th. This initiative allows players to have a direct say in shaping the future of the game!</p>', 'staff', 'Earnable currency announcement for February 2025', '<p class=\"noticia_descripcion\"><strong>Join the conversation on creating a new earnable currency for Habbo Hotel: Origins!</strong> Players are invited to submit their ideas, including design and name suggestions, by February 27th. Don\'t miss the chance to shape the game!</p>', 'com', '2025-02-20 13:32:15'),
(306, 'É a Funky Friday!', '2025-02-21-12-37-44', 'Catálogo Funky Friday', '<p><strong>Hoje é dia de Funky Friday no Habbo Hotel!</strong></p><p>Durante 24 horas, diversos itens estarão disponíveis em nossa conta X/Twitter e também serão adicionados ao Catálogo. Essa é uma oportunidade imperdível para os jogadores que desejam ampliar suas coleções com itens especiais. Não fique de fora deste evento exclusivo!</p>', 'funky_friday', 'evento Funky Friday no Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Funky Friday chegou ao Habbo Hotel!</strong> Itens especiais estarão disponíveis por tempo limitado no Catálogo e na conta X/Twitter. Aproveite!</p>', 'com.br', '2025-02-21 12:38:00'),
(307, 'It\'s FUNKY FRIDAY!', '2025-02-21-12-38-55', 'Funky Friday Event', '<p><strong>Happy FUNKY FRIDAY from Habbo!</strong></p><p>As part of today\'s celebration, Habbo is giving away a load of special items on their X/Twitter account. Additionally, these items will be available in the Catalogue for a limited time of 24 hours. Don\'t miss this exciting opportunity to add trendy items to your collection!</p>', 'funky_friday', 'Funky Friday Event Announcement', '<p class=\"noticia_descripcion\"><strong>It\'s FUNKY FRIDAY!</strong> Celebrate with exclusive giveaways and limited-time items available for 24 hours in the Catalogue. Don\'t miss out on this event!</p>', 'com', '2025-02-21 12:39:13'),
(308, '¡Es Funky Friday en Habbo Hotel!', '2025-02-21-12-40-07', 'Evento Funky Friday', '<p><strong>¡Hoy es Funky Friday en Habbo Hotel!</strong></p><p>Desde la cuenta oficial de Habbo en X/Twitter, se han anunciado emocionantes regalos para los usuarios. Además, todo lo que se regala estará disponible en el Catálogo durante 24 horas. No pierdas la oportunidad de participar y obtener estos increíbles artículos que estarán al alcance de todos los traders. ¡Prepárense para la diversión y la sorpresa que trae este viernes!</p>', 'funky_friday', 'Funky Friday en Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>¡Hoy es Funky Friday!</strong> No te pierdas los regalos y sorpresas que Habbo ha preparado. Todo estará disponible en el Catálogo por 24 horas. ¡A disfrutar!</p>', 'es', '2025-02-21 12:40:27'),
(309, 'Nuevo sistema de gestión de accesos a salas privadas', '2025-02-21-16-59-08', 'Sistema de gestión de accesos', '<p><strong>Habbo Hotel presenta un nuevo sistema de gestión en la restricción de los accesos a salas privadas.</strong></p><p>Recientemente, Habbo ha implementado una mejora significativa en su hoja de ruta: un sistema de gestión que optimiza el control de accesos a salas privadas. Esta actualización responde a los comentarios y sugerencias de la comunidad, agradeciendo a todos los que participaron en las discusiones en X y en Discord. Esta novedad promete brindar una experiencia más segura y organizada para los jugadores.</p>', 'staff', 'sistema de gestión de accesos en Habbo', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel introduce un sistema de gestión para accesos en salas privadas!</strong> Este nuevo sistema busca mejorar el control y seguridad en las salas, gracias a aportaciones de la comunidad. ¡Estén atentos a más mejoras!</p>', 'es', '2025-02-21 16:59:33'),
(310, 'Sistema de gerenciamento de ban em quartos privados adicionado', '2025-02-21-17-10-41', 'Sistema de gerenciamento de ban em quartos privados', '<p><strong>O sistema de gerenciamento de ban foi a melhoria final de experiência de usuário do roteiro que publicamos no ano passado.</strong></p><p>Se você contribuiu com o feedback sobre esses recursos no X e em nosso Discord, obrigado! Essa atualização visa proporcionar uma experiência mais personalizada e eficiente para os usuários que utilizam quartos privados.</p>', 'staff', 'Atualização do sistema de gerenciamento de ban em quartos privados', '<p class=\"noticia_descripcion\"><strong>Nova atualização em Habbo Hotel!</strong> O sistema de gerenciamento de ban em quartos privados foi adicionado, visando melhorar a experiência do usuário. Fique atento às novidades!</p>', 'com.br', '2025-02-21 17:10:59'),
(311, 'Actividades de la semana con Aleksander', '2025-02-24-15-52-27', 'Actividad sorpresa con Aleksander', '<p><strong>¡Prepárate para una semana llena de sorpresas!</strong></p><p>Habbo anuncia una actividad especial que tendrá lugar el 26 y 27 de febrero de 2025 a las 8hs MX / 15hs ES. Únete a Aleksander en una actividad sorpresa donde podrás divertirte y, quizás, ganar un premio. No olvides buscar la sala de Delivery Valentines, propiedad de Aleksander. ¡No te lo pierdas!</p>', 'staff', 'Actividad sorpresa con Aleksander el 26 y 27 de febrero', '<p class=\"noticia_descripcion\"><strong>¡Aleksander te invita a una actividad sorpresa!</strong> No faltes el 26 y 27 de febrero a las 8hs MX / 15hs ES en Delivery Valentines. ¡Diviértete y gana premios!</p>', 'es', '2025-02-24 15:52:48'),
(312, 'Valentines Trax Mixdown WINNERS', '2025-02-25-14-14-01', 'Valentines Trax Mixdown Winners Announcement', '<p><strong>Habbo Hotel: Origins has announced the winners of the Valentines Trax Mixdown competition!</strong></p><p>This competition featured a variety of Cupid-themed love songs, showcasing different styles, from humorous to heartfelt. The top submission was ‘Ridicule’, praised for its humor and production quality. Following closely were ‘Priestly’ and ‘Brunismo’, both providing fun interpretations of love stories. Additionally, seven runners-up highlighted the rich talent and creativity within the community. Prizes for the competition are expected to be donated in the coming days. Thank you to all participants who contributed their unique creations!</p>', 'staff', 'Valentines Trax Mixdown Winners Summary', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel: Origins has revealed the winners of the Valentines Trax Mixdown competition!</strong> The top three songs exhibited creativity and humor, with ‘Ridicule’ taking the top spot. Congratulations to all participants!</p>', 'com', '2025-02-25 14:14:22');
INSERT INTO `noticias` (`id`, `titulo`, `imagen_completa`, `alt_imagen_completa`, `descripcion_completa`, `imagen_resumida`, `alt_imagen_resumida`, `descripcion_resumida`, `hotel`, `fecha_noticia`) VALUES
(313, 'Resultado Mezcla Trax: ¡Edición San Valentín!', '2025-02-25-14-15-17', 'Resultados del concurso de música San Valentín', '<p><strong>Habbo Hotel ha anunciado los resultados de su concurso Mezcla Trax con motivo de San Valentín.</strong></p><p>Los concursantes mostraron su creatividad en este reto musical, aunque algunos quedaron fuera por no seguir la temática de Cupido. El top 3 incluye las canciones de otaku, iJN y CRISTAL, destacando sus letras y ritmos que han capturado la atención de Cupido. Además, varios otros talentos fueron mencionados como ganadores en la segunda categoría, sumando un total de canciones notables. Los premios serán entregados mañana. ¡Felicidades a todos los ganadores creativos y talentosos!</p>', 'staff', 'Resultados concurso Mezcla Trax San Valentín', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel ha revelado los resultados del concurso de música Mezcla Trax por San Valentín.</strong> Con un top 3 que incluye a otaku, iJN y CRISTAL, el evento ha destacado la creatividad y el talento de sus participantes. Los premios se entregarán mañana.</p>', 'es', '2025-02-25 14:15:41'),
(314, 'Os vencedores da competição musical do Cupido', '2025-02-25-14-27-00', 'Vencedores da competição musical do Cupido', '<p><strong>Habbo Hotel anunciou os vencedores da competição musical onde os participantes deveriam criar canções pedindo ajuda ao Cupido.</strong></p><p>Oito canções se destacaram entre os participantes, com temas que refletiram o amor e a conexão entre os usuários do Habbo. Os vencedores foram apreciados por suas letras criativas e conexões com o hotel. Os prêmios serão entregues amanhã e a equipe do Habbo agradece a todos os participantes pela criatividade e talento.</p>', 'staff', 'vencedores da competição musical do Cupido', '<p class=\"noticia_descripcion\"><strong>Competição musical do Cupido: Confira os vencedores!</strong> O Habbo Hotel anunciou os vencedores de sua competição musical, destacando a criatividade dos participantes. Apenas canções que seguiram o tema foram premiadas.</p>', 'com.br', '2025-02-25 14:27:21'),
(315, 'Item Raro disponível! Guarda-sol Verde', '2025-02-25-14-38-40', 'Catálogo Guarda-sol Verde', '<p><strong>O novo item raro de Habbo Hotel: Origens: Guarda-sol Verde!</strong></p><p>No dia 4 de março de 2023, será adicionado um novo item raro ao catálogo de Habbo Hotel: Origens. O<strong> Guarda-sol Verde</strong> estará disponível por tempo limitado por 45 créditos na seção de Raros. Este item não será relançado, por isso é uma ótima oportunidade para garantir essa peça única na coleção!</p>', 'rares_martes', 'novo raro Guarda-sol Verde disponível até 4 de março de 2023', '<p class=\"noticia_descripcion\"><strong>Um novo item raro chega a Habbo Hotel: Origens!</strong> O <strong>Guarda-sol Verde</strong> já está disponível por tempo limitado. Não perca a chance de adquiri-lo!</p>', 'com.br', '2025-02-25 14:39:03'),
(316, 'Rare item available! Green Parasol', '2025-02-25-14-39-52', 'Catalogue Green Parasol', '<p><strong>A new rare item has been added to Habbo Hotel: Origins: Green Parasol!</strong></p><p>This unique item is available for a limited time, priced at 45 credits. The Green Parasol will be accessible in the rare section of the Catalogue until 12pm GMT (4am PDT) on March 4th, 2024. This item will never be released again in Habbo Hotel: Origins, so ensure to grab it while you can!</p>', 'rares_martes', 'new rare Green Parasol March 4th, 2024', '<p class=\"noticia_descripcion\"><strong>A new rare has arrived at Habbo Hotel: Origins!</strong> Discover and secure the new rare item, <strong>Green Parasol</strong>, available for a limited time. Don\'t miss out!</p>', 'com', '2025-02-25 14:40:11'),
(317, 'Raro añadido al Catálogo: La Sombrilla Verde', '2025-02-25-14-41-07', 'Catálogo Sombrilla Verde', '<p><strong>Nuevo raro en Habbo Hotel: Orígenes: La Sombrilla Verde!</strong></p><p>Desde el 25 de febrero de 2025, La Sombrilla Verde se encuentra disponible por un precio de 45 créditos en la sección de raros del Catálogo. Este raro único estará accesible hasta el 04 de marzo a las 6am CST / 1pm CET. ¡No pierdas la oportunidad de adquirir este artículo exclusivo antes de que desaparezca para siempre!</p>', 'rares_martes', 'nuevo raro Sombrilla Verde', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Conoce y adquiere la nueva pieza rara, <strong>La Sombrilla Verde</strong>, disponible por tiempo limitado. ¡No te lo pierdas!</p>', 'es', '2025-02-25 14:41:27'),
(318, 'Resultado Mezcla Trax: ¡Edición San Valentín!', '2025-02-25-15-13-40', 'Resultados del concurso musical de San Valentín', '<p><strong>Habbo presenta los resultados del concurso musical de San Valentín: Mezcla Trax.</strong></p><p>La creatividad de los usuarios ha brillado en esta edición especial del concurso de música. Sin embargo, algunos participantes no comprendieron el enfoque de la temática relacionada con Cupido, quedando excluidos de la lista. Entre los ganadores se encuentran canciones que captaron la atención de Cupido, con letras y ritmos pegajosos.</p><p>Los tres primeros lugares son ocupados por otaku, iJN y CRISTAL, quienes demostraron gran habilidad creativa. Además, se mencionaron otros ganadores como ChoroMota, CL4S1C0 y Shenk0, quienes también dejaron su huella en la competición.</p><p>Habbo agradece a todos los concursantes por sus aportes y comunica que los premios serán entregados mañana.</p>', 'staff', 'Resultados del concurso musical de San Valentín', '<p class=\"noticia_descripcion\"><strong>Habbo revela los ganadores del concurso musical de San Valentín!</strong> Descubre los temas que cautivaron a Cupido y felicita a los creativos participantes. ¡Los premios se entregarán mañana!</p>', 'es', '2025-02-25 15:14:02'),
(319, 'Atividades da semana com Cayde-6!', '2025-03-03-16-27-43', 'Cayde-6 em Corrida do Caos', '<p><strong>Participe da Corrida do Caos com Cayde-6!</strong></p><p>Nos dias 04 e 05 de março de 2025, jogadores têm a chance de se divertir e competir em um jogo emocionante com Cayde-6. Os eventos ocorrerão às 12h (horário de Brasília) e às 15h (horário de Portugal). Não perca a oportunidade de faturar prêmios enquanto se diverte!</p>', 'staff', 'Atividades da semana com Cayde-6', '<p class=\"noticia_descripcion\"><strong>Venha se divertir com Cayde-6!</strong> Participe da Corrida do Caos nos dias 04 e 05 de março e tenha a chance de ganhar prêmios!</p>', 'com.br', '2025-03-03 16:28:01'),
(320, 'Actividades de la semana con Aleksander', '2025-03-04-07-57-04', 'Actividades de Aleksander', '<p class=\"noticia_descripcion\"><strong>No te pierdas las actividades de la semana con Aleksander!</strong> El 5 y 6 de marzo, a las 8hs MX / 15hs ES, se llevará a cabo una actividad sorpresa en la Carrera del Caos. El usuario Greg de la comunidad BR ha proporcionado su juego para entretenimiento y habrá premios para los participantes. ¡No faltes!</p>', 'staff', 'Actividades de la semana con Aleksander', '<p class=\"noticia_descripcion\"><strong>Actividades de la semana en Habbo!</strong> Únete a Aleksander el 5 y 6 de marzo para una actividad especial con premios. ¡Te esperamos en la Carrera del Caos!</p>', 'es', '2025-03-04 07:57:27'),
(321, 'Play Chaos Run with Staff this week!', '2025-03-04-08-08-26', 'Chaos Run with Staff', '<p><strong>Join Habbo for a new game of Chaos Run this week!</strong></p><p>On March 5th at 4pm GMT (7am PST) and March 7th at 2pm GMT (5am PST), players can participate in a new game hosted by Habbo staff. The game, created by BR Hotel user Greg, will take place in specific rooms: search for the room owned by Huntermain on the first date and Aleksander\'s room on the second. Don\'t miss out on this exciting opportunity to play with staff!</p>', 'staff', 'Chaos Run event with Staff', '<p class=\"noticia_descripcion\"><strong>New game event: Chaos Run with Staff!</strong> Join Habbo staff on March 5th and 7th for an exciting game of Chaos Run. Enjoy unique gameplay and get to know the staff!</p>', 'com', '2025-03-04 08:08:43'),
(322, 'Item Raro disponível! Almofada de Lã Verde', '2025-03-04-14-46-11', 'Catálogo Almofada de Lã Verde', '<p><strong>Um novo item raro foi adicionado ao catálogo de Habbo Hotel: Origens: Almofada de Lã Verde!</strong></p><p>A Almofada de Lã Verde está disponível por um preço especial de 50 créditos e pode ser encontrada na seção de Raros do Catálogo até às 9h BR / 12h PT do dia 06/03. Este item exclusivo não será relançado, então aproveite a oportunidade de adicioná-lo à sua coleção!</p>', 'rares_martes', 'novo raro Almofada de Lã Verde disponível', '<p class=\"noticia_descripcion\"><strong>Chega um novo raro ao Habbo Hotel: Origens!</strong> Descubra e adquira a nova peça rara, <strong>Almofada de Lã Verde</strong>, disponível por tempo limitado. Não perca esta chance!</p>', 'com.br', '2025-03-04 14:46:30'),
(323, 'New Rare Available! Green Wooly Pillow', '2025-03-04-14-54-55', 'Green Wooly Pillow in the Catalog', '<p><strong>The new rare item in Habbo Hotel: Origins: Green Wooly Pillow!</strong></p><p>Starting from now, the <strong>Green Wooly Pillow</strong> is available in the rare section of the catalogue at a price of 50 credits. It will be accessible until 12pm GMT (4am PDT) on 06/03. This item will never be released in Habbo Hotel: Origins again, so don\'t miss your chance to add this unique piece to your collection!</p>', 'rares_martes', 'New Rare Green Wooly Pillow', '<p class=\"noticia_descripcion\"><strong>A new rare arrives at Habbo Hotel: Origins!</strong> Discover and acquire the new rare item, <strong>Green Wooly Pillow</strong>, available for a limited time. Don\'t miss out!</p>', 'com', '2025-03-04 14:55:44'),
(324, 'Raro añadido al Catálogo: Almohadón Verde', '2025-03-04-14-56-41', 'Catálogo Almohadón Verde', '<p><strong>El nuevo raro de Habbo Hotel: Orígenes: Almohadón Verde!</strong></p><p>A partir del 6 de marzo de 2024, los usuarios de Habbo podrán adquirir un nuevo raro llamado <strong>Almohadón Verde</strong> en la sección de raros del Catálogo. Este artículo estará disponible por un precio de 50 créditos hasta las 6am CST / 1pm CET. Es importante destacar que estas piezas no volverán a estar disponibles en Habbo Hotel: Orígenes. ¡Aprovecha esta oportunidad única para agregarlo a tu colección!</p>', 'rares_martes', 'nuevo raro Almohadón Verde disponible', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el nuevo raro, <strong>Almohadón Verde</strong>, disponible hasta el 6 de marzo. ¡No te lo pierdas!</p>', 'es', '2025-03-04 14:57:01'),
(325, 'Shamrock Shindig Celebration!', '2025-03-04-18-10-49', 'Shamrock Shindig Celebration Announcement', '<p><strong>Habbo is celebrating Irish pub culture and St. Patrick’s Day with the Shamrock Shindig!</strong></p><p>This month, the Cabin furni line will be re-released, allowing users to participate in a pub-themed room building competition. Additionally, new items have been added as extensions to the Cabin furni line, available in the Catalogue until April 1st. Although these items are not classified as rare, they may return in future updates. Emoji hints have been provided for upcoming rare and Funky Friday items this month, resulting in exciting reveals for users.</p>', 'funky_friday', 'Shamrock Shindig Emojis Announcement', '<p class=\"noticia_descripcion\"><strong>Habbo announces Shamrock Shindig!</strong> Celebrate Irish pub culture with a series of rare and Funky Friday items available throughout the month of March. Don\'t miss out on the fun!</p>', 'com', '2025-03-04 18:11:19'),
(326, '¡Atrapá el Trébol! Nuevos ítems en Habbo Hotel', '2025-03-04-18-15-18', 'Catálogo Cabaña con temática irlandesa', '<p><strong>Este mes se celebra la cultura de los pubs irlandeses y el Día de San Patricio en Habbo Hotel.</strong> Durante este evento, Habbo relanza la línea de furnis Cabaña, que fue reelaborada a mediados de 2024, y añade nuevos ítems como extensiones de esta línea. Estos furnis estarán disponibles en el Catálogo desde ahora hasta el 1 de abril. Además, se han compartido emojis que indican qué ítems serán lanzados como raros y Funky Friday durante el mes. El 17 de marzo, un día antes de lo habitual, se lanzará un raro especial para coincidir con el Día de San Patricio. <strong>¡No te lo pierdas!</strong></p>', 'staff', 'nuevos ítems de furnis Cabaña en marzo de 2024', '<p class=\"noticia_descripcion\"><strong>¡Llega el mes de San Patricio a Habbo Hotel!</strong> Descubre la nueva línea de furnis Cabaña y participa en el concurso de construcción de salas con temática de pubs. Además, entérate de los lanzamientos especiales de ítems raros y Funky Friday. ¡No te lo pierdas!</p>', 'es', '2025-03-04 18:15:38'),
(327, 'Celebração Shamrock e Novidades na Habbo!', '2024-03-04-18-22-16', 'Catálogo de Itens Shamrock', '<p><strong>Este mês, Habbo celebra a cultura dos pubs irlandeses e o Dia de São Patrício!</strong></p><p>A linha de móveis Cabin foi relançada com novos itens e estará disponível até 1º de abril. Além disso, Habbo anunciou uma série de Raros e Funky Fridays, com lançamentos programados para diferentes datas ao longo do mês, incluindo um raro especial em 17 de março, em comemoração ao Dia de São Patrício. Os jogadores podem se preparar para uma competição temática de Pub Irlandês também.</p>', 'staff', 'Celebração Shamrock e novidades nos itens de Habbo', '<p class=\"noticia_descripcion\"><strong>Shamrock chegou ao Habbo!</strong> Itens da linha de móveis Cabin foram relançados e uma nova competição de Pub Irlandês será realizada. Fique atento aos Raros e Funky Fridays deste mês!</p>', 'com.br', '2025-03-04 18:22:44'),
(328, 'Incoming InfoBus poll: Area furni!', '2025-03-05-09-08-19', 'Area furni poll', '<p><strong>Habbo Hotel: Origins announces a new InfoBus poll regarding Area furni!</strong></p><p>Starting tomorrow, players will have the opportunity to vote on two questions concerning the addition of green and red Area furni. Both items can be added if they receive 70% or more YES votes globally. If approved, they will be available in the Catalogue from March 17th to April 1st, and may return in the future. Only HC members are eligible to participate in the vote, which will remain open for one week.</p>', 'staff', 'Area furni poll announcement', '<p class=\"noticia_descripcion\"><strong>New InfoBus poll launches in Habbo Hotel: Origins!</strong> Vote on the addition of green and red Area furni! Both items could be released if they achieve the required YES votes. The poll is open to HC members for one week!</p>', 'com', '2025-03-05 09:08:39'),
(329, 'Enquete InfoBus: Mobis Area!', '2025-03-05-09-19-57', 'Catálogo Mobis Area', '<p><strong>O InfoBus abre com uma nova enquete sobre Mobis Area!</strong></p><p>A partir de amanhã, os jogadores poderão votar se os Mobis Area verdes e vermelhos devem ser adicionados ao Habbo Hotel: Origens. Para que ambos os Mobis sejam adicionados, cada um deve receber 70% ou mais de votos SIM globalmente. Se aprovados, estarão disponíveis no catálogo da HabboLoja de 17 de março a 1º de abril. Os Mobis Area não são considerados raros e podem retornar ao catálogo no futuro. A enquete ficará aberta por uma semana e apenas membros do HC poderão votar.</p>', 'staff', 'Enquete sobre Mobis Area no Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>A nova enquete do Habbo Hotel: Origens está no ar!</strong> Participe e decida sobre a adição dos Mobis Area verdes e vermelhos. Disponível para votação por uma semana, somente para membros do HC!</p>', 'com.br', '2025-03-05 09:20:16'),
(330, 'Encuesta InfoBus: ¡furnis Area!', '2025-03-05-09-21-12', 'Encuesta sobre furnis Area en Habbo Hotel', '<p><strong>Habbo Hotel: Orígenes invita a la comunidad a participar en la encuesta InfoBus sobre la inclusión de nuevos furnis!</strong></p><p>A partir de mañana, los jugadores podrán votar sobre la adición de los furnis Area rojos y verdes. Ambas líneas de furni pueden ser añadidas si obtienen un 70% o más de votos positivos a nivel global. Si se aprueban, estarán disponibles en el Catálogo a partir del 17 de marzo y se retirarán el 1 de abril. Es importante señalar que estos furnis no se consideran raros y podrían regresar en el futuro. Recuerda que solo los miembros del Habbo Club tienen derecho a votar en esta encuesta que permanecerá abierta durante una semana.</p>', 'staff', 'Encuesta sobre nuevos furnis en Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel: Orígenes te invita a participar en la encuesta sobre los nuevos furnis Area!</strong> Vota para decidir si se añadirán los furnis Area verdes y rojos. Solo los miembros del Habbo Club pueden participar.</p>', 'es', '2025-03-05 09:21:32'),
(331, 'Nova moeda disponível! Selos!', '2025-03-06-12-26-50', 'Catálogo Selos', '<p><strong>A nova moeda do Habbo Hotel: Origens: Selos!</strong></p><p>A partir de agora, os usuários podem ganhar e acumular Selos, uma nova moeda que combina bem com o estilo do Origens. A ideia foi trazida pela comunidade, e a criação foi aprovada pelo público. Um agradecimento especial vai para Eugeen, cujo design \'Goo\' foi um sério concorrente. Este novo recurso é uma adição emocionante ao ecossistema do jogo, proporcionando uma nova maneira para os jogadores interagirem e se engajarem.</p>', 'staff', 'nova moeda Selos no Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Uma nova moeda chega ao Habbo Hotel: Origens!</strong> Selos agora estão disponíveis para serem ganhos e acumulados. Descubra mais sobre esta nova adição!</p>', 'com.br', '2025-03-06 12:27:18'),
(332, 'Introducing Our New Earnable Currency: Stamps!', '2025-03-06-12-28-04', 'Stamps Currency Overview', '<p><strong>Habbo Hotel has announced a brand new earnable currency: Stamps!</strong></p><p>The design for the incoming Stamps currency aligns well with the look and feel of Origins, and the community has responded positively to the concept. Special recognition has been given to Frog for their innovative idea, along with a shout-out to Eugeen, whose \'Goo\' design was a close contender. Habbo appreciates the contributions and reactions from the community regarding design ideas.</p>', 'staff', 'New Earnable Currency: Stamps Announcement', '<p class=\"noticia_descripcion\"><strong>Exciting news from Habbo Hotel: Origins!</strong> Discover the newly introduced earnable currency, <strong>Stamps</strong>, designed with community input and a vibrant aesthetic. Stay tuned for more updates!</p>', 'com', '2025-03-06 12:28:22'),
(333, 'Nuestra nueva moneda de recompensa: ¡los sellos!', '2025-03-06-12-29-16', 'Catalogo Sellos', '<p><strong>Habbo ha presentado oficialmente los nuevos Sellos como su próxima moneda de recompensa.</strong></p><p>Gracias a la idea de Frog, la comunidad ha acogido bien este concepto, alineándose con la estética de Origins. Un agradecimiento especial se hace a Eugeen por su diseño alternativo de \'Goo\', que fue una opción destacada entre los diseños presentados. Se reconoce a todos los participantes por sus contribuciones y reacciones a los diseños.</p>', 'staff', 'nueva moneda de recompensa Sellos', '<p class=\"noticia_descripcion\"><strong>Habbo introduce una nueva moneda de recompensa: Sellos.</strong> La comunidad ha respondido positivamente a esta propuesta, que se ajusta al estilo de Origins. ¡No te pierdas esta nueva experiencia!</p>', 'es', '2025-03-06 12:29:36'),
(334, 'É a Funky Friday!', '2025-03-07-13-08-59', 'Catálogo Funky Friday', '<p><strong>A novidade da Habbo: É a Funky Friday!</strong></p><p>Durante 24 horas, diversos itens estarão disponíveis no Catálogo como parte da celebração da Funky Friday. Os usuarios poderão adquirir itens exclusivos, que também serão distribuídos na conta X/Twitter oficial. Não perca essa oportunidade de enriquecer sua coleção!</p>', 'funky_friday', 'promoção Funky Friday', '<p class=\"noticia_descripcion\"><strong>A Funky Friday chegou ao Habbo!</strong> Itens especiais estarão disponíveis por 24 horas no Catálogo. Aproveite e não perca essa chance!</p>', 'com.br', '2025-03-07 13:09:20'),
(335, 'It\'s FUNKY FRIDAY!', '2025-03-07-13-10-10', 'Funky Friday Event', '<p><strong>It\'s FUNKY FRIDAY!</strong></p><p>On this exciting day, Habbo is giving away a variety of items on their X/Twitter account, while also adding these items to the Catalogue for a limited time of 24 hours! This is a fantastic opportunity for players to grab exclusive content and enhance their experience in the virtual world.</p>', 'funky_friday', 'Funky Friday Promotion', '<p class=\"noticia_descripcion\"><strong>New items available on FUNKY FRIDAY!</strong> Check out and claim the special items being offered on Habbo\'s X/Twitter account, available for just 24 hours.</p>', 'com', '2025-03-07 13:10:27'),
(336, '¡Es Funky Friday!', '2025-03-07-13-11-22', 'Funky Friday en Habbo', '<p><strong>Habbo Hotel anuncia el Funky Friday!</strong></p><p>En este emocionante evento, se regalarán múltiples artículos a los seguidores a través de la cuenta oficial de X/Twitter. Además, todos estos productos estarán disponibles en el Catálogo durante 24 horas. Esta es una oportunidad única para que los usuarios adquieran valiosas recompensas y disfruten de la diversidad que ofrece Habbo Hotel.</p>', 'funky_friday', 'Funky Friday en Habbo', '<p class=\"noticia_descripcion\"><strong>¡Llegó el Funky Friday a Habbo Hotel!</strong> Aprovecha para obtener increíbles artículos que estarán disponibles durante 24 horas en el Catálogo. ¡No te lo pierdas!</p>', 'es', '2025-03-07 13:11:41'),
(337, 'Live now: Avatar Editor update!', '2025-03-07-19-13-12', 'Avatar Editor Update', '<p><strong>A big update has been rolled out for the Habbo Hotel: Origins Avatar Editor!</strong></p><p>The update makes it much easier and more convenient to select different items for your avatar, increasing the variety of items significantly. New clothing slots have been added, including waist, beard, chest accessory, glasses, and neck accessory. In addition, both regular and HC-exclusive items are now available, including items that existed in Habbo up until the shift to the Flash client in 2007 (v18)! Furthermore, Stamp-only items have been added to the Clothing Editor, although the means to obtain these items has not yet been implemented.</p>', 'staff', 'Avatar Editor Update Announcement', '<p class=\"noticia_descripcion\"><strong>An update for the Avatar Editor has been released!</strong> Discover the new features and a wider selection of items available now for your avatar in Habbo Hotel: Origins!</p>', 'com', '2025-03-07 19:13:30'),
(338, 'Atividades da semana com Cayde-6!', '2025-03-10-13-36-53', 'Evento de Cayde-6', '<p><strong>Participe das atividades da semana com Cayde-6!</strong></p><p>No dia 12 de março de 2023, às 12h (BR) / 15h (PT), os jogadores são convidados a se divertir em um jogo e a concorrer a prêmios. A localização será anunciada através das coordenadas (procure pela sala do Cayde-6). Não perca a chance de se juntar a Galaxy do .COM e aproveitar uma competição emocionante!</p>', 'staff', 'Atividades com Cayde-6 no evento', '<p class=\"noticia_descripcion\"><strong>Junte-se à diversão com Cayde-6!</strong> Participe do evento no dia 12 de março e concorra a prêmios. Não fique de fora!</p>', 'com.br', '2025-03-10 13:37:14'),
(339, '¡Actividades de la semana con Aleksander!', '2025-03-10-13-38-07', 'Actividades sorpresa de Aleksander', '<p><strong>¡No te pierdas las actividades sorpresas de la semana con Aleksander!</strong></p><p>El 12 de marzo a las 7hs MX / 14hs ES y el 13 de marzo a las 7hs MX / 14hs ES, ven a disfrutar de una experiencia divertida donde podrías ganar premios. Las coordenadas están disponibles para que encuentres la sala propiedad de Aleksander. ¡Mira las reglas y cómo jugar!</p>', 'staff', 'Actividades de la semana con Aleksander', '<p class=\"noticia_descripcion\"><strong>¡No te pierdas las actividades de la semana!</strong> Disfruta de sorpresas y premios con Aleksander el 12 y 13 de marzo. Coordina tu llegada a la sala y prepárate para divertirte.</p>', 'es', '2025-03-10 13:38:26'),
(340, 'Play Coordinates with Staff this week!', '2025-03-10-13-49-39', 'Play Coordinates game with staff', '<p><strong>Join the exciting new game of Coordinates with Staff this week!</strong></p><p>The events will be held on November 3rd at 3 PM GMT, November 12th at 4 PM GMT, and November 14th at 1 PM GMT. Players should search for the room owned by Huntermain for the first two dates and Aleksander\'s room for the third one. This game, created by COM Hotel user Galaxy, promises a fun experience for everyone involved. Don’t miss the chance to participate!</p>', 'staff', 'Join the Coordinates game with staff members', '<p class=\"noticia_descripcion\"><strong>New Coordinates game with Staff is here!</strong> Participate in the exciting Coordinates game on November 3rd, 12th, and 14th. Make sure to be there!</p>', 'com', '2025-03-10 13:49:58'),
(341, 'Novo raro disponível! Lime Saco de dormir', '2025-03-11-12-38-06', 'Catálogo Lime Saco de dormir', '<p><strong>O novo raro de Habbo Hotel: Origens: Lime Saco de dormir!</strong></p><p>Um Lime Saco de dormir foi adicionado ao catálogo de Habbo Hotel: Origens e está disponível por tempo limitado a um preço especial de 50 créditos. Este item raro pode ser encontrado na seção de Raros do Catálogo e estará disponível somente até às 9h BR / 12h PT do dia 13/03. Não perca a chance de adicionar esse item exclusivo à sua coleção!</p>', 'rares_martes', 'novo raro Lime Saco de dormir', '<p class=\"noticia_descripcion\"><strong>Chega um novo raro ao Habbo Hotel: Origens!</strong> Descubra e adquira o novo raro, <strong>Lime Saco de dormir</strong>, disponível por tempo limitado. Não fique de fora!</p>', 'com.br', '2025-03-11 12:38:25'),
(342, 'Rare item added to Catalogue: Lime Sleeping Bag', '2025-03-11-12-39-19', 'Lime Sleeping Bag in Catalogue', '<p><strong>The new rare item in Habbo Hotel: Origins: Lime Sleeping Bag!</strong></p><p>This unique Lime Sleeping Bag is available for a limited time at a special price of 50 credits. It can be found in the rare section of the Catalogue until 12pm GMT (4am PDT) on March 13. This item will never return to Habbo Hotel: Origins, so do not miss the opportunity to add it to your collection!</p>', 'rares_martes', 'New rare Lime Sleeping Bag on March 13', '<p class=\"noticia_descripcion\"><strong>A new rare has arrived at Habbo Hotel: Origins!</strong> Discover and acquire the limited-time rare, <strong>Lime Sleeping Bag</strong>, available for only 50 credits until March 13. Do not miss out!</p>', 'com', '2025-03-11 12:39:36'),
(343, 'Raro añadido al Catálogo: Saco de dormir Lima', '2025-03-11-12-40-36', 'Catalogo Saco de dormir Lima', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro en el catálogo: el Saco de dormir Lima.</strong></p><p>A partir de ahora, los usuarios pueden adquirir este único raro por 50 créditos. Estará disponible en la sección de raros del Catálogo hasta el 13 de marzo a las 6am CST / 1pm CET. Esta es una oportunidad excepcional, ya que estas piezas no volverán a salir en Habbo Hotel: Orígenes. ¡No se pierdan la posibilidad de agregar este raro a su colección!</p>', 'rares_martes', 'nuevo raro Saco de dormir Lima', '<p class=\"noticia_descripcion\"><strong>Un nuevo raro se lanza en Habbo Hotel: Orígenes!</strong> Descubre el <strong>Saco de dormir Lima</strong>, disponible por un tiempo limitado. ¡No te lo pierdas!</p>', 'es', '2025-03-11 12:40:56'),
(344, 'Construa um Pub no Origens', '2025-03-12-14-35-48', 'Competição de construção de pub para o Dia de São Patrício', '<p><strong>Participe da nova competição do Habbo Hotel: Origens, onde você pode construir o melhor pub para celebrar o Dia de São Patrício!</strong></p><p>A competição incentiva os jogadores a criar um ambiente acolhedor ou divertido, usando a criatividade e os itens disponíveis no jogo. O pub deve ser nomeado como \'Best Pub in the House 2025\' e as inscrições estão abertas até o dia 17 de março.</p>', 'staff', 'competição de construção de pub para o Dia de São Patrício', '<p class=\"noticia_descripcion\"><strong>Competição de pub no Habbo Hotel: Origens!</strong> Crie um pub incrível e celebre o Dia de São Patrício para concorrer a prêmios incríveis.</p>', 'com.br', '2025-03-12 14:36:10'),
(345, 'Resultados da enquete Infobus Mobis Area', '2025-03-13-15-44-37', 'Catálogo Mobis Area', '<p><strong>A enquete sobre a adição dos Mobis Area no Habbo Hotel: Origens resultou!</strong></p><p>Após uma semana de votação, os usuários decidiram favoravelmente pela inclusão das versões verdes e vermelhas dos Mobis Area. Os Mobis verdes receberam 86,3% de votos a favor, enquanto os vermelhos tiveram 84,6%. Além disso, 79,7% dos participantes optaram por tornar essa linha de mobis permanente no catálogo. Os Mobis serão adicionados no dia 17 de março e removidos em 1º de abril, mas poderão retornar no futuro.</p>', 'staff', 'resultados da enquete Mobis Area', '<p class=\"noticia_descripcion\"><strong>Resultados da enquete sobre os Mobis Area!</strong> As versões verdes e vermelhas serão adicionadas ao catálogo em 17 de março, com 86,3% e 84,6% de votos positivos, respectivamente. Não perca!</p>', 'com.br', '2025-03-13 15:44:58'),
(346, 'Green and Red Area Furni Coming to Habbo Hotel: Origins!', '2025-03-13-15-45-50', 'Area furni green and red versions', '<p><strong>Habbo Hotel: Origins announces the upcoming addition of green and red versions of the Area furni line!</strong></p><p>Following a recent poll held among the community, the vast majority voted in favor of introducing these new items. The green Area furni received 86.3% approval, while the red variant garnered 84.6%. Upon approval, the new furni will be added to the Catalogue on March 17th, remaining available until April 1st, with the possibility of future re-introduction.</p>', 'staff', 'green and red Area furni announcement', '<p class=\"noticia_descripcion\"><strong>Exciting updates for Habbo Hotel: Origins!</strong> The community has spoken, and the new green and red Area furni will be available soon. Don\'t miss out on this limited-time offer!</p>', 'com', '2025-03-13 15:46:10'),
(347, 'Atualização do Editor de Avatar disponível!', '2025-03-14-08-06-05', 'Atualização do Editor de Avatar do Habbo Hotel', '<p><strong>A atualização do Editor de Avatar do Habbo Hotel: Origens já está disponível!</strong></p><p>Na última sexta-feira, Habbo lançou uma grande atualização que torna muito mais fácil e prático selecionar diferentes itens para vestir seu avatar. A variedade de itens disponíveis aumentou consideravelmente, incluindo novos tipos de roupas e acessórios. Essa atualização traz novidades como novos espaços para roupas e itens regulares e exclusivos do HC, além de novos itens adquiridos que estavam disponíveis até a transição para o cliente Flash, começando pelos itens de 2007 (v18).!</p>', 'staff', 'Atualização do Editor de Avatar do Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>A atualização do Editor de Avatar foi lançada!</strong> Descubra as novas opções e a variedade de itens que agora estão disponíveis para vestir seu avatar. Não perca!</p>', 'com.br', '2025-03-14 08:06:27'),
(348, 'É a Funky Friday!', '2025-03-14-12-17-24', 'Catálogo Funky Friday', '<p><strong>A Funky Friday chegou ao Habbo Hotel!</strong></p><p>Além de distribuir vários itens especiais em sua conta X/Twitter, Habbo também os adicionará ao Catálogo por 24 horas! Não perca essa oportunidade de adquirir itens únicos e aproveitar essa promoção exclusiva.</p>', 'funky_friday', 'promoção Funky Friday', '<p class=\"noticia_descripcion\"><strong>Funky Friday chegou no Habbo Hotel!</strong> Itens especiais estarão disponíveis por 24 horas. Aproveite esta chance exclusiva!</p>', 'com.br', '2025-03-14 12:17:41'),
(349, 'It\'s FUNKY FRIDAY!', '2025-03-14-12-18-34', 'Funky Friday Event', '<p><strong>It\'s FUNKY FRIDAY!</strong></p><p>On this special day, Habbo is celebrating with exciting giveaways on their X/Twitter account. Additionally, a variety of items will be added to the Catalogue for a limited time of 24 hours. This is a unique opportunity for users to acquire exclusive items while the event lasts. Be sure to check the Catalogue and participate in the giveaways!</p>', 'funky_friday', 'Funky Friday Event Announcement', '<p class=\"noticia_descripcion\"><strong>Funky Friday has arrived at Habbo!</strong> Join the celebration with exclusive items available for just 24 hours and exciting giveaways on Habbo\'s X/Twitter account. Don\'t miss out!</p>', 'com', '2025-03-14 12:18:51'),
(350, '¡Funky Friday en Habbo Hotel!', '2025-03-14-12-19-48', 'Evento Funky Friday en Habbo', '<p><strong>¡Es Funky Friday en Habbo Hotel!</strong></p><p>En esta ocasión, la plataforma ha decidido celebrar este día especial regalando una gran variedad de artículos desde su cuenta de X/Twitter. Además, todos esos artículos estarán disponibles en el Catálogo de Habbo durante 24 horas. Los jugadores no querrán perderse la oportunidad de conseguir estas increíbles sorpresas y regalos, así que deberán estar atentos a la cuenta oficial y al catálogo.</p>', 'funky_friday', 'Funky Friday en Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Funky Friday llega a Habbo Hotel!</strong> No te pierdas la oportunidad de obtener artículos increíbles en el Catálogo por tiempo limitado y algunos más a través de la cuenta oficial de X/Twitter. ¡Aprovecha esta celebración!</p>', 'es', '2025-03-14 12:20:06'),
(351, 'Apresentando: O Círculo de Criadores', '2025-03-14-17-10-49', 'Círculo de Criadores do Origins', '<p><strong>O Círculo de Criadores é uma nova iniciativa do Habbo Hotel: Orígenes!</strong></p><p>A equipe de Habbo anunciou um novo programa para apoiar jogadores na criação de jogos, eventos e atividades dentro do hotel. O programa, denominado Círculo de Criadores, permitirá que os jogadores recebam recursos e apoio para desenvolver atividades inovadoras, promovendo mais interação na plataforma. Inicialmente, um criador de cada comunidade será convidado a participar por quatro meses, ajudando a ajustar o programa conforme as necessidades de cada grupo de jogadores.</p>', 'staff', 'Círculo de Criadores do Habbo', '<p class=\"noticia_descripcion\"><strong>Habbo Hotel: Orígenes apresenta o Círculo de Criadores!</strong> Este novo programa visa dar suporte a criadores na elaboração de atividades e eventos, promovendo mais engajamento entre os jogadores. Fique atento às novidades!</p>', 'com.br', '2025-03-14 17:11:14'),
(352, 'Introducing: The Creators Circle', '2025-03-14-17-12-07', 'Creators Circle Announcement', '<p><strong>The Creators Circle has been launched by Habbo as a response to community feedback seeking more player-run activities.</strong></p><p>This new program invites selected players to create games, events, and activities with support from the Origins team, enhancing the player experience within the game.</p><p>Creators will be invited from different communities to participate for a limited time, where they can create their own in-game activities with provided assets, including credits and special furniture. All events must be approved by the team, ensuring quality and alignment with community standards.</p><p>This initiative starts with one creator from each hotel, with their participation lasting for four months. After this period, new creators will be introduced, allowing fresh ideas and preventing burnout among participants. Creators will also have access to a dedicated Discord channel for collaboration.</p><p>To be considered for the Creators Circle, event creators should showcase their activities on X and Discord, attracting the attention of the Origins team for potential inclusion in the program.</p>', 'staff', 'Announcement of the new Creators Circle', '<p class=\"noticia_descripcion\"><strong>Habbo introduces the Creators Circle!</strong> The new program allows selected players to run their own events and activities within Origins, with full support from the team. Discover how to get involved!</p>', 'com', '2025-03-14 17:12:28'),
(353, 'Te presentamos el Círculo de Creadores', '2025-03-14-17-13-22', 'Anuncio del Círculo de Creadores en Habbo', '<p><strong>¡Nace el Círculo de Creadores en Habbo Hotel: Orígenes!</strong></p><p>Con el objetivo de apoyar a los jugadores en la organización de actividades y eventos, Habbo ha lanzado el Círculo de Creadores. Este programa invita a creativos de las diferentes comunidades a participar en la creación de eventos y juegos. Cada miembro contará con un personaje exclusivo para esta labor, con provisiones por parte de Habbo. El programa comenzará con una selección de creadores por comunidad, quienes podrán desarrollar propuestas libres bajo la supervisión del equipo de Origins.</p>', 'staff', 'Círculo de Creadores en Habbo', '<p class=\"noticia_descripcion\"><strong>El Círculo de Creadores ya es una realidad en Habbo Hotel: Orígenes!</strong> Una nueva iniciativa que permite a los jugadores organizar eventos y juegos con el apoyo de Habbo. ¡No te pierdas esta oportunidad de participar!</p>', 'es', '2025-03-14 17:13:41'),
(354, 'Festa no Pub para o Dia de São Patrício', '2025-03-16-13-50-33', 'Evento especial do Dia de São Patrício no pub', '<p><strong>O Dia de São Patrício é uma celebração sagrada para os irlandeses e muitas outras pessoas em todo o mundo!</strong></p><p>O pub Dirty Duck convida todos para um evento especial ao vivo no Dia de São Patrício, que ocorrerá amanhã, dia 17 de março, às 12h BR/15h PT. Traga seus amigos e boas vibrações!</p><p>Ainda haverá uma atividade secreta em disputa para os vencedores, organizada com a ajuda da Spidercides. Fique atento para descobrir como ganhar prêmios raros!</p>', 'staff', 'Festa do Dia de São Patrício no Dirty Duck', '<p class=\"noticia_descripcion\"><strong>Participe da festa de São Patrício no Dirty Duck!</strong> O evento acontece amanhã, às 12h BR, com prêmios em uma atividade secreta. Não perca!</p>', 'com.br', '2025-03-16 13:50:56'),
(355, 'Down the pub for St Patrick’s Day', '2025-03-16-13-51-47', 'St Patrick\'s Day Celebration at the Pub', '<p><strong>The celebration of St Patrick’s Day at the pub is a cherished tradition for the Irish and many others worldwide!</strong></p><p>Join the special St Patrick’s Day Live Event at the Dirty Duck pub on March 17th at 3pm GMT. Participants are encouraged to come with friends and enjoy good vibes. There’s also a chance to win a rare item in a secret activity supported by Spidercides. Details of this activity will be revealed during the event. Don’t miss out on the fun!</p>', 'staff', 'St Patrick\'s Day Event Announcement', '<p class=\"noticia_descripcion\"><strong>A special event for St Patrick\'s Day is happening at the Dirty Duck pub!</strong> Join at 3pm GMT on March 17th for fun, friends, and a chance to win a rare item through a surprise activity. Be there!</p>', 'com', '2025-03-16 13:52:05'),
(356, 'Quedada en el pub por el Día de San Patricio', '2025-03-16-14-03-25', 'Celebración del Día de San Patricio en el pub', '<p><strong>El Día de San Patricio es una celebración sagrada para los irlandeses y muchas personas en todo el mundo.</strong></p><p>Habbo invitan a todos a un evento especial en el Pub Finnegan mañana, 17 de marzo, a las 3 p. m. GMT. Habrá buena compañía, buenas vibraciones y la oportunidad de participar en una actividad secreta organizada en colaboración con Spidercides, donde se podrá ganar un raro.</p>', 'staff', 'Quedada especial por el Día de San Patricio', '<p class=\"noticia_descripcion\"><strong>El Día de San Patricio llega al Pub Finnegan!</strong> Únete a la celebración mañana a las 3 p. m. GMT. Podrás participar en una actividad secreta con la oportunidad de ganar un raro. ¡No te lo pierdas!</p>', 'es', '2025-03-16 14:03:43'),
(357, 'New Rare Available! The Green Ice Cream Machine', '2025-03-17-12-27-09', 'Catalogue Green Ice Cream Machine', '<p><strong>The new rare item in Habbo Hotel: Origins: Green Ice Cream Machine!</strong></p><p>On March 19, 2023, a new rare item, the <strong>Green Ice Cream Machine</strong>, becomes available in the rare section of the Catalogue for a limited time at the price of 50 credits. This item will only be available until 12pm GMT (4am PDT) on the release day. Be sure to grab this unique piece for your collection, as it will never be released again in Habbo Hotel: Origins!</p>', 'rares_martes', 'new rare Green Ice Cream Machine release', '<p class=\"noticia_descripcion\"><strong>A new rare arrives in Habbo Hotel: Origins!</strong> Discover and acquire the new rare, <strong>Green Ice Cream Machine</strong>, available for a limited time. Don\'t miss out!</p>', 'com', '2025-03-17 12:27:32'),
(358, 'Raro añadido al Catálogo: La Heladera Verde', '2025-03-17-12-28-20', 'Catalogo La Heladera Verde', '<p><strong>Habbo Hotel: Orígenes presenta un nuevo raro: La Heladera Verde!</strong></p><p>Desde el lanzamiento de este raro, La Heladera Verde, se encuentra disponible en la sección de raros del catálogo por un precio de 50 créditos. Este raro estará en el catálogo solo hasta el 19 de marzo a las 6am CST / 1pm CET. Los jugadores deben aprovechar esta oportunidad, ya que estas piezas no volverán a salir en Habbo Hotel: Orígenes.</p>', 'rares_martes', 'nuevo raro La Heladera Verde', '<p class=\"noticia_descripcion\"><strong>Llega un nuevo raro a Habbo Hotel: Orígenes!</strong> Descubre y adquiere el nuevo raro, <strong>La Heladera Verde</strong>, disponible solo hasta el 19 de marzo. ¡No te lo pierdas!</p>', 'es', '2025-03-17 12:28:38'),
(359, 'Encontre o Trevo de Quatro Folhas!', '2025-03-17-15-35-25', 'Labirinto de Trevos de Quatro Folhas', '<p><strong>Prepare-se para uma nova aventura no Habbo Hotel!</strong></p><p>Os jogadores são desafiados a encontrar três Trevos de Quatro Folhas escondidos no labirinto elaborado pelo Spidercides na conta da Morgana. Para participar, basta tirar uma captura de tela de cada um dos trevos, circulá-los e enviar as imagens através do Formulário do Google. As 10 primeiras pessoas a completarem esse desafio receberão um raro desta semana! A expectativa é que os prêmios sejam enviados para os vencedores amanhã, com os nomes sendo anunciados na conta do X e no Discord.</p>', 'staff', 'Desafio de encontrar Trevos de Quatro Folhas', '<p class=\"noticia_descripcion\"><strong>Desafio em Habbo Hotel!</strong> Encontre os três Trevos de Quatro Folhas e concorra a um raro! Participe enviando as capturas de tela. Boa sorte!</p>', 'com.br', '2025-03-17 15:35:48'),
(360, 'Find the Four Leaf Clover!', '2025-03-17-15-36-37', 'Four Leaf Clover Locations', '<p><strong>Habbo has announced a new challenge: Find the Four Leaf Clover!</strong></p><p>Players are required to locate three Four Leaf Clovers in Spidercide’s maze, take screenshots of each location, circle them, and submit the images through a provided Google Form. The first ten players to successfully submit the three locations will be rewarded with this week’s rare item. Prizes are expected to be distributed by tomorrow, and winners will be announced via Habbo\'s X account and Discord channel.</p>', 'staff', 'Find the Four Leaf Clovers challenge announcement', '<p class=\"noticia_descripcion\"><strong>A new challenge is here!</strong> Players can win rare items by finding the <strong>Four Leaf Clovers</strong>. Hurry, as only the first ten participants will be rewarded!</p>', 'com', '2025-03-17 15:36:57'),
(361, '¡Encuentra el trébol de cuatro hojas!', '2025-03-17-15-37-48', 'Encuentra los tréboles de cuatro hojas', '<p><strong>¡Encuentra los tréboles de cuatro hojas en el laberinto!</strong></p><p>Habbo invita a sus usuarios a buscar los tres tréboles de cuatro hojas en el laberinto creado por Spidercides. Los participantes deben hacer capturas de pantalla de cada ubicación, rodeándolas con un círculo, y enviarlas a través de un formulario de Google. Las primeras 10 personas en encontrar los tréboles ganarán el raro de esta semana. Los premios se enviarán el día siguiente y se anunciarán los ganadores en la cuenta de X y en Discord.</p>', 'staff', 'actividad de búsqueda de tréboles', '<p class=\"noticia_descripcion\"><strong>Participa en la búsqueda de tréboles de cuatro hojas en el laberinto!</strong> Completa el desafío y puedes ganar un raro. ¡Apresúrate, actúa rápido!</p>', 'es', '2025-03-17 15:38:07'),
(362, '¡Actividades de la semana con Aleksander!', '2025-03-18-11-39-46', 'Actividades sorpresa con Aleksander', '<p><strong>¡No te pierdas las actividades de la semana con Aleksander!</strong></p><p>El día 20 de marzo de 2024, a las 7:00 AM hora de México y a las 2:00 PM hora de España, se llevará a cabo una actividad sorpresa en Delivery #Shamrock, en la sala propiedad de Aleksander. Los asistentes tendrán la oportunidad de divertirse y, ¡quizás ganar algún premio! No olvides unirte a la diversión.</p>', 'staff', 'Actividades de la semana con Aleksander', '<p class=\"noticia_descripcion\"><strong>Diviértete con Aleksander esta semana!</strong> Asiste a la actividad sorpresa el 20 de marzo y participa para ganar premios. ¡Te esperamos!</p>', 'es', '2025-03-18 11:40:10'),
(363, 'Find the Four Leaf Clover: winners', '2025-03-18-15-47-17', 'Four Leaf Clover Winners', '<p><strong>Habbo has announced the winners of the Find the Four Leaf Clover event!</strong></p><p>The fastest ten players who successfully found and submitted the clovers have been revealed. Congratulations to <strong>Dinosaurio</strong>, <strong>Widowmaker</strong>, <strong>Dreads</strong>, <strong>caya</strong>, <strong>Shrimp</strong>, <strong>Roflzor</strong>, <strong>ChrisYepYep</strong>, <strong>groot</strong>, <strong>Desolated</strong>, and <strong>Funkydonuts</strong>! Each winner will receive a trophy and this week\'s rare item as a prize. </p>', 'staff', 'Find the Four Leaf Clover Event Winners', '<p class=\"noticia_descripcion\"><strong>Congratulations to the winners of the Find the Four Leaf Clover event!</strong> The fastest ten players have claimed their prizes, including a trophy and a rare item. Don\'t miss the next event!</p>', 'com', '2025-03-18 15:47:37'),
(364, 'Búsqueda de los tréboles de cuatro hojas!', '2025-03-18-15-48-29', 'Catálogo de los tréboles de cuatro hojas', '<p><strong>Habbo Hotel organiza una emocionante búsqueda de tréboles de cuatro hojas!</strong></p><p>Los jugadores han competido para encontrar los tréboles más rápido, y los 10 primeros en encontrarlos son: w!gu3, Sukii, HighClaSs, XUCO, Vulpes, BaKu, xuco, SpectracK, iJN y DM-AVENGER. Estos afortunados recibirán un trofeo y el artículo raro de esta semana como reconocimiento por su velocidad en la búsqueda. ¡No te lo pierdas!</p>', 'staff', 'Búsqueda de tréboles de cuatro hojas en Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>¡Habbo Hotel lanza una búsqueda de tréboles de cuatro hojas!</strong> Conoce a los 10 ganadores que recibirán un trofeo y un artículo raro por su velocidad. ¡Felicidades a todos!</p>', 'es', '2025-03-18 15:48:47'),
(365, 'Four Leaf Clover Hunt WINNERS', '2025-03-18-17-23-21', 'Four Leaf Clover winners announcement', '<p><strong>The winners of the Four Leaf Clover Hunt have been announced!</strong></p><p>The top 10 fastest Habbos to find and submit the Four Leaf Clovers are: Dinosaurio, Widowmaker, Dreads, caya, Shrimp, Roflzor, ChrisYepYep, groot, Desolated, and Funkydonuts. Congratulations to all winners! They will receive a trophy and this week\'s rare as a prize!</p>', 'staff', 'Four Leaf Clover Hunt winners', '<p class=\"noticia_descripcion\"><strong>The results of the Four Leaf Clover Hunt are in!</strong> The fastest 10 Habbos have been rewarded, with a trophy and rare item as prizes. Congratulations to all participants!</p>', 'com', '2025-03-18 17:23:39'),
(366, 'Winners of the weekend treasure hunt!', '2023-10-15-10-20-00', 'Treasure Hunt Winners Announcement', '<p><strong>What an event! Congrats to everyone who attended, and special thanks to Dovak, Frenkie, and Thinkable for organizing and hosting!</strong></p><p>The winners from the weekend treasure hunt have been announced, highlighting the top performers from each of the first three days along with a comprehensive list of winners from Monday\'s special treasure hunt event.</p>', 'staff', 'treasure hunt winners list', '<p class=\"noticia_descripcion\"><strong>Discover the winners of the weekend treasure hunt!</strong> Habbo has officially announced the winners from the treasure hunt event, showcasing outstanding players and their achievements.</p>', 'com', '2025-03-18 20:09:18'),
(367, 'Shamrock Did It Again!', '2025-03-20-19-10-36', 'Shamrock\'s Lost Items', '<p><strong>Shamrock has lost three of his lucky Four Leaf Clovers again!</strong></p><p>After finding three of them on Monday, Shamrock has misplaced them once more thanks to St. Patrick\'s Day festivities. Players are invited to help search for these missing clovers in the \'Shamrock\'s Lost Items\' room this Saturday at 11PM GMT (4PM PDT, 7PM EDT). Participants must take screenshots of the clovers and share them on X or Imgur. The first 10 Habbos to accomplish this task will win a fantastic prize!</p>', 'staff', 'Shamrock\'s Lost Clovers Event', '<p class=\"noticia_descripcion\"><strong>Shamrock needs your help to find his lost Four Leaf Clovers!</strong> Join him this Saturday at 11PM GMT for a thrilling search. The first 10 to submit their findings will receive an awesome prize. Don\'t miss out on the fun!</p>', 'com', '2025-03-20 19:11:04');
INSERT INTO `noticias` (`id`, `titulo`, `imagen_completa`, `alt_imagen_completa`, `descripcion_completa`, `imagen_resumida`, `alt_imagen_resumida`, `descripcion_resumida`, `hotel`, `fecha_noticia`) VALUES
(368, 'It\'s FUNKY FRIDAY!', '2025-03-21-12-19-02', 'Funky Friday Event', '<p><strong>It\'s FUNKY FRIDAY at Habbo!</strong></p><p>On this festive day, Habbo is celebrating by giving away a load of special items on their X/Twitter account. Additionally, these items will be available in the Catalogue for 24 hours only! Don\'t miss this chance to grab some unique items for your collection.</p>', 'funky_friday', 'Funky Friday giveaway', '<p class=\"noticia_descripcion\"><strong>Funky Friday is here at Habbo!</strong> Join the celebration and take advantage of exclusive items available only for 24 hours. Make sure you don’t miss out!</p>', 'com', '2025-03-21 12:19:19'),
(369, '¡Es Funky Friday!', '2025-03-21-12-20-14', 'Evento Funky Friday en Habbo', '<p><strong>Habbo Hotel celebra el Funky Friday!</strong></p><p>Hoy, 21 de marzo de 2025, Habbo anuncia que durante 24 horas estarán disponibles un montón de artículos en el Catálogo, además de los sorteos realizados desde su cuenta de X/Twitter. Los traders están invitados a participar en esta celebración especial y aprovechar las ofertas únicas que solo estarán disponibles por tiempo limitado. ¡No se pierdan la oportunidad de adquirir estos artículos y disfrutar de la fiesta del Funky Friday!</p>', 'funky_friday', 'Detalles del evento Funky Friday', '<p class=\"noticia_descripcion\"><strong>Funky Friday en Habbo Hotel!</strong> Durante 24 horas, Habbo lanza ofertas especiales en el Catálogo. ¡No dejen escapar la diversión!</p>', 'es', '2025-03-21 12:20:35'),
(370, 'É a Funky Friday!', '2025-03-21-12-31-39', 'Catálogo Funky Friday', '<p><strong>Funky Friday chegou ao Habbo Hotel!</strong></p><p>Além de oferecer vários itens em sua conta X/Twitter, Habbo anunciou que adicionará esses itens ao Catálogo por um período limitado de 24 horas. Não perca a chance de adquirir itens exclusivos e faça parte dessa celebração especial!</p>', 'funky_friday', 'evento Funky Friday no Habbo Hotel', '<p class=\"noticia_descripcion\"><strong>Funky Friday está de volta no Habbo Hotel!</strong> Itens exclusivos estarão disponíveis no Catálogo por 24 horas. Aproveite essa oportunidade única!</p>', 'com.br', '2025-03-21 12:31:59'),
(371, 'O negócio paralelo do seu pub', '2025-03-21-13-24-09', 'Desafio de criação de quartos com tema de pub', '<p><strong>Participe do desafio e crie uma sala que represente o negócio paralelo do seu pub!</strong></p><p>Construtores e amantes de atividades criativas, a Habbo apresenta uma nova competição onde cada um deve criar um ambiente intrigante e questionável que represente um pub. As construções podem variar de festas clandestinas a bares bizarros. Use a criatividade e ofereça uma proposta divertida. O nome do quarto deve ser \'O negócio paralelo do meu Pub 2025\' e deve ser criado em um layout de 104 quadrados. O prazo para participação é até 31 de março, às 4:00 (BR) / 8:00 (PT).</p>', 'staff', 'desafio de criação de sala no Habbo', '<p class=\"noticia_descripcion\"><strong>Participe da nova competição da Habbo!</strong> Crie uma sala representando o \'negócio paralelo do seu pub\' e mostre sua criatividade. Não perca essa oportunidade!</p>', 'com.br', '2025-03-21 13:24:37'),
(372, 'Daily Challenges Now Live!', '2025-03-21-16-53-14', 'Daily Challenges in Habbo Hotel: Origins', '<p><strong>Daily Challenges have been launched in Habbo Hotel: Origins!</strong></p><p>Players can log in every day to complete randomly assigned challenges and earn Stamps. Each avatar can tackle up to three daily challenges, while HC members enjoy additional challenges. Completing these tasks rewards players with Stamps, a secondary currency that can be used to purchase clothing and other items in the future. The team behind Habbo has plans to expand the ways to earn Stamps through competitions, social media, and events on Discord.</p>', 'staff', 'Daily Challenges announcement', '<p class=\"noticia_descripcion\"><strong>A new feature has arrived in Habbo Hotel: Origins!</strong> Daily Challenges are now live, allowing players to earn Stamps by completing tasks each day. Don\'t miss the chance to engage and collect rewards!</p>', 'com', '2025-03-21 16:53:32');
