INSERT INTO `recordatorios` (`id`, `usuario`, `mensaje`, `intervalo_minutos`, `duracion_dias`, `fecha_inicio`, `activo`, `fecha_creacion`) VALUES
(3, '573145944184@c.us', 'Escribe !help para ver todos los comandos disponibles que tengo para ti.', 0, 365, '2024-05-06 20:15:59', 1, '2024-05-13 21:24:05'),
(4, '573145944184@c.us', 'Con el comando !almanax puedes saber el almanax de hoy y con el comando !almanax-año/mes/dia puedes saber el almanax de un dia en especifico', 0, 365, '2024-05-06 20:23:02', 1, '2024-05-13 21:24:05'),
(5, '573145944184@c.us', 'El comando !buscarMD llama a todos los manos derecha del gremio, usarlo con sabiduría :)', 0, 365, '2024-05-06 20:28:07', 1, '2024-05-13 21:24:05'),
(6, '573145944184@c.us', 'El comando !lider llama al lider del gremio (solo usar cuando un mano derecha no puede o no tiene la solución o respuesta a algo)', 0, 365, '2024-05-06 20:29:36', 1, '2024-05-13 21:24:05'),
(7, '573145944184@c.us', 'Si necesitas algún oficio y quieres saber si ahi el artesano en el gremio escribe !oficio-nombre_del_oficio , si necesitas un minero escribe !oficio_minero , si necesitas un sastremago es !oficio_sastremago, para oficios con espacios solo usa _ en vez de espacio, por ejemplo !oficio-forjador_de_palas', 0, 365, '2024-05-06 20:31:40', 1, '2024-05-13 21:24:05'),
(8, '573145944184@c.us', 'Si no conoces las reglas del gremio y grupo, puedes ver la descripción de este grupo de whatsapp o escribir !reglas', 0, 365, '2024-05-06 20:32:17', 1, '2024-05-13 21:24:05'),
(9, '573145944184@c.us', 'Si quieres saber cuando es el proximo dia donde el almanax da un bonus de XP escribe !xpday', 0, 365, '2024-05-06 20:32:43', 1, '2024-05-13 21:24:05'),
(10, '573145944184@c.us', 'Para saber que sorteos y premios tenemos actualmente en el gremio escribe !premios', 0, 365, '2024-05-06 20:33:20', 1, '2024-05-14 03:44:55'),
(11, '573145944184@c.us', 'En el gremio tenemos MARKETPLACE para verlo usa los comandos !vervendedores o !vercompradores según necesites, para tu vender o comprar utiliza los comandos !vendo , !compro, si te interesa saber mas usa el comando !help para saber todos los comandos del MARKETPLACE', 360, 365, '2024-08-18 15:32:59', 1, '2024-08-18 20:32:59'),
(12, '573145944184@c.us', 'Los rangos y permisos dentro del juego se manejan automáticamente con otro BOT solo necesitas cumplir ciertos rango de xp donada al gremio', 0, 365, '2024-05-06 20:42:19', 1, '2024-05-13 21:24:05'),
(17, '573145944184@c.us', 'Se venden MKS a 11.000, si les interesa escribirle al +573145944184 o usar el comando !lider', 480, 365, '2024-05-31 21:13:59', 0, '2024-06-01 02:19:58'),
(18, '573145944184@c.us', 'Compro MKS a 11.000 cop nequi escriban a +573145944184 o usen el comando !lider', 60, 365, '2024-05-19 21:34:59', 0, '2024-05-20 03:23:19');
